",\"text\":\"\\\\procedure outside-line-starts() [[9]] [[0]]\\n\\\\function is-outside-line-or-operator() [split[]first[]] :intersection[enlist<outside-line-starts>]\\n\\\\function phone.outside-line-or-operator(number) [<number>] :filter[function[is-outside-line-or-operator]]\\n\\nWill dialing these numbers give you an outside line or an operator (number begins with a 9 or a 0, respectively)?\\n\\n* Yes: {{{ [phone.outside-line-or-operator[92223334444]] }}}\\n* No: {{{ [phone.outside-line-or-operator[2223334444]] }}}\"},\"Sn:ParameterlessProcedure\":{\"title\":\"Sn:ParameterlessProcedure\",\"created\":\"20210116204238244\",\"modified\":\"20240929014113123\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure disclaimer()\\n(This paragraph does not represent the formal opinion of my company.)\\n\\\\end\\n\\nYou need to use the Really Annoying Five-Factor Authentication Process to get into the Employee Information System if it is a Tuesday, unless you have also purchased coffee (tea or pastries do not count) in the company cafeteria earlier in the day. <<disclaimer>>\"},\"Sn:ProcedureCallTransclusion\":{\"title\":\"Sn:ProcedureCallTransclusion\",\"created\":\"20210818205917912\",\"modified\":\"20240929013919836\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure partial-name(suffix) Tiddler <<suffix>>\\n\\n{{{ [<partial-name \\\"Forty-Two\\\">] }}}\"},\"Sn:ProcedureParameterNames\":{\"title\":\"Sn:ProcedureParameterNames\",\"created\":\"20210116205418754\",\"modified\":\"20240929014004310\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure wikipediaLink(articleName, linkText)\\n  <a href=`https://en.wikipedia.org/wiki/$(articleName)$`>\\n  <<linkText>></a>\\n\\\\end\\n\\n<<wikipediaLink linkText:\\\"Wikipedia on Aardvarks\\\" articleName:Aardvark>>\"},\"Sn:QuoteWithinQuotesProcedure\":{\"title\":\"Sn:QuoteWithinQuotesProcedure\",\"created\":\"20210116204322898\",\"modified\":\"20240929014123683\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure wikipediaLink(articleName, linkText)\\n  <a href=`https://en.wikipedia.org/wiki/$(articleName)$`>\\n  <<linkText>></a>\\n\\\\end\\n\\n<<wikipediaLink Aardvark \\\"What is an \\\"aardvark\\\"?\\\">>\"},\"Sn:QuotedProcedureExpansion\":{\"title\":\"Sn:QuotedProcedureExpansion\",\"created\":\"20210116210438040\",\"modified\":\"20240929014243527\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure wikipediaLink(articleName, linkText:\\\"Wikipedia Link\\\")\\n  <a href=`https://en.wikipedia.org/wiki/$(articleName)$`>\\n  <<linkText>></a>\\n\\\\end\\n\\n<$let\\n  article=\\\"Aardvark\\\"\\n  description=\\\"An animal\\\"\\n>\\n\\n* <$transclude $variable=\\\"wikipediaLink\\\" articleName=\\\"<<article>>\\\" linkText=\\\"<<description>>\\\" />\\n\\n</$let>\"},\"Sn:RadioExample\":{\"title\":\"Sn:RadioExample\",\"created\":\"20210206211525320\",\"modified\":\"20210817225402878\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"What do you want to look at?\\n\\n<$radio tiddler=\\\"$:/temp/RadioExample\\\" value=\\\"Exercise\\\">&nbsp;Exercises</$radio>&ensp;\\n<$radio tiddler=\\\"$:/temp/RadioExample\\\" value=\\\"Section\\\">&nbsp;Sections</$radio>&ensp;\\n<$radio tiddler=\\\"$:/temp/RadioExample\\\" value=\\\"Takeaway\\\">&nbsp;Takeaways</$radio>\\n\\n<<list-links \\\"[all[tiddlers+shadows]tag{$:/temp/RadioExample}first[5]]\\\">>\"},\"Sn:RevealWidgetTest\":{\"title\":\"Sn:RevealWidgetTest\",\"created\":\"20210123192959878\",\"modified\":\"20210123200233191\",\"showtest\":\"no\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$checkbox field=\\\"showtest\\\" checked=\\\"yes\\\" unchecked=\\\"no\\\"> Show the text</$checkbox>\\n\\n<$reveal state=\\\"!!showtest\\\" type=\\\"match\\\" text=\\\"yes\\\">\\n  Here is the text!\\n</$reveal>\"},\"Sn:ReversedOptParameters\":{\"title\":\"Sn:ReversedOptParameters\",\"created\":\"20240928184704511\",\"modified\":\"20240928184704511\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure wikipediaLink(linkText:\\\"Wikipedia Link\\\", articleName)\\n  <a href=`https://en.wikipedia.org/wiki/$(articleName)$`>\\n  <<linkText>></a>\\n\\\\end\\n\\n<<wikipediaLink Aardvark>>\\n<<wikipediaLink \\\"Wikipedia on aardvarks\\\" Aardvark>>\"},\"Sn:RubberDucking\":{\"title\":\"Sn:RubberDucking\",\"created\":\"20210121000555417\",\"modified\":\"20210606031219939\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$list filter=\\\"[all[tiddlers+shadows]tag[Section]field;parent[Filtering and Formatting]sort[]get[description]\\\">\\n  <<currentTiddler>><br>\\n</$list>\"},\"Sn:RubberDuckingCorrected\":{\"title\":\"Sn:RubberDuckingCorrected\",\"created\":\"20210121000836750\",\"modified\":\"20210606031228949\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$list filter=\\\"[all[tiddlers+shadows]tag[Section]field:parent[Filtering and Formatting]get[description]sort[]]\\\">\\n  <<currentTiddler>><br>\\n</$list>\"},\"Sn:SaidAThing\":{\"title\":\"Sn:SaidAThing\",\"created\":\"20240927114133966\",\"modified\":\"20240927115435253\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\parameters(interlocutor, speaker)\\n\\n<<speaker>> says to <<interlocutor>>:\\n\\n<blockquote>\\n  <$slot $name=\\\"quote\\\" />\\n</blockquote>\\n\\n\"},\"Sn:SaveOptionalParametersSolution\":{\"title\":\"Sn:SaveOptionalParametersSolution\",\"created\":\"20240901145209499\",\"modified\":\"20240901145846008\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\function .rest-names() [<params-var>jsonindexes[]]\\n\\\\function .rest-values() [.rest-names[]] :map[<params-var>jsonget<currentTiddler>]\\n\\n\\\\widget $link()\\n  <$parameters\\n    to=\\\"\\\"\\n    tooltip=\\\"\\\"\\n    $params=\\\"params-var\\\"\\n  >\\n    <$let newtooltip={{{ [<tooltip>!is[blank]] ~[<to>get[description]] }}}>\\n      <$genesis\\n        $type=\\\"$link\\\"\\n        $remappable=\\\"no\\\"\\n        $names=\\\"[.rest-names[]] =tooltip\\\"\\n        $values=\\\"[.rest-values[]] =[<newtooltip>]\\\"\\n      >\\n        <$slot $name=\\\"ts-raw\\\"/>\\n      </$genesis>\\n    </$let>\\n  </$parameters>\\n\\\\end\\n\\n[[Links]] and <$link to=Tags tooltip=\\\"I love tags!\\\">Tags</$link> combine to organize [[Tiddlers]] within a wiki.\\n\\nHere's an example of a link using a parameter we didn't touch, `class`, which gets saved correctly:\\n\\n<$link to=\\\"Fields\\\" class=\\\"tc-tiddlylink-external\\\">I'm posing as external</$link>\"},\"Sn:SayAThing\":{\"title\":\"Sn:SayAThing\",\"created\":\"20240927114307999\",\"modified\":\"20240927115528433\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$transclude\\n  $tiddler=\\\"Sn:SaidAThing\\\"\\n  interlocutor=\\\"Alice\\\" \\n  speaker=\\\"Bob\\\"\\n>\\n  <$fill $name=\\\"quote\\\">\\n    Charlie told me, “[[There's a horse in aisle five|https://what-if.xkcd.com/34/]].”\\n  </$fill>\\n</$transclude>\"},\"Sn:SelectExample\":{\"title\":\"Sn:SelectExample\",\"created\":\"20210206212257711\",\"modified\":\"20210817225115804\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"What do you want to look at?\\n\\n<$select tiddler=\\\"$:/temp/SelectExample\\\" default=\\\"\\\">\\n  <option value=\\\"\\\">(choose an option)</option>\\n  <option value=\\\"Exercise\\\">Exercises</option>\\n  <option value=\\\"Section\\\">Sections</option>\\n  <option value=\\\"Takeaway\\\">Takeaways</option>\\n</$select>\\n\\n<<list-links \\\"[all[tiddlers+shadows]tag{$:/temp/SelectExample}first[5]]\\\">>\"},\"Sn:SetDisclaimer\":{\"title\":\"Sn:SetDisclaimer\",\"created\":\"20210116203350735\",\"modified\":\"20240616141318901\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$set\\n  name=\\\"disclaimer\\\"\\n  value=\\\"(This paragraph does not represent the formal opinion of my company.)\\\"\\n>\\n  …insert the text of your tiddler here\\n</$set>\\n\"},\"Sn:SetVsLet\":{\"title\":\"Sn:SetVsLet\",\"created\":\"20210206210503975\",\"modified\":\"20220103165651799\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$set name=\\\"var1\\\" value=\\\"one\\\">\\n<$set name=\\\"var2\\\" value=\\\"two\\\">\\n  <<var1>> <<var2>>\\n</$set>\\n</$set>\\n\\n<$let var1=\\\"one\\\" var2=\\\"two\\\">\\n  <<var1>> <<var2>>\\n</$let>\"},\"Sn:SetYourName\":{\"title\":\"Sn:SetYourName\",\"created\":\"20210123194135490\",\"modified\":\"20210123194041349\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Your name: <$edit-text tiddler=\\\"$:/temp/ExampleNameField\\\" tag=\\\"input\\\" default=\\\"\\\" />\\n\\n<$set name=\\\"username\\\" filter=\\\"[[$:/temp/ExampleNameField]get[text]]\\\" value={{$:/temp/ExampleNameField}} emptyValue=\\\"Nobody\\\">\\n  Hi <<username>>!\\n</$set>\"},\"Sn:SimpleProcedureCallWidget\":{\"title\":\"Sn:SimpleProcedureCallWidget\",\"created\":\"20210116205906718\",\"modified\":\"20240929014129823\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure wikipediaLink(articleName, linkText)\\n  <a href=`https://en.wikipedia.org/wiki/$(articleName)$`>\\n  <<linkText>></a>\\n\\\\end\\n\\n<$transclude $variable=\\\"wikipediaLink\\\" linkText=\\\"Wikipedia on Aardvarks\\\" articleName=Aardvark />\"},\"Sn:SingleLineProcedure\":{\"title\":\"Sn:SingleLineProcedure\",\"created\":\"20210116205742608\",\"modified\":\"20240929014135147\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure disclaimer() (This paragraph does not represent the formal opinion of my company.)\\n\\n<<disclaimer>>\"},\"Sn:StringConcatenationWithFilters\":{\"title\":\"Sn:StringConcatenationWithFilters\",\"created\":\"20210818122739980\",\"modified\":\"20210818123224153\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$set name=\\\"person\\\" value=\\\"Soren Bjornstad\\\">\\n<$set name=\\\"role\\\" value=\\\"author of Grok TiddlyWiki\\\">\\n\\n<$text text={{{ [<role>addsuffix[, ]addsuffix<person>addsuffix[.]addprefix[This example is approved by the ]] }}}/>\\n\\n</$set>\\n</$set>\"},\"Sn:TestVar12\":{\"title\":\"Sn:TestVar12\",\"created\":\"20210101165835117\",\"modified\":\"20240923223200566\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$let testVar1=\\\"XYZ\\\">\\n<$let testVar2=\\\"<<testVar1>>\\\">\\n  <<testVar2>>\\n</$let>\\n</$let>\"},\"Sn:TestVar122\":{\"title\":\"Sn:TestVar122\",\"created\":\"20210101165917055\",\"modified\":\"20240923223451243\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$let testVar1=\\\"XYZ\\\">\\n<$let testVar2=\\\"<<testVar1>>\\\">\\n  <$text text=<<testVar2>>/>\\n</$let>\\n</$let>\"},\"Sn:TextBeforeProcedure\":{\"title\":\"Sn:TextBeforeProcedure\",\"created\":\"20210116203958811\",\"modified\":\"20240929014330349\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Text before a procedure\\n\\n\\\\procedure wikipediaLink(articleName)\\n  <a href=`https://en.wikipedia.org/wiki/$(articleName)$`>\\n    Wikipedia: <<articleName>></a>\\n\\\\end\"},\"Sn:TicketLinkProcedure\":{\"title\":\"Sn:TicketLinkProcedure\",\"created\":\"20210116210221048\",\"modified\":\"20240929014349222\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure ticketLink(ticketId)\\n<a href=`https://tix.example.com/ticket/$(ticketId)$`>Ticket <<ticketId>></a>\\n\\\\end\\n\\n<<ticketLink 245188>>\"},\"Sn:TiddlerWidget\":{\"title\":\"Sn:TiddlerWidget\",\"created\":\"20210206211117892\",\"modified\":\"20210206211016565\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$set name=\\\"currentTiddler\\\" value=\\\"New Current Tiddler\\\">\\n  <<currentTiddler>>\\n</$set>\\n\\n<$tiddler tiddler=\\\"New Current Tiddler\\\">\\n  <<currentTiddler>>\\n</$tiddler>\"},\"Sn:TranscludeFallback\":{\"title\":\"Sn:TranscludeFallback\",\"created\":\"20210123194558334\",\"modified\":\"20240926220606514\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$transclude $field=\\\"nonexistentfield\\\">\\n  The nonexistent field does not exist.\\n</$transclude>\"},\"Sn:TranscludedProcedureCallWidget\":{\"title\":\"Sn:TranscludedProcedureCallWidget\",\"created\":\"20210116210007489\",\"modified\":\"20240929014142165\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure wikipediaLink(articleName, linkText:\\\"Wikipedia Link\\\")\\n  <a href=`https://en.wikipedia.org/wiki/$(articleName)$`>\\n  <<linkText>></a>\\n\\\\end\\n\\n<$let linktext=\\\"An animal\\\">\\n\\n* <$transclude $variable=\\\"wikipediaLink\\\" linkText=<<linktext>> articleName=\\\"Aardvark\\\" />\\n* <$transclude $variable=\\\"wikipediaLink\\\" linkText=<<linktext>> articleName=\\\"Bee\\\" />\\n* <$transclude $variable=\\\"wikipediaLink\\\" linkText=<<linktext>> articleName=\\\"Cow\\\" />\\n\\n</$let>\"},\"Sn:TripleDoublesProcedure\":{\"title\":\"Sn:TripleDoublesProcedure\",\"created\":\"20210116204445198\",\"modified\":\"20240929014146884\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure wikipediaLink(articleName, linkText)\\n  <a href=`https://en.wikipedia.org/wiki/$(articleName)$`>\\n  <<linkText>></a>\\n\\\\end\\n\\n<<wikipediaLink Aardvark \\\"\\\"\\\"What is an \\\"aardvark\\\"?\\\"\\\"\\\">>\"},\"Sn:TweakingYourSettings\":{\"title\":\"Sn:TweakingYourSettings\",\"created\":\"20210116004917205\",\"modified\":\"20210116005922831\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"You can click each of these links to see that they go to the same place:\\n\\n* [[Tweaking Your Settings]]\\n* A page on [[tweaking settings|Tweaking Your Settings]]\"},\"Sn:UnclosedItalics\":{\"title\":\"Sn:UnclosedItalics\",\"created\":\"20210116173835903\",\"modified\":\"20210116173746153\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Here is my //first paragraph.\\n\\nHere is my second paragraph.\"},\"Sn:UsHolidaysTransclusion\":{\"title\":\"Sn:UsHolidaysTransclusion\",\"created\":\"20240924001658237\",\"modified\":\"20240924001844292\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"{{UsHolidays##07/04}}\\n\\n<$text text={{{ [[UsHolidays]getindex[07/04]] }}}/>\"},\"Sn:UserWhoClicked\":{\"title\":\"Sn:UserWhoClicked\",\"created\":\"20210116212538921\",\"modified\":\"20210117010338851\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$button set=\\\"!!userwhoclicked\\\" setTo=\\\"Soren\\\">\\n  Big Red Button\\n</$button>\\n\\nUser who clicked: \\\"{{!!userwhoclicked}}\\\"\"},\"Sn:ViewFallback\":{\"title\":\"Sn:ViewFallback\",\"adate\":\"\",\"created\":\"20210123195102822\",\"modified\":\"20210123200150412\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$button set=\\\"!!adate\\\" setTo={{!!created}}>Show Created Date</$button>\\n<$button set=\\\"!!adate\\\" setTo=\\\"\\\">Hide Created Date</$button>\\n\\n<$view field=\\\"adate\\\" format=\\\"date\\\" template=\\\"This tiddler was created on MMM DD, YYYY.\\\">\\n  The date is not currently set.\\n</$view>\"},\"Sn:WhenPigsFlyQuotation\":{\"title\":\"Sn:WhenPigsFlyQuotation\",\"created\":\"20240829230053105\",\"modified\":\"20241016122822459\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<% if \\\"[<storyTiddler>match[When Pigs Fly]]\\\" %>\\n  Pigs are flying – perhaps you made a syntax error?\\n<% endif %>\"},\"Sn:WidgetLink\":{\"title\":\"Sn:WidgetLink\",\"created\":\"20210116201351228\",\"modified\":\"20210116201329418\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$link to=\\\"Filters\\\">a link to the Filters section</$link>\"},\"Sn:WikifyConcatenation\":{\"title\":\"Sn:WikifyConcatenation\",\"created\":\"20210818124739448\",\"modified\":\"20210818124809470\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$tiddler tiddler=\\\"Constant strings cannot be combined with transclusions\\\">\\n  <$wikify name=\\\"myImageName\\\" text=\\\"{{!!title}}.png\\\">\\n    <$image source=<<myImageName>>/>\\n  </$wikify>\\n</$tiddler>\"},\"Sn:WikipediaAElement\":{\"title\":\"Sn:WikipediaAElement\",\"created\":\"20240616154018879\",\"modified\":\"20241007124457993\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$let wp=\\\"https://en.wikipedia.org\\\">\\n\\n  <a href=<<wp>> >Wikipedia</a>\\n\\n  <a href=<<wp>> >The free encyclopedia</a>\\n\\n</$let>\"},\"Sn:WikipediaBadWikitext\":{\"title\":\"Sn:WikipediaBadWikitext\",\"created\":\"20240616153356073\",\"modified\":\"20240616153356073\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$let wp=\\\"https://en.wikipedia.org\\\">\\n\\n  [[Wikipedia|<<wp>>]]\\n\\n  [[The free encyclopedia|<<wp>>]]\\n\\n</$let>\"},\"Sn:WikipediaCombinedVarSubst\":{\"title\":\"Sn:WikipediaCombinedVarSubst\",\"created\":\"20240616155405925\",\"modified\":\"20240616155405925\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$let wpBase=\\\"https://en.wikipedia.org/wiki\\\">\\n  <a href=\\\"<<wpBase>>/Aardvark\\\">Aardvarks</a>\\n</$let>\"},\"Sn:WikipediaCombinedVarSubst2\":{\"title\":\"Sn:WikipediaCombinedVarSubst2\",\"created\":\"20240616155419754\",\"modified\":\"20240616155419754\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$let wpBase=\\\"https://en.wikipedia.org/wiki\\\">\\n  <a href=<<wpBase>>\\\"/Aardvark\\\">Aardvarks</a>\\n</$let>\"},\"Sn:WikipediaLinkProcVsMacro\":{\"title\":\"Sn:WikipediaLinkProcVsMacro\",\"created\":\"20240913123414077\",\"modified\":\"20240913123546662\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure wikipediaLinkProcedure(articleName)\\n[[<<articleName>>|https://en.wikipedia.org/wiki/<<articleName>>]]\\n\\\\end\\n\\n\\\\define wikipediaLinkMacro(articleName)\\n[[$articleName$|https://en.wikipedia.org/wiki/$articleName$]]\\n\\\\end\\n\\n<<wikipediaLinkProcedure Bear>>\\n<<wikipediaLinkMacro Bear>>\"},\"Sn:WikipediaSubAttrValue\":{\"title\":\"Sn:WikipediaSubAttrValue\",\"created\":\"20240616155014971\",\"modified\":\"20240616155014971\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$let wpBase=\\\"https://en.wikipedia.org/wiki\\\">\\n  <a href=`$(wpBase)$/Aardvark`>Aardvarks</a>\\n</$let>\"},\"Sn:WikipediaWikitext\":{\"title\":\"Sn:WikipediaWikitext\",\"created\":\"20240616152630822\",\"modified\":\"20240616153017137\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$let wp=\\\"[[link|https://en.wikipedia.org]]\\\">\\n\\n  Wikipedia: <<wp>>\\n\\n  The free encyclopedia: <<wp>>\\n\\n</$let>\"},\"Sn:WikitextBoldItalicBad\":{\"title\":\"Sn:WikitextBoldItalicBad\",\"created\":\"20210131045640394\",\"modified\":\"20210131045709108\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Here's how to do //''bold italics''// correctly.\\n\\nHere's the wrong way: //''bold italic//''.\\n\\nOops, now the rest of the tiddler is messed up!\"},\"Sn:WikitextBulletedList\":{\"title\":\"Sn:WikitextBulletedList\",\"created\":\"20210131050047576\",\"modified\":\"20210131045949776\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"* first item\\n* second item\\n** subitems use\\n** a second star\\n*** you\\n**** can\\n***** go\\n****** as deep as you like\\n* third item\"},\"Sn:WikitextCodeBlock\":{\"title\":\"Sn:WikitextCodeBlock\",\"created\":\"20210131143343463\",\"modified\":\"20210214171831138\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Let's say hello to the world in Python, without syntax highlighting:\\n\\n```\\nprint(\\\"Hello world!\\\")\\n```\\n\\nLet's add syntax highlighting by specifying a language (Highlight plugin must be installed):\\n\\n```python\\nprint(\\\"Hello world!\\\")\\n```\\n\\nHow about in JavaScript?\\n\\n```javascript\\nconsole.log(\\\"Hello world!\\\")\\n```\"},\"Sn:WikitextCombinedList\":{\"title\":\"Sn:WikitextCombinedList\",\"created\":\"20210131050132703\",\"modified\":\"20210207184510698\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"# Collect the following items:\\n#* cell phone\\n#* wallet\\n#* keys\\n#* notebook and pen\\n# Leave your house, locking the door behind you.\"},\"Sn:WikitextCurrentTransclusionTemplate\":{\"title\":\"Sn:WikitextCurrentTransclusionTemplate\",\"caption\":\"Transclude the [[current tiddler|Templates and the Current Tiddler]] through a template\",\"created\":\"20210314125101154\",\"modified\":\"20210314125222415\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"{{||Sn:CaptionFieldTemplate}}\"},\"Sn:WikitextDefinitionList\":{\"title\":\"Sn:WikitextDefinitionList\",\"created\":\"20210131152735293\",\"modified\":\"20210131152650260\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"; First term\\n: Here we would define the first term. The definition might be quite long, like this one, which we are making much longer than necessary to demonstrate a point, and if it is it will wrap onto the next line, maintaining its indentation.\\n\\n; Second term\\n: Second definition.\"},\"Sn:WikitextExtForce\":{\"title\":\"Sn:WikitextExtForce\",\"created\":\"20210131141859994\",\"modified\":\"20240928185237841\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"attachments/my_image.png\\n\\nThat didn't work. How about [[attachments/my_image.png]]?\\n\\nNope! Here's the right way: [ext[attachments/my_image.png]]\\n\\n(Note: this last link returns a 404 error, but it's the right syntax and would work if we had actually attached an image called `my_image.png` to this wiki.)\"},\"Sn:WikitextHeadings\":{\"title\":\"Sn:WikitextHeadings\",\"created\":\"20210131045414136\",\"modified\":\"20210131045316298\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"! Heading 1\\n!! Heading 2\\n!!! Heading 3\\n!!!! Heading 4\\n!!!!! Heading 5\\n!!!!!! Heading 6\"},\"Sn:WikitextHeadingsRolledIn\":{\"title\":\"Sn:WikitextHeadingsRolledIn\",\"created\":\"20210131045435619\",\"modified\":\"20210131045337785\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Here's an example of what not to do:\\n!! Heading 2\"},\"Sn:WikitextHorizontalRule\":{\"title\":\"Sn:WikitextHorizontalRule\",\"created\":\"20210131151946604\",\"modified\":\"20210131151848284\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Text before the line\\n\\n----------\\n\\nText after the line\"},\"Sn:WikitextHtmlInList\":{\"title\":\"Sn:WikitextHtmlInList\",\"created\":\"20210131050147881\",\"modified\":\"20210131050050051\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"* First item\\n* Second item <div>\\n\\n  <p>Here's a second paragraph.</p>\\n  <p>Here's a third paragraph.</p>\\n\\n</div>\\n* Third item\"},\"Sn:WikitextImageImgify\":{\"title\":\"Sn:WikitextImageImgify\",\"created\":\"20210131153332007\",\"modified\":\"20210131153447948\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"[img height=50 [anki-config-screenshot.png]]\"},\"Sn:WikitextImageTransclusion\":{\"title\":\"Sn:WikitextImageTransclusion\",\"created\":\"20210131153251089\",\"modified\":\"20210131153152744\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"{{anki-config-screenshot.png}}\"},\"Sn:WikitextInlineTextFormatting\":{\"title\":\"Sn:WikitextInlineTextFormatting\",\"created\":\"20210131045751508\",\"modified\":\"20210131140928496\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Here is some //italic text//.\\n\\nHere is some ''bold text''.\\n\\nHere is some `monospaced text`. `In here, further //TiddlyWiki markup// is ''ignored''.`\\n\\nHere is a ^^superscript^^ section.\\n\\nHere is a ,,subscript,, section.\\n\\nHere is a ~~struck-through~~ section.\\n\\nHere is an __underlined__ section.\\n\\nHere is some //''bold italic text''//.\\n\\nHere is some ''//__~~^^bold italic underlined superscripted struck-through^^~~__//'' text.\"},\"Sn:WikitextLink\":{\"title\":\"Sn:WikitextLink\",\"created\":\"20210116201345211\",\"modified\":\"20210116201339582\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"[[a link to the Filters section|Filters]]\"},\"Sn:WikitextLinksExample\":{\"title\":\"Sn:WikitextLinksExample\",\"created\":\"20210131141526918\",\"modified\":\"20210131150316213\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"You can read about links in the [[Links]] section.\\n\\nYou can [[read about links|Links]] if you want to learn more about them.\\n\\nIf you have questions that are not related to TiddlyWiki, let me point you to [[Google|https://google.com]], [[DuckDuckGo|https://duckduckgo.com]], or [[Wikipedia|https://en.wikipedia.org]]. (Or, if you prefer a language other than English, try visiting https://wikipedia.org and selecting a language.)\"},\"Sn:WikitextNumberedList\":{\"title\":\"Sn:WikitextNumberedList\",\"created\":\"20210131050100657\",\"modified\":\"20210207184440145\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"# one\\n# two\\n# three\\n## three and a half\\n## three and three-quarters\"},\"Sn:WikitextParameterTransclusion\":{\"title\":\"Sn:WikitextParameterTransclusion\",\"created\":\"20240928185732900\",\"modified\":\"20240928185749102\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\parameters(param1, param2)\\n\\nI have been passed parameters <<param1>> and <<param2>>.\"},\"Sn:WikitextPoetryMarkup\":{\"title\":\"Sn:WikitextPoetryMarkup\",\"created\":\"20210131152021052\",\"modified\":\"20210131155728546\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<<<\\n\\\"\\\"\\\"\\nTo keep your text in perfect lines,\\n&emsp; Just turn to triple quotes.\\nFor this fine feature, all great minds\\n&emsp; Give TiddlyWiki votes.\\n\\\"\\\"\\\"\\n<<< ---Soren (not that I'm proud of this stanza)\"},\"Sn:WikitextQuotes\":{\"title\":\"Sn:WikitextQuotes\",\"created\":\"20210131142943468\",\"modified\":\"20210131143308457\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"> This is a quote.\\n>> This is a quote within the quote.\\n> But I don't like what was said in the quote within the quote…\\n\\nThe quote ends when we start a new line that doesn't begin with `>`.\\n\\n<<<\\nThis is a quote. The quote\\n\\nwill continue until we close it.\\n\\n> It's also possible to nest quotes by using the line form within the block form.\\n\\n<<< ---You can put a citation here if you like.\\n\\nThe quote ends after the closing `<<<`.\\n\"},\"Sn:WikitextStyles\":{\"title\":\"Sn:WikitextStyles\",\"created\":\"20210131154145461\",\"modified\":\"20210202190728899\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"@@color:red;\\nHere is some red text.\\n@@\\n\\n<style>\\n.my-blue-bold-class {\\n  font-weight: bold;\\n  color: blue;\\n}\\n</style>\\n\\n@@.my-blue-bold-class\\nHere is some blue, bold text.\\n@@\"},\"Sn:WikitextTable\":{\"title\":\"Sn:WikitextTable\",\"created\":\"20210117010727707\",\"modified\":\"20210117010637701\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"|!Header 1|!Header 2|\\n|Cell 1|Cell 2|\"},\"Sn:WikitextTableAlignment\":{\"title\":\"Sn:WikitextTableAlignment\",\"created\":\"20210131144220852\",\"modified\":\"20210131144250305\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"|!Number| !A|!B|!C |\\n| 1|A1|B1|C1|\\n| 2 |A2|B2|C2|\\n|3 |A3|B3|C3|\"},\"Sn:WikitextTableReference\":{\"title\":\"Sn:WikitextTableReference\",\"created\":\"20210131144255671\",\"modified\":\"20210131144206831\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"|!Number|!A|!B|!C|\\n|1|A1|B1|C1|\\n|2|A2|B2|C2|\\n|3|A3|B3|C3|\"},\"Sn:WikitextTransclusionBasic\":{\"title\":\"Sn:WikitextTransclusionBasic\",\"created\":\"20210131145534681\",\"modified\":\"20210131150117161\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"{{Sn:IncludeMe}}\\n{{Sn:IncludeMe!!text}}\"},\"Sn:WikitextTransclusionData\":{\"title\":\"Sn:WikitextTransclusionData\",\"created\":\"20210131145622967\",\"modified\":\"20210131150218103\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"//Grok TiddlyWiki// version {{Metadata##version}}\"},\"Sn:WikitextTransclusionField\":{\"title\":\"Sn:WikitextTransclusionField\",\"created\":\"20210131145607043\",\"modified\":\"20210131145508786\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"{{Sn:IncludeMe!!caption}}\"},\"Sn:WikitextTransclusionFilter\":{\"title\":\"Sn:WikitextTransclusionFilter\",\"created\":\"20210131145649553\",\"modified\":\"20210521201836224\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"{{{ [all[tiddlers+shadows]!is[system]tag[Template]] }}}\"},\"Sn:WikitextTransclusionFilterTemplate\":{\"title\":\"Sn:WikitextTransclusionFilterTemplate\",\"created\":\"20210131145658933\",\"modified\":\"20210521201912850\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"{{{ [all[tiddlers+shadows]tag[Exercise]first[]] || Sn:BoldfaceTemplate }}}\"},\"Sn:WikitextTransclusionFunctionAngles\":{\"title\":\"Sn:WikitextTransclusionFunctionAngles\",\"created\":\"20240928194544290\",\"modified\":\"20240928194959337\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\function add.numLetters(myName) [<myName>split[]count[]addsuffix[ letters)]addprefix[ (]addprefix<myName>]\\n\\n<<add.numLetters \\\"Alice\\\">>\"},\"Sn:WikitextTransclusionFunctionDotOperator\":{\"title\":\"Sn:WikitextTransclusionFunctionDotOperator\",\"created\":\"20240928194937803\",\"modified\":\"20240928194945313\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\function add.numLetters(myName) [<myName>split[]count[]addsuffix[ letters)]addprefix[ (]addprefix<myName>]\\n\\n{{{ [add.numLetters[Charlie]] }}}\"},\"Sn:WikitextTransclusionFunctionFunction\":{\"title\":\"Sn:WikitextTransclusionFunctionFunction\",\"created\":\"20240928194931255\",\"modified\":\"20240928195004833\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\function add.numLetters(myName) [<myName>split[]count[]addsuffix[ letters)]addprefix[ (]addprefix<myName>]\\n\\n{{{ [function[add.numLetters],[Bob]] }}}\"},\"Sn:WikitextTransclusionMacro\":{\"title\":\"Sn:WikitextTransclusionMacro\",\"created\":\"20210131145717485\",\"modified\":\"20210314125402817\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\define mymacro(myName) Hi <<__myName__>>!\\n\\n<<mymacro Soren>>\"},\"Sn:WikitextTransclusionMacroSubst\":{\"title\":\"Sn:WikitextTransclusionMacroSubst\",\"created\":\"20210314125642771\",\"modified\":\"20210314125531595\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\define mymacro(myName) Hi $myName$!\\n\\n<<mymacro Soren>>\"},\"Sn:WikitextTransclusionProcedure\":{\"title\":\"Sn:WikitextTransclusionProcedure\",\"created\":\"20240928194521137\",\"modified\":\"20240928194536861\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\procedure myproc(myName) Hi <<myName>>!\\n\\n<<myproc Soren>>\"},\"Sn:WikitextTransclusionTemplate\":{\"title\":\"Sn:WikitextTransclusionTemplate\",\"created\":\"20210131145638915\",\"modified\":\"20240928185752034\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"{{Sn:IncludeMe||Sn:BoldfaceTemplate}}\"},\"Sn:WikitextTransclusionVariable\":{\"title\":\"Sn:WikitextTransclusionVariable\",\"created\":\"20210131145709035\",\"modified\":\"20240928194303789\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<$let myvariable=\\\"Hello!\\\">\\n  <<myvariable>>\\n</$let>\"},\"Sn:WikitextTripleQuotes\":{\"title\":\"Sn:WikitextTripleQuotes\",\"created\":\"20210131152001903\",\"modified\":\"20210202190814050\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"To keep your text in perfect lines,\\nJust turn to triple quotes.\\nFor this fine feature, all great minds\\nGive TiddlyWiki votes.\\n\\n\\\"\\\"\\\"\\nTo keep your text in perfect lines,\\nJust turn to triple quotes.\\nFor this fine feature, all great minds\\nGive TiddlyWiki votes.\\n\\\"\\\"\\\"\"},\"Sn:WikitextWebImage\":{\"title\":\"Sn:WikitextWebImage\",\"created\":\"20210131153434996\",\"modified\":\"20210131153336667\",\"tags\":\"\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"[img width=200 [https://upload.wikimedia.org/wikipedia/commons/b/bb/Kittyply_edit1.jpg?download]]\"},\"Stamps\":{\"title\":\"Stamps\",\"created\":\"20200718203354489\",\"description\":\"Stamps allow quick insertion of commonly-used snippets of text into tiddlers while editing.\",\"modified\":\"20241017003823148\",\"parent\":\"Looking Under the Hood\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"''Stamps'' are snippets of wikitext that can be inserted into a tiddler at the click of a button, for use when transcluding some procedure or tiddler doesn't do the entire job. For instance, perhaps what you need to insert repeatedly actually //is// a procedure call, but it has a bunch of parameters which you can't remember well and you'd like to be able to insert a version with useful placeholder text.\\n\\nStamps are tiddlers (what else?) tagged `$:/tags/TextEditor/Snippet`. Such tiddlers appear on the <<textual-button \\\"stamp\\\">> stamp button on the edit toolbar under the name in their `caption` field, and clicking them inserts the text of the relevant snippet into the editor.\\n\\nIt's also possible to make a stamp take some selected text and add a prefix or suffix to it, rather than just inserting a chunk of new text. For this and more, see the [[documentation on stamps|https://tiddlywiki.com/#Using%20Stamp]].\\n\\n!! Exercises\\n\\n{{Ex:WikipediaLinkSnippet||ExerciseTemplate}}\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Structuring Our Wiki\":{\"title\":\"Structuring Our Wiki\",\"created\":\"20200530175016785\",\"description\":\"How to translate what we want the wiki to do into TiddlyWiki concepts.\",\"modified\":\"20210504015735447\",\"parent\":\"The Shape of TiddlyWiki\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Now that we've [[identified the requirements|Requirements for the Sample Wiki]] for our sample wiki, and we understand the basic data model of TiddlyWiki, with [[tiddlers|Tiddlers]], [[fields|Fields]], [[wikitext|Wikitext]], [[links|Links]], and [[tags|Tags]], let's develop a broad outline of how we'll implement the requirements in TiddlyWiki. While it's easy enough to restructure a wiki if we need to, it still makes sense to get a clear idea of what we're trying to accomplish before we start, or we'll spend all our time restructuring instead of adding useful content.\\n\\nIt's helpful to be ''consistent'' when structuring a TiddlyWiki: if we want to be able to find all our meetings, for instance, it's probably a good idea to mark all of them as meetings in a consistent way (whether by linking to them from a central list of meetings, tagging them all with the same tag, putting `Meeting` in a `tiddler-type` field on all of them, or whatever). Prebuilt software for handling work notes would likely provide some built-in way to identify something as a meeting -- perhaps a “New Meeting” button that created a different type of note -- but in TiddlyWiki we have to make those decisions ourselves. (The upside, of course, is that we //get// to make these decisions based on what makes the most sense for us.)\\n\\nSo let's take another look at our requirements and figure out how, broadly, we want to structure the notes in our wiki. Specifically, let's identify some types of tiddlers. This is not a technical distinction that TiddlyWiki makes -- a tiddler is a tiddler is a tiddler -- but it's useful for a broad range of wiki use cases to classify tiddlers in some way based on what kind of content we store in them and how we use them.\\n\\n; Daily journal tiddlers\\n: Every day we'll create a new tiddler that summarizes what we did each day.\\n\\n; Contact tiddlers\\n: One for each person we meet and want to keep track of.\\n\\n; Meeting tiddlers\\n: These will be the central location that we work in during a meeting. If there's any information that needs to go into our permanent knowledge banks, though, we'll move that out into project or knowledge tiddlers (discussed momentarily) after the meeting, as it's usually tough to remember which meeting something was part of when you need to find it later.\\n\\n; Project tiddlers\\n: While we certainly won't have only //one// tiddler per project (tiddlers are supposed to be small, after all), these will serve as the central gathering point for all the information about a project.\\n\\n; Knowledge tiddlers\\n: Any information not described above that needs a home in the wiki will be a knowledge tiddler. Because almost anything can be a knowledge tiddler, knowledge tiddlers will likely be the hardest to keep organized. That said, because they are so unstructured, it will be easy to move the information they contain between tiddlers and split and join tiddlers as our understanding of the information and the structure we want to use evolves.\\n\\nNow we have to decide how to implement these classifications within TiddlyWiki. Tags are an easy and popular method, so let's use them here. We'll tag journal tiddlers `Journal`, contact tiddlers `Contact`, project tiddlers `Project`, and meeting tiddlers `Meeting`. We won't bother giving knowledge tiddlers a classification tag, since there are usually few situations in which we want to treat only those tiddlers separately, but you could create a `Knowledge` tag too if you preferred.\\n\\nWe'll also have to decide how to associate the different types of tiddlers with each other. Since tiddlers are small and focus on only one idea, it's critical to associate them with each other in a coherent and understandable way, or they'll get lost. We'll discuss how this will work for each type of tiddler as we get to it.\\n\\nIf you're not sure how I came up with these divisions or why I made them, that's OK -- you can just play along for now. Once you have a bit more experience with TiddlyWiki, we'll be returning to the reasons for and methods of dividing content into different tiddlers and different types of tiddlers, in [[Slicing Up Content]].\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Stylesheets\":{\"title\":\"Stylesheets\",\"created\":\"20200822195432205\",\"description\":\"Every little bit of page formatting can be customized by adding CSS to your wiki.\",\"modified\":\"20241017011005537\",\"parent\":\"Getting Technical\",\"prerequisite\":\"Basic knowledge of CSS\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"TiddlyWiki has full support for ''CSS stylesheets'', both inline and as tiddlers. We saw this briefly in [[Creating a List of Links and Backlinks]]. Here are a few more details.\\n\\nThis section assumes you have basic knowledge of CSS. If you don't, and you would like to learn more about how to style your TiddlyWiki, a variety of good tutorials are available on the web.\\n\\n!! Inline stylesheets\\n\\nYou can use a `<style>` element to embed rules within the text of a tiddler. The style section can appear anywhere in the tiddler, but it's common practice to put it at the bottom.\\n\\nBe careful, however -- inline stylesheets are not restricted to that tiddler! If you place a broad rule such as `p { color: purple; }` in a tiddler, all paragraph text ''anywhere in the wiki'' will become purple whenever that tiddler is being transcluded in some visible part of the interface, including in other tiddlers and in the sidebar. For this reason, you should normally use a class name on all rules that you define this way, and [[make sure your class name has a unique prefix|Much More Than You Wanted to Know About Scopes]] so it doesn't accidentally conflict with something used elsewhere in the wiki.\\n\\nBecause of the lack of scoping, the rules in a given tiddler are guaranteed to apply to any tiddlers that transclude it (since transcluding the tiddler causes the stylesheet in it to be read and applied to the whole page); we took advantage of this in [[Creating a List of Links and Backlinks]].\\n\\n!! Styling and classes in wikitext\\n\\nYou can apply arbitrary styles or classes to regions of wikitext using the `@@` syntax, like this:\\n\\n{{Sn:AtAtStyle||MagicSnippet}}\\n\\n{{Sn:AtAtClass||MagicSnippet}}\\n\\nSee the [[documentation|https://tiddlywiki.com/#Styles%20and%20Classes%20in%20WikiText]] for more on this feature.\\n\\n\\n!! Stylesheets in tiddlers\\n\\nFor styles and stylesheets you want to use in more than a single template or tiddler, a more robust approach is to place them in ''tiddlers of their own''.\\n\\nTiddlers tagged `$:/tags/Stylesheet` will be incorporated in the global stylesheet and apply to all tiddlers in the wiki at all times. Any changes to such tiddlers take effect as soon as you save the tiddler.\\n\\nThere is a content type called `text/css`. This is natural for stylesheets, and if you have the [[syntax highlighting plugin|Useful Plugins]] installed, you get nice syntax highlighting when you view the tiddler, but be aware that choosing this content type takes away the ability you would otherwise have to use transclusions in your stylesheet. For instance, this is valid if and only if you have the content type of the tiddler set to wikitext:\\n\\n```css\\n.my-alert-class {\\n  background-color: <<colour alert-background>>;\\n}\\n```\\n\\n\\n!! The `data-tiddler-title` and `data-tags` attributes\\n\\nYou can apply rules to only specific tiddlers using the `data-tiddler-title` and `data-tags` data attributes, which TiddlyWiki automatically attaches to the containers each tiddler is rendered within in the story river. Note that this happens specifically when rendering a tiddler directly within the story river – if you transclude a tiddler which has a particular title and tags into another tiddler, no container with this attribute will be created.\\n\\nYou can access these attributes using the [[CSS attribute selector syntax|https://developer.mozilla.org/en-US/docs/Web/CSS/Attribute_selectors]]. You could use this, for instance, to give certain tiddlers a different font:\\n\\n```css\\n[data-tags*=BadFont] {\\n  font-family: \\\"Comic Sans MS\\\", serif;\\n}\\n```\\n\\nHere it is live in my public wiki:\\n\\n[img[comic-sans.png]]\\n\\n\\n!! Exercises\\n\\n{{Ex:FunnyClass||ExerciseTemplate}}\\n{{Ex:ConditionalStyle||ExerciseTemplate}}\\n{{Ex:FunnyTextCheckbox||ExerciseTemplate}}\\n{{Ex:TagStyleRule||ExerciseTemplate}}\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Summary of Transclusion Syntax\":{\"title\":\"Summary of Transclusion Syntax\",\"created\":\"20210320182859703\",\"description\":\"Review all the syntax used for reusing and relating content in TiddlyWiki.\",\"modified\":\"20241016122927636\",\"parent\":\"Transclusion\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"We learned about a lot of different ways of reusing and relating content in TiddlyWiki in this chapter, and when you've just learned all of them, it's often difficult to keep them straight. Let's review all the options and the syntax for each.\\n\\nWe'll be adding a handful of new tools to our toolbox in chapters<<gtw.link-chapter-number \\\"More Organizational Tools\\\" \\\"\\\">> and<<gtw.link-chapter-number \\\"Macros, Wikification, and Widgets\\\" \\\"\\\">>, so we'll have an updated version, [[Updated Summary of Transclusion Syntax]], at the end of chapter 6. You can also find a condensed version in the [[Wikitext Reference]], which also has some live examples you can play with.\\t\\n\\n{{CommonTransclusionSyntax|first}}\"},\"Supplemental Exercises\":{\"title\":\"Supplemental Exercises\",\"created\":\"20201122225852336\",\"description\":\"In which are offered some optional challenges to improve your TiddlyWiki skills, should you choose to accept them.\",\"list\":\"\",\"modified\":\"20240907015032646\",\"parent\":\"Outline\",\"tags\":\"Chapter\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"If you're looking for a challenge or some extra practice after finishing most or all of the book, here are some larger exercises you can try.\\n\\n{{Ex:TagColorGrouping||ExerciseTemplate}}\\n{{Ex:HostingOptions||ExerciseTemplate}}\\n{{Ex:MoreSidebarTabs||ExerciseTemplate}}\\n{{Ex:StylesheetExperiments||ExerciseTemplate}}\\n{{Ex:MailMerge||ExerciseTemplate}}\\n{{Ex:StretchText||ExerciseTemplate}}\\n{{Ex:NewWiki||ExerciseTemplate}}\"},\"Support Us\":{\"title\":\"Support Us\",\"created\":\"20210818143231603\",\"description\":\"If you've made it this far, please consider chipping in some money or time to help the open-source projects you're using.\",\"modified\":\"20241017013451102\",\"parent\":\"Appendices\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"If you've made it this far in //Grok TiddlyWiki// and expect to continue using and enjoying TiddlyWiki, please consider contributing financially to or helping out with the GTW and/or TiddlyWiki projects. Such open-source projects thrive when a wide variety of people get involved. Here are some options.\\n\\nFor GTW:\\n\\n* ''<a href={{$:/sib/DonationLink}}>Donate to the Grok TiddlyWiki project</a>'' to support me in keeping this book up to date.\\n* ''Provide feedback on the book''. In addition to using the //send feedback// link at the bottom of any section to provide targeted feedback on that section, you can send general thoughts on how the book has worked for you to `contact@sorenbjornstad.com`.\\n\\nFor TiddlyWiki itself:\\n\\n* ''Become a contributor to the TiddlyWiki organization'' or fund an ongoing project [[on OpenCollective|https://opencollective.com/tiddlywikidotorg]]. Such contributions help keep the project running smoothly, and they also give you a small stake in the community (if you fund a feature, for instance, your take on that feature will be prioritized).\\n* ''Share your new expertise'' on the [[TiddlyWiki forums|https://groups.google.com/g/tiddlywiki]].\\n* ''Share TiddlyWiki tools you create as plugins'' (see [[Creating Plugins]]) or, if you know some JavaScript, [[help out with the core development of TiddlyWiki|https://github.com/Jermolene/TiddlyWiki5]].\\n* ''Share TiddlyWiki with your friends''. The more users we have, the stronger and healthier the community.\"},\"System Tiddlers\":{\"title\":\"System Tiddlers\",\"created\":\"20200717225935255\",\"description\":\"Almost everything in TiddlyWiki is controlled by tiddlers; system tiddlers are those hidden “meta-tiddlers” that control the wiki rather than containing your actual content.\",\"modified\":\"20240928201045523\",\"parent\":\"Looking Under the Hood\",\"tags\":\"Section Concept\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Back at the very beginning of the book, in [[Tiddlers]], we learned that everything is a tiddler. And in [[Field Transclusions]], we mentioned in passing that the entire interface of TiddlyWiki is created by transcluding special tiddlers.\\n\\nThis means that, essentially, we can change //anything// in TiddlyWiki just by modifying these tiddlers, using the same tools we already know. (Only a tiny piece of TiddlyWiki, called the //microkernel//, can't be directly modified from within the wiki. But the only function of the microkernel is to load the JavaScript code and wikitext that is stored in tiddlers, so it's hard to imagine having a reason to customize it.) Completely changing the look and feel of TiddlyWiki and implementing custom JavaScript code are beyond the scope of this book, but in this chapter we will look at changing the sidebar, adding custom interface elements, and some more fun and useful things that will help you make any wiki you create with TiddlyWiki exactly fit your needs. Along the way, you'll also learn how you can poke around and discover how these tiddlers work, so you can make your own changes that we haven't talked about.\\n\\nIf your entire wiki is made up of these special tiddlers, you may be wondering why you don't see all of them in the list of tiddlers when you click the ''All'' section of the ''More'' tab in the sidebar of a new TiddlyWiki. The answer is that they're ''system tiddlers''. A system tiddler is a tiddler whose title begins with `$:/`. System tiddlers are hidden in search results and most tabs of the sidebar.\\n\\nAside from their names and the fact that tiddlers with those names are hidden from most views, there is nothing special or different about system tiddlers as compared to “normal” tiddlers.\\n\\nSystem tiddlers are ''organized into a hierarchy'' by giving them names with slashes separating each folder, much like a computer's file system.  For instance, the default height of the text box presented when you edit a tiddler is stored in a tiddler called [[$:/config/TextEditor/EditorHeight/Height]]. (It's worth noting that no actual object representing these “folders” is created within your wiki; your wiki is just one big pile of tiddlers, and some of them happen to have slashes in their names which TiddlyWiki uses to display them in a tree. But //folder// is a useful way to describe each level of the hierarchy.)\\n\\nImportant top-level folders in this hierarchy include:\\n\\n* `config` -- {{Ltc:EverySetting||LieToChildrenTemplate}} (there are other settings here that aren't displayed in the control panel as well)\\n* `core` -- most of the ''code of TiddlyWiki'', in both JavaScript and wikitext, is kept in here\\n* `language` -- contains ''translations'' for TiddlyWiki elements into your local language\\n* `palettes` -- contains ''tables from names to colors'' used to draw the interface\\n* `plugins` -- any ''plugins you've installed'' go here\\n* `state` -- contains temporary tiddlers that describe ''what you currently have open and selected'' in the user interface\\n* `tags` -- for the parts of TiddlyWiki's interface and functionality people most frequently want to ''add parts to'', TiddlyWiki provides these special tags; by adding the tag to a new tiddler, that tiddler appears in TiddlyWiki's interface\\n* `temp` -- contains miscellaneous ''temporary tiddlers''\\n* `themes` -- contains [[CSS|Stylesheets]] and configuration tweaks describing ''how to draw the interface''\\n\\nMany people like to create a top-level folder titled with their name or initials (e.g., I use `$:/sib`), so that when they create their own custom system tiddlers, they can see them all in the same place and remember what they've added. You don't have to make your custom tiddlers system tiddlers -- you could just make them normal tiddlers with whatever names you like -- but if you make them system tiddlers, you won't struggle to find them in among your wiki's content.\\n\\nYou can see a list of all system tiddlers in the ''System'' section of the ''More'' tab. However, the ''Explorer'' tab is usually a better way to look -- this will show them in a tree view.\\n\\nAs noted earlier, system tiddlers are not shown in the results provided by the standard search box. If you want to find one, perhaps so you can edit it or inspect how it works, you can search in system tiddlers using the ''System'' tab of Advanced Search. On the other hand, system tiddlers are //not// hidden from filters. Often this isn't noticeable at all since filters typically look for things with a particular tag or field or link, and system tiddlers typically do not share tags, field values, or links with non-system tiddlers. However, some filters, both those built into TiddlyWiki and ones you compose yourself, will need to use the `!is[system]` filter step to remove system tiddlers from the list.\\n\\nNote that neither Advanced Search, nor filters you may write, nor the ''System'' section of the ''More'' tab includes system tiddlers that are also [[shadow tiddlers|Shadow Tiddlers]] (we'll discuss those in a moment). To find those, you'll need to use the ''Shadows'' tab of either interface.\\n\\n!! Exercises\\n\\n{{Ex:CreateSystemTiddler||ExerciseTemplate}}\\n{{Ex:ExploreSystemTiddlers||ExerciseTemplate}}\\n\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Ta:20200822211244880\":{\"title\":\"Ta:20200822211244880\",\"answer\":\"The tiddler.\",\"created\":\"20201228232338980\",\"modified\":\"20210408175114783\",\"origin\":\"Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What is the basic unit of information in TiddlyWiki called?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20200822211313655\":{\"title\":\"Ta:20200822211313655\",\"created\":\"20201228235958360\",\"modified\":\"20210408175116252\",\"origin\":\"Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"In TiddlyWiki, everything is {a tiddler}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20200822211503713\":{\"title\":\"Ta:20200822211503713\",\"created\":\"20201229010008510\",\"modified\":\"20210408175215221\",\"origin\":\"Fields\",\"qtype\":\"remembercz\",\"question\":\"A tiddler is made up of a number of {fields}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20200822211526055\":{\"title\":\"Ta:20200822211526055\",\"answer\":\"`title`\",\"created\":\"20201229025141722\",\"modified\":\"20210408175217518\",\"origin\":\"Fields\",\"qtype\":\"rememberq\",\"question\":\"What field of a tiddler do you use to reference it from elsewhere in the wiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20200822211552128\":{\"title\":\"Ta:20200822211552128\",\"answer\":\"`text`\",\"created\":\"20201229025209620\",\"modified\":\"20210408175219699\",\"origin\":\"Fields\",\"qtype\":\"rememberq\",\"question\":\"What is the name of the tiddler field that stores the tiddler's main content?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20200822211746148\":{\"title\":\"Ta:20200822211746148\",\"answer\":\"TiddlyWiki shows the link in //italics//.\",\"created\":\"20201229030154128\",\"modified\":\"20210408180628017\",\"origin\":\"Links\",\"qtype\":\"rememberq\",\"question\":\"How can you tell that a link points to a tiddler that does not yet exist?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20200822212240517\":{\"title\":\"Ta:20200822212240517\",\"answer\":\"`[[My Tiddler]]`\",\"created\":\"20201229030133218\",\"modified\":\"20210408180634486\",\"origin\":\"Links\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to link to a tiddler called `My Tiddler`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20200822212544970\":{\"title\":\"Ta:20200822212544970\",\"created\":\"20201229030032630\",\"modified\":\"20210408180645964\",\"origin\":\"Links\",\"qtype\":\"remembercz\",\"question\":\"A phrase is in camel case when there are no {spaces} between words and the beginning of each word is {capitalized}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229025230862\":{\"title\":\"Ta:20201229025230862\",\"answer\":\"Separate fields allow you to easily retrieve exactly that information or search and filter based on it later.\",\"created\":\"20201229025238374\",\"modified\":\"20210408175242832\",\"origin\":\"Fields\",\"qtype\":\"rememberq\",\"question\":\"Why might you choose to separate information in a tiddler into multiple fields, rather than placing it all in the `text` field?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229025804939\":{\"title\":\"Ta:20201229025804939\",\"answer\":\"e.g., the time of a meeting, a person's phone number, the year a book was published, the URL of source material\",\"created\":\"20201229025808136\",\"modified\":\"20210817221838586\",\"origin\":\"Fields\",\"qtype\":\"rememberq\",\"question\":\"Give an example of a piece of information you might put in a tiddler field (try to pick a new one).\",\"tags\":\"Takeaway\",\"tiddler\":\"$:/config/sobjornstad/TakeAway/ContextualHelp/seen/creative-question\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229030304572\":{\"title\":\"Ta:20201229030304572\",\"created\":\"20201229030307210\",\"modified\":\"20210408175542446\",\"origin\":\"Wikitext\",\"qtype\":\"remembercz\",\"question\":\"The content of tiddlers is written in a markup language called {wikitext}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229030422254\":{\"title\":\"Ta:20201229030422254\",\"created\":\"20201229030425627\",\"modified\":\"20210409020134457\",\"origin\":\"Tags\",\"qtype\":\"remembercz\",\"question\":\"In TiddlyWiki, tags are a special kind of {link} to another tiddler.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229030621143\":{\"title\":\"Ta:20201229030621143\",\"created\":\"20201229030636372\",\"modified\":\"20210408180647876\",\"origin\":\"Links\",\"qtype\":\"remembercz\",\"question\":\"The set of links to a specific tiddler from anywhere in the wiki are called that tiddler's {backlinks}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229030848490\":{\"title\":\"Ta:20201229030848490\",\"created\":\"20201229030857524\",\"modified\":\"20210409020136681\",\"origin\":\"Tags\",\"qtype\":\"remembercz\",\"question\":\"If the tiddler `Soren` has a tag `Person`, the tiddler `Person` is said to be {tagging} the tiddler `Soren`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229030953451\":{\"title\":\"Ta:20201229030953451\",\"answer\":\"The tag.\",\"created\":\"20201229030955602\",\"modified\":\"20210409020140135\",\"origin\":\"Tags\",\"qtype\":\"rememberq\",\"question\":\"What basic TiddlyWiki concept is used to define hierarchies of tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229031256513\":{\"title\":\"Ta:20201229031256513\",\"answer\":\"TiddlyWiki implements hierarchies using tags, where a tiddler's tags represent its parent(s) in a hierarchy, and a tiddler can have more than one tag.\",\"created\":\"20201229031258882\",\"modified\":\"20221015160918300\",\"origin\":\"Tags\",\"qtype\":\"rememberq\",\"question\":\"Explain why tiddlers can be in multiple places within one hierarchy.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229031750518\":{\"title\":\"Ta:20201229031750518\",\"answer\":\"Click the //Recent// tab in the sidebar and select the appropriate tiddler.\",\"created\":\"20201229031755663\",\"modified\":\"20210409022716951\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"How can you reopen tiddlers that you recently edited and then closed?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229031836905\":{\"title\":\"Ta:20201229031836905\",\"answer\":\"`!! Section`\",\"created\":\"20201229031840712\",\"modified\":\"20210409022719872\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to create a second-level section heading called //Section//?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229033207375\":{\"title\":\"Ta:20201229033207375\",\"answer\":\"`''bold text''`\",\"created\":\"20201229033208604\",\"modified\":\"20210409022729549\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax for bold text?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229033224063\":{\"title\":\"Ta:20201229033224063\",\"answer\":\"`//italic text//`\",\"created\":\"20201229033225366\",\"modified\":\"20210409022731715\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax for italic text?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229033500358\":{\"title\":\"Ta:20201229033500358\",\"answer\":\"Alt+P\",\"created\":\"20201229033503534\",\"modified\":\"20210409022733962\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What keyboard shortcut, while editing a tiddler, toggles the side-by-side preview function?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229033547873\":{\"title\":\"Ta:20201229033547873\",\"answer\":\"In a tiddler's main text field.\",\"created\":\"20201229033553908\",\"modified\":\"20210418131957334\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"For editor keyboard shortcuts to work, such as those that insert italic markup, where must your cursor be positioned?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229033735626\":{\"title\":\"Ta:20201229033735626\",\"answer\":\"Turn on the side-by-side preview function.\",\"created\":\"20201229033737299\",\"modified\":\"20210409022751235\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"If you're unsure whether your wikitext markup is correct, how can you quickly check it without saving the tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229034152108\":{\"title\":\"Ta:20201229034152108\",\"answer\":\"Control+Enter\",\"created\":\"20201229034153231\",\"modified\":\"20210502173957172\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What editor keyboard shortcut saves the changes to a tiddler and exits edit mode?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229034446872\":{\"title\":\"Ta:20201229034446872\",\"answer\":\"The contact tiddler will accumulate a list of backlinks that lets you easily find all references to the person.\",\"created\":\"20201229034449199\",\"modified\":\"20210409024225953\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Why is it a good idea to link to a contact tiddler when mentioning that person in your work notes, even if you are unlikely to want to jump to that tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229034615019\":{\"title\":\"Ta:20201229034615019\",\"created\":\"20201229034616969\",\"modified\":\"20210409024230343\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"Linking is often a more effective way to build a list of references to a person, object, or concept than full-text search because search, unlike links, is subject to both {c1::false positive}s and {c1::false negative}s.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229034751031\":{\"title\":\"Ta:20201229034751031\",\"answer\":\"If you felt the mention was not relevant in any other context, and you explicitly did not want the notes to appear in connection with that person.\",\"created\":\"20201229034755780\",\"modified\":\"20210409024239085\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Why might you choose //not// to link to a person's contact tiddler in some notes, even if you were mentioning them?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229034858232\":{\"title\":\"Ta:20201229034858232\",\"answer\":\"When you find the phrase you searched for in a tiddler, but the tiddler is not relevant to what you were looking for (e.g., you searched for `Jane` and got a tiddler about another person //Janet//).\",\"created\":\"20201229034900398\",\"modified\":\"20210409024249243\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"In the context of full-text search, what is a //false positive//?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229035036108\":{\"title\":\"Ta:20201229035036108\",\"answer\":\"When the phrase you search for fails to retrieve a relevant tiddler (e.g., you searched for `Robert`, but in the tiddler you called him //Bob//).\",\"created\":\"20201229035037606\",\"modified\":\"20210409024258215\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"In the context of full-text search, what is a //false negative//?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229035422461\":{\"title\":\"Ta:20201229035422461\",\"answer\":\"e.g., searching for `Katherine` when you called her `Kate`, searching for `start here` when you wrote `begin here`\",\"created\":\"20201229035424934\",\"modified\":\"20210409024305263\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Give an example of a full-text search that yields a false negative, including both the phrase you search for and the reason it doesn't work (try to pick a new example).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229035537182\":{\"title\":\"Ta:20201229035537182\",\"created\":\"20201229035539375\",\"modified\":\"20210409024309050\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"TiddlyWiki's power is directly proportional to the amount of care you put into {linking together / relating} ideas.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229035950796\":{\"title\":\"Ta:20201229035950796\",\"created\":\"20201229035952129\",\"modified\":\"20210409024323043\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"A //tiddler list// field consists of a series of {tiddler titles} separated by spaces.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229040048702\":{\"title\":\"Ta:20201229040048702\",\"answer\":\"Surround it with double square brackets as if linking to it: `[[My Tiddler]]`.\",\"created\":\"20201229040049863\",\"modified\":\"20210409024425278\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"How would you place a tiddler named `My Tiddler` in a list field, since it contains a space and tiddlers are separated by spaces in list fields?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229040227672\":{\"title\":\"Ta:20201229040227672\",\"answer\":\"Click the info button on the tiddler's view toolbar, then the //Backlinks// tab.\",\"created\":\"20201229040228907\",\"modified\":\"20221015161223267\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"When viewing a tiddler, where can you look to find a list of its backlinks in stock TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229040301820\":{\"title\":\"Ta:20201229040301820\",\"answer\":\"Click the info button on the tiddler's view toolbar, then the //Fields// tab.\",\"created\":\"20201229040303487\",\"modified\":\"20211129232258577\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"When viewing a tiddler, where can you look to find a list of its fields in stock TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229041027133\":{\"title\":\"Ta:20201229041027133\",\"answer\":\"The //excise// button on the edit toolbar.\",\"created\":\"20201229041029939\",\"modified\":\"20210409024853859\",\"origin\":\"Meeting Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"When you are editing a tiddler and realize that a portion of its contents should be split into its own tiddler, what operation would you use?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229041348365\":{\"title\":\"Ta:20201229041348365\",\"answer\":\"December 9, 2018. (You have to subtract five hours from the `01` part, since the timestamp is at UTC+0, which moves the calendar back a day.)\",\"created\":\"20201229041355152\",\"modified\":\"20210409024931341\",\"origin\":\"Meeting Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"In the UTC-5 timezone, what date does the TiddlyWiki timestamp `20181210015823551` represent?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229041904213\":{\"title\":\"Ta:20201229041904213\",\"answer\":\"A link only records that the tiddlers are //related// in some unexplained way; because the field has a name, it can explain exactly how they are related.\",\"created\":\"20201229041909709\",\"modified\":\"20210409024937809\",\"origin\":\"Meeting Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Why does listing related tiddlers in a field, such as `participants`, provide more information to TiddlyWiki than linking to them in a tiddler's text?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229042226193\":{\"title\":\"Ta:20201229042226193\",\"created\":\"20201229042227539\",\"modified\":\"20210409025820846\",\"origin\":\"Project Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"It's better for tiddlers to indicate that they're {c1::a part of a whole}, rather than the whole listing {c1::all of its parts}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229042909540\":{\"title\":\"Ta:20201229042909540\",\"created\":\"20201229042921599\",\"modified\":\"20210409030944660\",\"origin\":\"Knowledge Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"A tiddler that does not exist but has links pointing to it is said to be {missing}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229042945472\":{\"title\":\"Ta:20201229042945472\",\"answer\":\"On the ''Missing'' section of the ''More'' sidebar tab.\",\"created\":\"20201229042946651\",\"modified\":\"20210409030953058\",\"origin\":\"Knowledge Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Where in TiddlyWiki's stock interface can you find a list of missing tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229132641099\":{\"title\":\"Ta:20201229132641099\",\"created\":\"20201229132643999\",\"modified\":\"20210409030956315\",\"origin\":\"Knowledge Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"Lean towards relating two tiddlers with a tag if one is {part of} the other, and towards relating them with a link if one is merely {related to} the other.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229132721666\":{\"title\":\"Ta:20201229132721666\",\"answer\":\"The more tags you have, the longer it takes to determine what tags should be added to a tiddler.\",\"created\":\"20201229132742157\",\"modified\":\"20210409031002973\",\"origin\":\"Knowledge Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Why is creating too many general-purpose tags problematic?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229132913263\":{\"title\":\"Ta:20201229132913263\",\"created\":\"20201229132918926\",\"modified\":\"20210409031009431\",\"origin\":\"Knowledge Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"Before adding a tag, make sure you can identify a situation where you would {use the tag} to find something or make a decision about the tiddler.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229133430741\":{\"title\":\"Ta:20201229133430741\",\"answer\":\"Matches on the title appear at the top of search results, and there are many fewer of them than text matches.\",\"created\":\"20201229133432015\",\"modified\":\"20210409032154496\",\"origin\":\"Searching\",\"qtype\":\"rememberq\",\"question\":\"Why is it particularly helpful to include important keywords in the title of your tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229133511208\":{\"title\":\"Ta:20201229133511208\",\"answer\":\"Ctrl+Shift+F\",\"created\":\"20201229133512754\",\"modified\":\"20210502174021449\",\"origin\":\"Searching\",\"qtype\":\"rememberq\",\"question\":\"What keyboard shortcut puts the focus in the main search box?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229133609019\":{\"title\":\"Ta:20201229133609019\",\"answer\":\"`title`, `text`, and `tags` only.\",\"created\":\"20201229133610094\",\"modified\":\"20240612040351388\",\"origin\":\"Searching\",\"qtype\":\"rememberq\",\"question\":\"Which fields of a tiddler does the main search box look in?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229133709005\":{\"title\":\"Ta:20201229133709005\",\"answer\":\"TiddlyWiki's default search box only looks in the `title`, `text`, and `tags` fields.\",\"created\":\"20201229133710673\",\"modified\":\"20241013004828645\",\"origin\":\"Searching\",\"qtype\":\"rememberq\",\"question\":\"Why might a search for `lemons` not find a tiddler which has an `ingredients` field containing the word //lemons//?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229150107986\":{\"title\":\"Ta:20201229150107986\",\"answer\":\"It is ambiguous; it could refer to several companies, a fruit, a computer…\",\"created\":\"20201229150109886\",\"modified\":\"20210409130116657\",\"origin\":\"Tiddler Titles\",\"qtype\":\"rememberq\",\"question\":\"Why is //Apple// likely a problematic title for a tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229150153169\":{\"title\":\"Ta:20201229150153169\",\"created\":\"20201229150154649\",\"modified\":\"20210409130124011\",\"origin\":\"Tiddler Titles\",\"qtype\":\"remembercz\",\"question\":\"Tiddler titles are a form of {metacommentary}, a way of commenting on the claims or ideas in the tiddler and explaining what to think about them.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229150514130\":{\"title\":\"Ta:20201229150514130\",\"answer\":\"You may accidentally create duplicate tiddlers on the same idea, since tiddler titles are case-sensitive.\",\"created\":\"20201229150516613\",\"modified\":\"20210409131327107\",\"origin\":\"Naming Conventions\",\"qtype\":\"rememberq\",\"question\":\"What confusion may result if you don't have consistent rules for how to capitalize the titles of tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229150834732\":{\"title\":\"Ta:20201229150834732\",\"answer\":\"If you don't, you might use a plural when a singular already exists (or vice versa) and create a duplicate tiddler.\",\"created\":\"20201229150836340\",\"modified\":\"20210409131329396\",\"origin\":\"Naming Conventions\",\"qtype\":\"rememberq\",\"question\":\"Why is it valuable to make all tiddler names that represent nouns singular, or all of them plural?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229151002291\":{\"title\":\"Ta:20201229151002291\",\"created\":\"20201229151003687\",\"modified\":\"20210409125125233\",\"origin\":\"Browsing Your Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"Tiddlers that are currently being edited are called {drafts}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229151054738\":{\"title\":\"Ta:20201229151054738\",\"created\":\"20201229151055958\",\"modified\":\"20210409125127348\",\"origin\":\"Browsing Your Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"Tiddlers that have not been linked to in the text field of any other tiddler are called {orphans}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229151146289\":{\"title\":\"Ta:20201229151146289\",\"answer\":\"By dragging and dropping them on the //Open// tab of the sidebar.\",\"created\":\"20201229151149028\",\"modified\":\"20210409125129381\",\"origin\":\"Browsing Your Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"How can you reorder the tiddlers currently displayed in the story river?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229151337744\":{\"title\":\"Ta:20201229151337744\",\"answer\":\"`text`\",\"created\":\"20201229151339841\",\"modified\":\"20210409125131967\",\"origin\":\"Browsing Your Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"To remove a tiddler from the list of orphans, another tiddler must link to it within what field?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229151447515\":{\"title\":\"Ta:20201229151447515\",\"answer\":\"On the //More// tab of the sidebar.\",\"created\":\"20201229151450290\",\"modified\":\"20210418131733931\",\"origin\":\"Browsing Your Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Most of the options for browsing lists of tiddlers in your wiki can be found where in TiddlyWiki's interface?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229151542420\":{\"title\":\"Ta:20201229151542420\",\"answer\":\"A draft tiddler, which will house your changes until you save them.\",\"created\":\"20201229151543639\",\"modified\":\"20210409125201551\",\"origin\":\"Browsing Your Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"When you begin editing a tiddler, what kind of new tiddler is created?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229151619186\":{\"title\":\"Ta:20201229151619186\",\"answer\":\"The draft tiddler containing the new version replaces the original tiddler (and the draft tiddler is deleted).\",\"created\":\"20201229151625095\",\"modified\":\"20210409125211638\",\"origin\":\"Browsing Your Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What manipulations to tiddlers are carried out when you save (or //confirm//) changes to a tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229151835493\":{\"title\":\"Ta:20201229151835493\",\"answer\":\"The tag.\",\"created\":\"20201229151838250\",\"modified\":\"20241010132155243\",\"origin\":\"Creating Hierarchies with a Table of Contents\",\"qtype\":\"rememberq\",\"question\":\"The built-in table-of-contents features in TiddlyWiki find hierarchies based on what TiddlyWiki concept?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229152140871\":{\"title\":\"Ta:20201229152140871\",\"answer\":\"`<<toc \\\"TableOfContents\\\">>`\",\"created\":\"20201229152142692\",\"modified\":\"20240929214235195\",\"origin\":\"Creating Hierarchies with a Table of Contents\",\"qtype\":\"rememberq\",\"question\":\"What wikitext syntax displays a table of contents that shows all tiddlers in a non-expandable hierarchy, beginning at the tiddler `TableOfContents`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229152249751\":{\"title\":\"Ta:20201229152249751\",\"answer\":\"`<<toc-selective-expandable \\\"My Start Tiddler\\\">>`\",\"created\":\"20201229152256606\",\"modified\":\"20240929214236469\",\"origin\":\"Creating Hierarchies with a Table of Contents\",\"qtype\":\"rememberq\",\"question\":\"What wikitext syntax displays a table of contents that displays tiddlers in a collapsable and expandable hierarchy, beginning from the tiddler `My Start Tiddler`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229152529071\":{\"title\":\"Ta:20201229152529071\",\"answer\":\"e.g., steps in a project or procedure, an organization's management hierarchy\",\"created\":\"20201229152531292\",\"modified\":\"20240929214238614\",\"origin\":\"Creating Hierarchies with a Table of Contents\",\"qtype\":\"rememberq\",\"question\":\"Give an example of a time when you might want to use a table of contents to create a small hierarchy within a larger set of notes (try to pick a new one).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229152725707\":{\"title\":\"Ta:20201229152725707\",\"created\":\"20201229152726809\",\"modified\":\"20241010132237348\",\"origin\":\"Creating Hierarchies with a Table of Contents\",\"qtype\":\"remembercz\",\"question\":\"The TiddlyWiki table-of-contents features display the value of the {`caption`} field instead of the tiddler's title, if such a field exists.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201229152806403\":{\"title\":\"Ta:20201229152806403\",\"answer\":\"The `caption` field of the tiddler is set to `A tiddler I don't like very much`.\",\"created\":\"20201229152809724\",\"modified\":\"20240929214243413\",\"origin\":\"Creating Hierarchies with a Table of Contents\",\"qtype\":\"rememberq\",\"question\":\"A tiddler titled `MyFavoriteTiddler` appears in a table of contents as `A tiddler I don't like very much`. Why does the title not match?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230162251323\":{\"title\":\"Ta:20201230162251323\",\"created\":\"20201230162255166\",\"modified\":\"20210409151510440\",\"origin\":\"Filters\",\"qtype\":\"remembercz\",\"question\":\"TiddlyWiki filters serve a similar function to {formulas} in Excel or other spreadsheet applications.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230162420639\":{\"title\":\"Ta:20201230162420639\",\"answer\":\"To select tiddlers that match certain criteria.\",\"created\":\"20201230162424699\",\"modified\":\"20210409151512101\",\"origin\":\"Filters\",\"qtype\":\"rememberq\",\"question\":\"What is the primary purpose of filters?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230162558911\":{\"title\":\"Ta:20201230162558911\",\"answer\":\"Nothing. TiddlyWiki is aware of when it needs to reprocess the filter, so any changes appear immediately.\",\"created\":\"20201230162600759\",\"modified\":\"20210409151516563\",\"origin\":\"Filters\",\"qtype\":\"rememberq\",\"question\":\"When you create a dynamic list that is populated by a filter, what must you do to update the list to match changes in the wiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230162726228\":{\"title\":\"Ta:20201230162726228\",\"created\":\"20201230162727415\",\"modified\":\"20210409152332592\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"remembercz\",\"question\":\"A filter expression consists of one or more filter {run}s.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230162740192\":{\"title\":\"Ta:20201230162740192\",\"created\":\"20201230162741473\",\"modified\":\"20210418131919872\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"remembercz\",\"question\":\"A filter run consists of one or more filter {step}s.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230162912482\":{\"title\":\"Ta:20201230162912482\",\"created\":\"20201230162914568\",\"modified\":\"20210409152338772\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"remembercz\",\"question\":\"A filter run can be thought of as a {pipeline} (logistics/transportation metaphor), where each step processes its input and produces new output.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230163017337\":{\"title\":\"Ta:20201230163017337\",\"answer\":\"filter expression > filter run > filter step\",\"created\":\"20201230163018391\",\"modified\":\"20210418131923989\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"rememberq\",\"question\":\"Put the following filter concepts in order from largest to smallest: filter step, filter expression, filter run.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230163141646\":{\"title\":\"Ta:20201230163141646\",\"answer\":\"`[[My Tiddler]]` (`[title[My Tiddler]]` would also work, among other options; but that's longer.)\",\"created\":\"20201230163144011\",\"modified\":\"20210409152351114\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"rememberq\",\"question\":\"What is the shortest filter expression that selects the single tiddler `My Tiddler`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230163214398\":{\"title\":\"Ta:20201230163214398\",\"answer\":\"`[tag[Project]]`\",\"created\":\"20201230163217137\",\"modified\":\"20210409152357141\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"rememberq\",\"question\":\"What filter expression selects all tiddlers that are tagged `Project`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230163300801\":{\"title\":\"Ta:20201230163300801\",\"answer\":\"`!is[system]`\",\"created\":\"20201230163302373\",\"modified\":\"20210418131943487\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"rememberq\",\"question\":\"What filter step removes all system tiddlers from consideration?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230163348978\":{\"title\":\"Ta:20201230163348978\",\"answer\":\"It is a single filter step; to be a complete filter expression, it needs an outer set of square brackets, like `[tag[Contact]]`.\",\"created\":\"20201230163350480\",\"modified\":\"20210409152402448\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"rememberq\",\"question\":\"Why does the filter expression `tag[Contact]` not work?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230163426864\":{\"title\":\"Ta:20201230163426864\",\"answer\":\"The //Filter// tab of Advanced Search.\",\"created\":\"20201230163428701\",\"modified\":\"20210409152405956\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"rememberq\",\"question\":\"In what part of TiddlyWiki's interface can you quickly test a filter expression?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230163510268\":{\"title\":\"Ta:20201230163510268\",\"answer\":\"Ctrl+Shift+A\",\"created\":\"20201230163511287\",\"modified\":\"20210502174054995\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"rememberq\",\"question\":\"What is the keyboard shortcut to open Advanced Search?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230163559681\":{\"title\":\"Ta:20201230163559681\",\"answer\":\"You forgot the outermost pair of square brackets in your filter expression.\",\"created\":\"20201230163601291\",\"modified\":\"20210409152446159\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"rememberq\",\"question\":\"What is the most common cause of the error message //Filter error: Missing [ in filter expression//?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230205202610\":{\"title\":\"Ta:20201230205202610\",\"answer\":\"An operator, a suffix, and a parameter.\",\"created\":\"20201230205203754\",\"modified\":\"20210409161704704\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"What three components make up a filter step?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230205236409\":{\"title\":\"Ta:20201230205236409\",\"answer\":\"`field`\",\"created\":\"20201230205238685\",\"modified\":\"20210409161710002\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"In the filter step `field:participants[Jane]`, what is the //operator//?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230205247649\":{\"title\":\"Ta:20201230205247649\",\"answer\":\"`participants`\",\"created\":\"20201230205249605\",\"modified\":\"20210409161712058\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"In the filter step `field:participants[Jane]`, what is the //suffix//?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230205258398\":{\"title\":\"Ta:20201230205258398\",\"answer\":\"`Jane`\",\"created\":\"20201230205259591\",\"modified\":\"20210409161713518\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"In the filter step `field:participants[Jane]`, what is the //parameter//?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230205710487\":{\"title\":\"Ta:20201230205710487\",\"answer\":\"All (non-shadow) tiddlers in the wiki.\",\"created\":\"20201230205717399\",\"modified\":\"20210409161718488\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"What are the input tiddlers to the filter step `tag[Person]` in the filter run `[tag[Person]]`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230210715030\":{\"title\":\"Ta:20201230210715030\",\"created\":\"20201230210717023\",\"modified\":\"20210409161720462\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"remembercz\",\"question\":\"A filter operator that ignores its input is called a {constructor}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230213137879\":{\"title\":\"Ta:20201230213137879\",\"answer\":\"`!`\",\"created\":\"20201230213139759\",\"modified\":\"20210418131744606\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"What character can you place before a filter operator to negate its meaning?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230213236939\":{\"title\":\"Ta:20201230213236939\",\"answer\":\"The first run returns all tiddlers that //are// system tiddlers; the second run returns all tiddlers that are //not// system tiddlers.\",\"created\":\"20201230213240799\",\"modified\":\"20210409161727539\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"How do the results of the filter runs `[is[system]]` and `[!is[system]]` differ?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230213542739\":{\"title\":\"Ta:20201230213542739\",\"answer\":\"All of the (non-shadow) tiddlers in the wiki.\",\"created\":\"20201230213543900\",\"modified\":\"20210409161733822\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"If a filter run does not begin with a constructor, what are the input tiddlers of the first step in the run?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230213928787\":{\"title\":\"Ta:20201230213928787\",\"answer\":\"The suffix is silently ignored.\",\"created\":\"20201230213930371\",\"modified\":\"20210409161738792\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"What happens if you add a suffix to a filter operator that doesn't support suffixes?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230234621972\":{\"title\":\"Ta:20201230234621972\",\"answer\":\"All tiddlers in the wiki that are tagged with both `NeedsUpdate` and `Person`.\",\"created\":\"20201230234625127\",\"modified\":\"20210409161746568\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"What are the output tiddlers to the filter step `tag[Person]` in the filter run `[tag[NeedsUpdate]tag[Person]]`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230234833903\":{\"title\":\"Ta:20201230234833903\",\"answer\":\"`backlinks[]`\",\"created\":\"20201230234834948\",\"modified\":\"20210409165356187\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"What filter operator outputs all the tiddlers that link to its input tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230234852880\":{\"title\":\"Ta:20201230234852880\",\"answer\":\"`links[]`\",\"created\":\"20201230234854277\",\"modified\":\"20210409165359148\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"What filter operator outputs all the tiddlers that are linked within the `text` field of its input tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230234929251\":{\"title\":\"Ta:20201230234929251\",\"answer\":\"`tagging[]`\",\"created\":\"20201230234930237\",\"modified\":\"20210418131718689\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"What filter operator outputs all tiddlers in the wiki that are //tagged by// one of its input tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230235140455\":{\"title\":\"Ta:20201230235140455\",\"answer\":\"`firstname[Margaret]`, or `field:firstname[Margaret]`\",\"created\":\"20201230235146110\",\"modified\":\"20210409165407469\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"Write a filter step that finds all tiddlers which have a field `firstname` set to the exact value `Margaret`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230235250718\":{\"title\":\"Ta:20201230235250718\",\"answer\":\"`field:has[money]` (The short form `has[money]` doesn't work, because `has` is a built-in filter operator; this keeps only tiddlers that have a non-empty field called `money`.)\",\"created\":\"20201230235255697\",\"modified\":\"20210409165425911\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"Write a filter step that finds all tiddlers which have a field `has` set to the exact value `money`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230235432908\":{\"title\":\"Ta:20201230235432908\",\"answer\":\"`contains:family[Tom Swift]`\",\"created\":\"20201230235434408\",\"modified\":\"20210409165434142\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"Write a filter step that finds all tiddlers which have a list field `family` containing the tiddler `Tom Swift` (and possibly other tiddlers).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230235622890\":{\"title\":\"Ta:20201230235622890\",\"answer\":\"`[!has[caption]count[]]`\",\"created\":\"20201230235624237\",\"modified\":\"20240929214632858\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"Write a filter expression that finds the number of tiddlers in the wiki which do //not// have a field called `caption`, or have one with no text in it.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230235717132\":{\"title\":\"Ta:20201230235717132\",\"answer\":\"`[tag[Contact]sort[email]]`\",\"created\":\"20201230235719487\",\"modified\":\"20210409165449594\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"Write a filter expression that outputs all tiddlers with the `Contact` tag, sorted alphabetically by their `email` field.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201230235837017\":{\"title\":\"Ta:20201230235837017\",\"answer\":\"`[[Awesome Tiddler]get[description]]` (or the long form, `[title[Awesome Tiddler]get[description]]`)\",\"created\":\"20201230235838368\",\"modified\":\"20210409165544862\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"Write a filter expression with two steps that outputs the value of the `description` field on the tiddler named `Awesome Tiddler`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000114392\":{\"title\":\"Ta:20201231000114392\",\"created\":\"20201231000116390\",\"modified\":\"20210409171618308\",\"origin\":\"HTML\",\"qtype\":\"remembercz\",\"question\":\"{HTML} is a formatting language that underlies all web pages and a substantial number of desktop and mobile applications.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000140638\":{\"title\":\"Ta:20201231000140638\",\"created\":\"20201231000143583\",\"modified\":\"20210409171619838\",\"origin\":\"HTML\",\"qtype\":\"remembercz\",\"question\":\"Wikitext is almost a perfect {superset} of HTML (mathematics term).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000237015\":{\"title\":\"Ta:20201231000237015\",\"answer\":\"Wikitext is much less verbose, so it is faster to type and easier to work with.\",\"created\":\"20201231000238971\",\"modified\":\"20210409171622300\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"Why do we usually use wikitext instead of HTML to write tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000307047\":{\"title\":\"Ta:20201231000307047\",\"created\":\"20201231000308534\",\"modified\":\"20210409171624612\",\"origin\":\"HTML\",\"qtype\":\"remembercz\",\"question\":\"The strings of text `<ul>` and `</li>` are examples of HTML {tag}s.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000355989\":{\"title\":\"Ta:20201231000355989\",\"answer\":\"A closing tag has a forward slash (`/`) before the tag name.\",\"created\":\"20201231000402212\",\"modified\":\"20210409171628866\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"In HTML, what differentiates the syntax of an opening tag from that of a closing tag?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000425840\":{\"title\":\"Ta:20201231000425840\",\"answer\":\"The first is a forward slash. The second is a backslash.\",\"created\":\"20201231000426933\",\"modified\":\"20210409171632225\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"Which of the following characters is a backslash, and which is a forward slash? `/` `\\\\`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000459394\":{\"title\":\"Ta:20201231000459394\",\"answer\":\"Angle brackets.\",\"created\":\"20201231000500589\",\"modified\":\"20210409171634161\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"In the context of HTML tags, what are the characters `<` and `>` collectively called?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000531994\":{\"title\":\"Ta:20201231000531994\",\"created\":\"20201231000533307\",\"modified\":\"20210409171637271\",\"origin\":\"HTML\",\"qtype\":\"remembercz\",\"question\":\"The part of an HTML document between an opening tag and its matching closing tag, including the tags themselves, is called a/n {element}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000601245\":{\"title\":\"Ta:20201231000601245\",\"created\":\"20201231000603398\",\"modified\":\"20210409171639967\",\"origin\":\"HTML\",\"qtype\":\"remembercz\",\"question\":\"The part of an HTML document between an opening tag and its matching closing tag, //not// including the tags, is called the element's {content} (starts with C).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000723998\":{\"title\":\"Ta:20201231000723998\",\"answer\":\"E.g., `<li>`, `</ul>`, `<br>`, `<img>`, `</p>`\",\"created\":\"20201231000725371\",\"modified\":\"20210817221842301\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"Give an example of an HTML tag (try to pick a new one).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000803648\":{\"title\":\"Ta:20201231000803648\",\"answer\":\"An attribute.\",\"created\":\"20201231000805490\",\"modified\":\"20210409171653277\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"In the HTML element `<div style=\\\"text-align: center;\\\">Centered text!</div>`, what is the `style=\\\"text-align: center;\\\"` part called?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000856730\":{\"title\":\"Ta:20201231000856730\",\"answer\":\"A space.\",\"created\":\"20201231000900234\",\"modified\":\"20210409171700461\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"Multiple HTML attributes on a single element are separated by what character of punctuation?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231000938714\":{\"title\":\"Ta:20201231000938714\",\"answer\":\"The value contains spaces or special characters.\",\"created\":\"20201231000939852\",\"modified\":\"20210409171704151\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"The values of HTML attributes must be placed within quotation marks when what is true?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231001012979\":{\"title\":\"Ta:20201231001012979\",\"answer\":\"Its opening tag.\",\"created\":\"20201231001014237\",\"modified\":\"20210409171706177\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"An attribute of an HTML element is found within what part of the element?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231001054308\":{\"title\":\"Ta:20201231001054308\",\"answer\":\"`<li></li>`\",\"created\":\"20201231001057693\",\"modified\":\"20210409171708623\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"The self-closing tag `<li />` is shorthand for what HTML?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231001143084\":{\"title\":\"Ta:20201231001143084\",\"answer\":\"There is a forward slash at the end of the opening tag, and no closing tag at all: `<tag />`\",\"created\":\"20201231001144780\",\"modified\":\"20210409171711532\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"In HTML, what syntax distinguishes a //self-closing tag// from a normal one?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231001229646\":{\"title\":\"Ta:20201231001229646\",\"created\":\"20201231001236890\",\"modified\":\"20210409171715214\",\"origin\":\"HTML\",\"qtype\":\"remembercz\",\"question\":\"In HTML, a //void element// is one that has only a/n {c1::opening tag} and no {c1::closing tag}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231001318622\":{\"title\":\"Ta:20201231001318622\",\"answer\":\"The closing tag literally appears in the rendered output of the tiddler, like `</br>`.\",\"created\":\"20201231001320771\",\"modified\":\"20210409171720705\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"What happens if you use a closing tag for an HTML void element within a tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231001355790\":{\"title\":\"Ta:20201231001355790\",\"created\":\"20201231001356852\",\"modified\":\"20210409171723147\",\"origin\":\"HTML\",\"qtype\":\"remembercz\",\"question\":\"An HTML element placed inside another HTML element is said to be {nested} within the outer HTML element.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231001601903\":{\"title\":\"Ta:20201231001601903\",\"answer\":\"They are treated the same as a single space.\",\"created\":\"20201231001603282\",\"modified\":\"20210409171726531\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"In HTML, what special thing happens if you put multiple spaces or newlines in a row?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231001628667\":{\"title\":\"Ta:20201231001628667\",\"answer\":\"More than one newline in a row starts a new paragraph.\",\"created\":\"20201231001633860\",\"modified\":\"20210409171729533\",\"origin\":\"HTML\",\"qtype\":\"rememberq\",\"question\":\"What exception does TiddlyWiki add to the standard rules of HTML whitespace?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231001731208\":{\"title\":\"Ta:20201231001731208\",\"created\":\"20201231001732871\",\"modified\":\"20210409171734883\",\"origin\":\"HTML\",\"qtype\":\"remembercz\",\"question\":\"Tools that read HTML try to be {generous} in what they accept (philosophy for handling mistakes).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231002107146\":{\"title\":\"Ta:20201231002107146\",\"answer\":\"The names of widget elements begin with a dollar sign (`$`), like `<$list>` or `<$link>`.\",\"created\":\"20201231002109497\",\"modified\":\"20210521202545528\",\"origin\":\"Widgets\",\"qtype\":\"rememberq\",\"question\":\"How can widgets be distinguished from HTML tags in wikitext?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231002126678\":{\"title\":\"Ta:20201231002126678\",\"answer\":\"HTML\",\"created\":\"20201231002128224\",\"modified\":\"20210409171831089\",\"origin\":\"Widgets\",\"qtype\":\"rememberq\",\"question\":\"Widgets are a TiddlyWiki extension to what language?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231002329965\":{\"title\":\"Ta:20201231002329965\",\"created\":\"20201231002331187\",\"modified\":\"20210409173100473\",\"origin\":\"Your First Dynamic List\",\"qtype\":\"remembercz\",\"question\":\"Dynamic lists use a {filter} (TiddlyWiki concept) to decide what items to include in the list.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231002445816\":{\"title\":\"Ta:20201231002445816\",\"answer\":\"The `$list` widget.\",\"created\":\"20201231002447038\",\"modified\":\"20210409173104856\",\"origin\":\"Your First Dynamic List\",\"qtype\":\"rememberq\",\"question\":\"What widget would you use to sequentially display each of the outputs of a filter?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231002544545\":{\"title\":\"Ta:20201231002544545\",\"answer\":\"`<<currentTiddler>>`\",\"created\":\"20201231002546410\",\"modified\":\"20210409173106630\",\"origin\":\"Your First Dynamic List\",\"qtype\":\"rememberq\",\"question\":\"Within the content of a `$list` widget, what placeholder represents the output of the filter that is currently being processed (by default)?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231002722578\":{\"title\":\"Ta:20201231002722578\",\"answer\":\"`<br>` (Note that `<br>` is a void tag, so it does not have a matching closing tag.)\",\"created\":\"20201231002723798\",\"modified\":\"20210409173110342\",\"origin\":\"Your First Dynamic List\",\"qtype\":\"rememberq\",\"question\":\"In HTML, what tag can you use to create an explicit line break?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231002959090\":{\"title\":\"Ta:20201231002959090\",\"answer\":\"E.g., listing all tiddlers with a specific tag, displaying the sections in the //More// tab of the sidebar, showing all to-do items whose start date is after today\",\"created\":\"20201231003001255\",\"modified\":\"20210418132016314\",\"origin\":\"Your First Dynamic List\",\"qtype\":\"rememberq\",\"question\":\"Give an example of a situation in which you might want to create a dynamic list of tiddlers (try to pick a new one).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231003941730\":{\"title\":\"Ta:20201231003941730\",\"created\":\"20201231003942795\",\"modified\":\"20240929154500130\",\"origin\":\"Variables\",\"qtype\":\"remembercz\",\"question\":\"A variable is one way to define some wikitext in {c1::one} place and use it in {c1::many places}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231004010457\":{\"title\":\"Ta:20201231004010457\",\"answer\":\"A name and a value.\",\"created\":\"20201231004011806\",\"modified\":\"20240929154452885\",\"origin\":\"Variables\",\"qtype\":\"rememberq\",\"question\":\"A variable has what two parts?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231004046232\":{\"title\":\"Ta:20201231004046232\",\"answer\":\"The `$set` widget.\",\"created\":\"20201231004049739\",\"modified\":\"20240929154433869\",\"origin\":\"Variables\",\"qtype\":\"rememberq\",\"question\":\"What widget, with `name` and `value` attributes, can be used to set a single variable (only) to an arbitrary value?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231004133545\":{\"title\":\"Ta:20201231004133545\",\"answer\":\"After the closing `</$set>` or `</$let>` tag.\",\"created\":\"20201231004134568\",\"modified\":\"20240929154528447\",\"origin\":\"Variables\",\"qtype\":\"rememberq\",\"question\":\"When you define a variable using a `$set` or `$let`widget, the variable's value ceases to be accessible at what point in your wikitext?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231004216217\":{\"title\":\"Ta:20201231004216217\",\"created\":\"20201231004217204\",\"modified\":\"20240929154421475\",\"origin\":\"Variables\",\"qtype\":\"remembercz\",\"question\":\"When a variable ceases to be accessible at a closing `</$set>` tag, the variable is said to have gone {out of scope}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231004539860\":{\"title\":\"Ta:20201231004539860\",\"answer\":\"`<<myvar>>`\",\"created\":\"20201231004541137\",\"modified\":\"20240929154604314\",\"origin\":\"Variables\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to transclude the value of a variable named `myvar`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231004651266\":{\"title\":\"Ta:20201231004651266\",\"answer\":\"If you have to change the value, you only have to change it in one place.\",\"created\":\"20201231004654224\",\"modified\":\"20240929154627513\",\"origin\":\"Variables\",\"qtype\":\"rememberq\",\"question\":\"What is the primary benefit of reducing repetition in wikitext using variables, compared to copying and pasting the wikitext?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231004826336\":{\"title\":\"Ta:20201231004826336\",\"answer\":\"The space.\",\"created\":\"20201231004828322\",\"modified\":\"20240929154412642\",\"origin\":\"Variables\",\"qtype\":\"rememberq\",\"question\":\"Variable names cannot contain what common character of text?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231004933477\":{\"title\":\"Ta:20201231004933477\",\"answer\":\"The variable transclusion evaluates to nothing (nothing at all is displayed where you place the transclusion).\",\"created\":\"20201231004934903\",\"modified\":\"20240929154647612\",\"origin\":\"Variables\",\"qtype\":\"rememberq\",\"question\":\"What happens if you refer to a variable that does not exist with wikitext like `<<nonexistentVariable>>`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231005144733\":{\"title\":\"Ta:20201231005144733\",\"created\":\"20201231005147234\",\"modified\":\"20240929161706123\",\"origin\":\"Procedures\",\"qtype\":\"remembercz\",\"question\":\"Procedures, unlike variables, allow you to eliminate repetitive text where each occurrence of the repetitive text has some elements that {are different}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231005245149\":{\"title\":\"Ta:20201231005245149\",\"created\":\"20201231005246431\",\"modified\":\"20240929161729227\",\"origin\":\"Procedures\",\"qtype\":\"remembercz\",\"question\":\"The parts of a procedure's output that change depending on how the procedure is called are known as {c1::parameters}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231005359085\":{\"title\":\"Ta:20201231005359085\",\"answer\":\"A backslash, as in `\\\\procedure`.\",\"created\":\"20201231005400138\",\"modified\":\"20240929161744934\",\"origin\":\"Procedures\",\"qtype\":\"rememberq\",\"question\":\"A procedure definition begins with what character of punctuation?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231005417476\":{\"title\":\"Ta:20201231005417476\",\"created\":\"20201231005419435\",\"modified\":\"20241007222443111\",\"origin\":\"Procedures\",\"qtype\":\"remembercz\",\"question\":\"Using / transcluding a procedure is referred to as {calling} it.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231005612226\":{\"title\":\"Ta:20201231005612226\",\"answer\":\"`<<wikipediaLink Aardvark>>` (quotation marks around the value `Aardvark` are optional, since it contains no spaces)\",\"created\":\"20201231005613768\",\"modified\":\"20240929161841579\",\"origin\":\"Procedures\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to call the procedure `wikipediaLink` with the single parameter `Aardvark`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231005732263\":{\"title\":\"Ta:20201231005732263\",\"created\":\"20201231005733763\",\"modified\":\"20240929161857606\",\"origin\":\"Procedures\",\"qtype\":\"remembercz\",\"question\":\"A declaration beginning with a backslash at the beginning of a tiddler that explains how TiddlyWiki should read the rest of the tiddler is called a {pragma}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231005812772\":{\"title\":\"Ta:20201231005812772\",\"created\":\"20201231005815791\",\"modified\":\"20241007222456427\",\"origin\":\"Procedures\",\"qtype\":\"remembercz\",\"question\":\"In `\\\\procedure wikipediaLink(articleName)`, the part `(articleName)` is called the {parameter list} of the procedure.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231010010889\":{\"title\":\"Ta:20201231010010889\",\"answer\":\"With the text `\\\\end` on a separate line.\",\"created\":\"20201231010012028\",\"modified\":\"20241007222744983\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"A procedure definition that is more than one line long must be ended how?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231010504984\":{\"title\":\"Ta:20201231010504984\",\"answer\":\"As with a variable, nothing appears in the output where the wikitext referring to the procedure was.\",\"created\":\"20201231010507567\",\"modified\":\"20240929161948280\",\"origin\":\"Procedures\",\"qtype\":\"rememberq\",\"question\":\"What happens if you call a procedure that doesn't exist?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231010546414\":{\"title\":\"Ta:20201231010546414\",\"answer\":\"All pragmas must come at the top of a tiddler, before anything that is not a pragma.\",\"created\":\"20201231010548664\",\"modified\":\"20240929161959681\",\"origin\":\"Procedures\",\"qtype\":\"rememberq\",\"question\":\"What restriction is placed on the location of pragmas, such as `\\\\procedure`, within a tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231010627310\":{\"title\":\"Ta:20201231010627310\",\"answer\":\"That procedure definitions must come before all other text in the tiddler.\",\"created\":\"20201231010628288\",\"modified\":\"20240929162020362\",\"origin\":\"Procedures\",\"qtype\":\"rememberq\",\"question\":\"If you write a procedure definition and the definition literally appears in the output (i.e., you see `\\\\procedure something` in the rendered tiddler), what did you probably forget?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231012245335\":{\"title\":\"Ta:20201231012245335\",\"created\":\"20201231012246842\",\"modified\":\"20240929154408425\",\"origin\":\"Variables\",\"qtype\":\"remembercz\",\"question\":\"The two attributes used in the most basic form of the `$set` widget are {c1::`name`} and {c1::`value`}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231035841287\":{\"title\":\"Ta:20201231035841287\",\"answer\":\"At the end of that tiddler.\",\"created\":\"20201231035843620\",\"modified\":\"20240929165524529\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"When does a procedure defined at the top of a tiddler go out of scope?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231035927292\":{\"title\":\"Ta:20201231035927292\",\"answer\":\"`\\\\procedure myProcedure()`\",\"created\":\"20201231035928615\",\"modified\":\"20240929165601618\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to define a procedure `myProcedure` with no parameters?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231040040541\":{\"title\":\"Ta:20201231040040541\",\"answer\":\"`\\\\procedure myProcedure(a, b, c)`\",\"created\":\"20201231040041862\",\"modified\":\"20240929165552956\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to define a single-line procedure `myProcedure` with three parameters, `a`, `b`, and `c`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231040154144\":{\"title\":\"Ta:20201231040154144\",\"answer\":\"`<<myProcedure Aardvark \\\"Blue Baboon\\\">>`\",\"created\":\"20201231040155621\",\"modified\":\"20240929165617856\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to call a procedure `myProcedure` with two parameters, `Aardvark` and `Blue Baboon`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231040243184\":{\"title\":\"Ta:20201231040243184\",\"answer\":\"Place the parameter in triple double-quotes (“triple quotes”): `<<procedureName \\\"\\\"\\\"the \\\"parameter\\\" 'containing' quotes\\\"\\\"\\\">>`\",\"created\":\"20201231040248490\",\"modified\":\"20241012230544599\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"What is the simplest way to pass a parameter whose value contains both \\\"double quotes\\\" and 'single quotes' to a procedure?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231040441260\":{\"title\":\"Ta:20201231040441260\",\"answer\":\"`<<myProcedure y:\\\"2\\\" x:\\\"1\\\">>`\",\"created\":\"20201231040442487\",\"modified\":\"20240929165720331\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"Given a procedure defined with `\\\\procedure myProcedure(x, y)`, how can you use a double-angle-bracket procedure call `<<myProcedure>>` with x=\\\"1\\\" and y=\\\"2\\\", placing the parameter `y` //first// in the procedure call?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231040546593\":{\"title\":\"Ta:20201231040546593\",\"answer\":\"`\\\\procedure coloredText(text, color:\\\"red\\\")`\",\"created\":\"20201231040554973\",\"modified\":\"20240929165804474\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"How would you change the following procedure definition to supply a default value `red` for the parameter `color`?: `\\\\procedure coloredText(text, color)`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231040746846\":{\"title\":\"Ta:20201231040746846\",\"answer\":\"The `$transclude` widget.\",\"created\":\"20201231040747801\",\"modified\":\"20241012230635329\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"What widget is used to call a procedure in modern TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231040803697\":{\"title\":\"Ta:20201231040803697\",\"answer\":\"`$variable` (note the dollar sign)\",\"created\":\"20201231040804979\",\"modified\":\"20240929165940744\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"What attribute of the `$transclude` widget is used to supply the name of a procedure to call/transclude?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231040925049\":{\"title\":\"Ta:20201231040925049\",\"answer\":\"`<$transclude $variable=\\\"wikipediaLink\\\" name=\\\"Aardvark\\\" />`\",\"created\":\"20201231040927890\",\"modified\":\"20240929165956713\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"Use a `$transclude` widget to achieve the same effect as the following wikitext: `<<wikipediaLink name:\\\"Aardvark\\\">>`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231041222739\":{\"title\":\"Ta:20201231041222739\",\"answer\":\"The `variable` attribute needs a dollar sign, `$variable`, to distinguish it from a procedure parameter called `variable`.\",\"created\":\"20201231041224734\",\"modified\":\"20240929170035763\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"What is wrong with this procedure call?: `<$transclude variable=\\\"wikipediaLink\\\" articleTitle=\\\"Philosophy\\\"/>`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231041935247\":{\"title\":\"Ta:20201231041935247\",\"answer\":\"There is no `/` before the `>`, so the remainder of the tiddler [[will be gobbled up|Ex:UnclosedProcedureCall]].\",\"created\":\"20201231041937385\",\"modified\":\"20241012230655006\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"What is wrong with this procedure call?: `<$transclude $variable=\\\"wikipediaLink\\\" articleTitle=\\\"Philosophy\\\">`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231042152289\":{\"title\":\"Ta:20201231042152289\",\"answer\":\"When you need to pass transclusions of other things as the value of some of the parameters.\",\"created\":\"20201231042153726\",\"modified\":\"20240929170121246\",\"origin\":\"The Finer Points of Procedures\",\"qtype\":\"rememberq\",\"question\":\"When would you need to use a `$transclude` widget rather than the `<<double-angle-bracket>>` wikitext syntax?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231183319773\":{\"title\":\"Ta:20201231183319773\",\"created\":\"20201231183321606\",\"modified\":\"20240929170225186\",\"origin\":\"Field Transclusions\",\"qtype\":\"remembercz\",\"question\":\"The value of a field transclusion comes from a specified {field} of a tiddler.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231183458802\":{\"title\":\"Ta:20201231183458802\",\"answer\":\"`{{Book 2!!author}}`\",\"created\":\"20201231183501395\",\"modified\":\"20240929170229022\",\"origin\":\"Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What wikitext syntax would you use to transclude the contents of the `author` field of the `Book 2` tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231183519255\":{\"title\":\"Ta:20201231183519255\",\"answer\":\"`{{!!description}}`\",\"created\":\"20201231183520841\",\"modified\":\"20240929170233598\",\"origin\":\"Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What wikitext syntax would you use to transclude the `description` field of the current tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231183659048\":{\"title\":\"Ta:20201231183659048\",\"answer\":\"`text`\",\"created\":\"20201231183700864\",\"modified\":\"20240929170236864\",\"origin\":\"Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"When you transclude a tiddler without supplying a field name, like `{{IncludedTiddler}}`, what field is transcluded?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231183815120\":{\"title\":\"Ta:20201231183815120\",\"answer\":\"`<$transclude $variable=\\\"showRedText\\\" text={{!!warning}}/>`\",\"created\":\"20201231183816473\",\"modified\":\"20240929170250431\",\"origin\":\"Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What wikitext syntax would you use to call a procedure named `showRedText` with a parameter `text` set to the value of the `warning` field of the current tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231184349915\":{\"title\":\"Ta:20201231184349915\",\"answer\":\"Search looks at a tiddler's wikitext, and a transcluded tiddler is not part of the wikitext of the tiddler transcluding it.\",\"created\":\"20201231184351104\",\"modified\":\"20240929170300968\",\"origin\":\"Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Why is any text behind transclusions not considered when searching the contents of tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231184452406\":{\"title\":\"Ta:20201231184452406\",\"created\":\"20201231184453729\",\"modified\":\"20240929170308675\",\"origin\":\"Field Transclusions\",\"qtype\":\"remembercz\",\"question\":\"A //hard link// is one that can be detected by {a superficial examination} of wikitext.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231184535007\":{\"title\":\"Ta:20201231184535007\",\"answer\":\"A hard link appears in the wikitext of a tiddler, while a soft link only appears in the tiddler when it's rendered (e.g., because it was transcluded into that tiddler).\",\"created\":\"20201231184536280\",\"modified\":\"20240929170311538\",\"origin\":\"Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Explain the difference between a hard link and a soft link.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231184759654\":{\"title\":\"Ta:20201231184759654\",\"answer\":\"Using filters that inspect the relationships between tiddlers, such as `links[]`.\",\"created\":\"20201231184801879\",\"modified\":\"20240929170311065\",\"origin\":\"Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"A soft link does not appear when looking for links in what way?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231184943853\":{\"title\":\"Ta:20201231184943853\",\"answer\":\"Sometimes: this works fine as long as none of the tiddlers transclude one of the previous tiddlers in the stack of transcluded tiddlers (this forms an infinite loop and TiddlyWiki gives up on the transclusion).\",\"created\":\"20201231184947599\",\"modified\":\"20240929170315664\",\"origin\":\"Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Always/Sometimes/Never: It is OK to transclude a tiddler that itself transcludes other tiddlers.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231185141418\":{\"title\":\"Ta:20201231185141418\",\"answer\":\"You accidentally transcluded a tiddler into itself, either directly or by creating a loop (e.g., tiddler A transcludes tiddler B, while tiddler B transcludes tiddler A).\",\"created\":\"20201231185144000\",\"modified\":\"20240929170320198\",\"origin\":\"Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What does the error //Recursive transclusion error in transclude widget// suggest is wrong?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231185608799\":{\"title\":\"Ta:20201231185608799\",\"answer\":\"The current tiddler is changed to `JaneDoe`, the JaneDoe tiddler is rendered, and then the current tiddler returns to its previous value (most likely `ContactList`).\",\"created\":\"20201231185612842\",\"modified\":\"20240929170407175\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"What happens to the current tiddler while TiddlyWiki reads the transclusion `{{JaneDoe}}` within the tiddler `ContactList`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231185712575\":{\"title\":\"Ta:20201231185712575\",\"answer\":\"Nothing. The `||` causes TiddlyWiki to keep the current tiddler as `ContactList` while processing the transclusion.\",\"created\":\"20201231185715775\",\"modified\":\"20240929170408866\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"What happens to the current tiddler while TiddlyWiki reads the transclusion `{{||JaneDoe}}` within the tiddler `ContactList`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231185753892\":{\"title\":\"Ta:20201231185753892\",\"answer\":\"The current tiddler changes to `EmilyDoe`, the `JaneDoe` tiddler is rendered, and then the current tiddler returns to `ContactList`.\",\"created\":\"20201231185755191\",\"modified\":\"20240929170411295\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"What happens to the current tiddler while TiddlyWiki reads the transclusion `{{EmilyDoe||JaneDoe}}` within the tiddler `ContactList`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231185924193\":{\"title\":\"Ta:20201231185924193\",\"answer\":\"Transclude it, setting the current tiddler to a tiddler other than the template tiddler.\",\"created\":\"20201231185926952\",\"modified\":\"20240929170557135\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"A tiddler is being used as a //template// when you do what with it?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231190051880\":{\"title\":\"Ta:20201231190051880\",\"answer\":\"`ContactInformationTemplate` (with `JaneDoe` as the current tiddler)\",\"created\":\"20201231190053870\",\"modified\":\"20240929170600422\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"In the wikitext syntax `{{JaneDoe||ContactInformationTemplate}}`, which tiddler is being transcluded?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231190219699\":{\"title\":\"Ta:20201231190219699\",\"answer\":\"Some fields on the current tiddler.\",\"created\":\"20201231190222568\",\"modified\":\"20240929170602283\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"For a template to be useful, it should transclude or refer to what?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231190320069\":{\"title\":\"Ta:20201231190320069\",\"answer\":\"Because the current tiddler is set to the template tiddler, but a template tiddler is designed to be rendered with a different current tiddler. The template tiddler likely does not have any of the fields the template was designed to refer to.\",\"created\":\"20201231190323429\",\"modified\":\"20240929170604257\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"Why might a template tiddler display errors when you look at it in the story river?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231190848161\":{\"title\":\"Ta:20201231190848161\",\"answer\":\"The contents of the `$list` widget are rendered once for each output tiddler in the filter, with the current tiddler set to each output tiddler in turn.\",\"created\":\"20201231190849927\",\"modified\":\"20241012230717627\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"How is the current tiddler affected by a `$list` widget (by default, unless you specify otherwise)?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231190945177\":{\"title\":\"Ta:20201231190945177\",\"answer\":\"`{{!!title}}`\",\"created\":\"20201231190946737\",\"modified\":\"20240929170610264\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"What field transclusion is equivalent to the variable reference `<<currentTiddler>>`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231191005319\":{\"title\":\"Ta:20201231191005319\",\"answer\":\"`<<currentTiddler>>`\",\"created\":\"20201231191006419\",\"modified\":\"20240929170620415\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"What variable transclusion is equivalent to the field transclusion `{{!!title}}`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231191056981\":{\"title\":\"Ta:20201231191056981\",\"answer\":\"`variable`\",\"created\":\"20201231191058879\",\"modified\":\"20210409212926985\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"What attribute of the `$list` widget causes it to place the title of the output tiddler being processed in a variable other than `currentTiddler`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231200916212\":{\"title\":\"Ta:20201231200916212\",\"answer\":\"`{{{ [tag[Contact]count[]] }}}`\",\"created\":\"20201231200917522\",\"modified\":\"20240929180958956\",\"origin\":\"Filters and Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to transclude the result of the filter `[tag[Contact]count[]]`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231201207111\":{\"title\":\"Ta:20201231201207111\",\"answer\":\"`{{{ [[LinkBonanza]links[]count[]] }}}`\",\"created\":\"20201231201209935\",\"modified\":\"20240929181000689\",\"origin\":\"Filters and Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Write a filter transclusion to display the number of links to unique tiddlers contained in the tiddler `LinkBonanza`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231201250343\":{\"title\":\"Ta:20201231201250343\",\"answer\":\"The `$text` widget.\",\"created\":\"20201231201251467\",\"modified\":\"20240929181011019\",\"origin\":\"Filters and Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What widget can be used to prevent the result of a filter transclusion from becoming a link?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231201436093\":{\"title\":\"Ta:20201231201436093\",\"answer\":\"`There are <$text text={{{ [count[]] }}}/> non-shadow tiddlers in this wiki.`\",\"created\":\"20201231201437800\",\"modified\":\"20210409220111795\",\"origin\":\"Filters and Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Add a `$text` widget to the following line so the result of the filter isn't a link: `There are {{{ [count[]] }}} non-shadow tiddlers in this wiki.`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231201716263\":{\"title\":\"Ta:20201231201716263\",\"answer\":\"`[parent{!!title}]`\",\"created\":\"20201231201718070\",\"modified\":\"20240929181026525\",\"origin\":\"Filters and Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Write a filter to find all tiddlers whose `parent` field is set to the title of the current tiddler. Use a field transclusion.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231201742553\":{\"title\":\"Ta:20201231201742553\",\"answer\":\"`[parent<currentTiddler>]`\",\"created\":\"20201231201743734\",\"modified\":\"20240929181050757\",\"origin\":\"Filters and Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Write a filter to find all tiddlers whose `parent` field is set to the title of the current tiddler. Use a variable transclusion.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231201927944\":{\"title\":\"Ta:20201231201927944\",\"answer\":\"`<<list-links \\\"myfilter\\\">>`\",\"created\":\"20201231201929127\",\"modified\":\"20240929181115831\",\"origin\":\"Filters and Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What built-in procedure/macro creates a bulleted list of links to tiddlers that match a filter?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231202241809\":{\"title\":\"Ta:20201231202241809\",\"answer\":\"`addsuffix`\",\"created\":\"20201231202243008\",\"modified\":\"20240929181101683\",\"origin\":\"Filters and Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What filter operator adds a string of text to the end of each of its inputs?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20201231202332834\":{\"title\":\"Ta:20201231202332834\",\"answer\":\"`class=\\\"tc-tiddlylink-external\\\"`\",\"created\":\"20201231202335322\",\"modified\":\"20240929181125920\",\"origin\":\"Filters and Transclusions\",\"qtype\":\"rememberq\",\"question\":\"To make an external link created with an `<a>` HTML tag look the same as one created in wikitext, what attribute must you add to the tag?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210101171825776\":{\"title\":\"Ta:20210101171825776\",\"created\":\"20210101171826919\",\"modified\":\"20240929202046719\",\"origin\":\"Wikification\",\"qtype\":\"remembercz\",\"question\":\"Wikification is the process of taking wikitext and turning it into {HTML} for display.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210101171953478\":{\"title\":\"Ta:20210101171953478\",\"answer\":\"Sometimes. If the `{{transclusion}}` is directly within the body of the tiddler, it will be. But if it's used as an attribute of an HTML element or widget, like `<img src={{transclusion}}>`, it won't be.\",\"created\":\"20210101171954389\",\"modified\":\"20240929202048771\",\"origin\":\"Wikification\",\"qtype\":\"rememberq\",\"question\":\"Always/Sometimes/Never: When you put a `{{transclusion}}` somewhere within the body of a tiddler, the wikitext at the other end of the transclusion will be wikified.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210101172047033\":{\"title\":\"Ta:20210101172047033\",\"answer\":\"`<img src=\\\"https://example.com/image.png\\\">` (`img` is a void element, so the tag is not closed)\",\"created\":\"20210101172048478\",\"modified\":\"20240929202104497\",\"origin\":\"Wikification\",\"qtype\":\"rememberq\",\"question\":\"In HTML, how do you display an image that's stored at the URL `https://example.com/image.png`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210101172924122\":{\"title\":\"Ta:20210101172924122\",\"answer\":\"As many times as is required to wikify all wikitext resulting from each wikification step.\",\"created\":\"20210101172925655\",\"modified\":\"20240929202127580\",\"origin\":\"Wikification\",\"qtype\":\"rememberq\",\"question\":\"When a transclusion is included directly in the body of a tiddler, how many times does TiddlyWiki try to wikify it?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210101172937494\":{\"title\":\"Ta:20210101172937494\",\"answer\":\"Exactly once.\",\"created\":\"20210101172939240\",\"modified\":\"20240929202138760\",\"origin\":\"Wikification\",\"qtype\":\"rememberq\",\"question\":\"When a transclusion is used as an HTML or widget attribute, how many times does TiddlyWiki try to wikify it?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210101173259951\":{\"title\":\"Ta:20210101173259951\",\"answer\":\"The `$wikify` widget.\",\"created\":\"20210101173304101\",\"modified\":\"20240929202152576\",\"origin\":\"Wikification\",\"qtype\":\"rememberq\",\"question\":\"What widget can be used to wikify text and store the result in a variable, rather than waiting until it appears directly within the body of a tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210101173413520\":{\"title\":\"Ta:20210101173413520\",\"answer\":\"`<$wikify name=\\\"w\\\" text={{LotsOfWikitext}}> ...use variable here... </$wikify>`<br>(You could also put `{{LotsOfWikitext}}` in quotes. In this case, it has the same effect!)\",\"created\":\"20210101173414869\",\"modified\":\"20240929202154102\",\"origin\":\"Wikification\",\"qtype\":\"rememberq\",\"question\":\"Write a `$wikify` widget call that wikifies the `LotsOfWikitext` tiddler and places the result in a variable called `w`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210101174948555\":{\"title\":\"Ta:20210101174948555\",\"answer\":\"`[[LinkTarget]backlinks[]]`\",\"created\":\"20210101174953282\",\"modified\":\"20210409165601636\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"Write a filter expression that finds all tiddlers that link to the tiddler `LinkTarget`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210101175651214\":{\"title\":\"Ta:20210101175651214\",\"answer\":\"`$(myVariable)​$` (just like in a <code>&#96;substituted attribute value&#96;</code>)\",\"created\":\"20210101175652476\",\"modified\":\"20240929201026356\",\"origin\":\"Macros\",\"qtype\":\"rememberq\",\"question\":\"What is the syntax to text-substitute a variable (not a parameter) called `myVariable` in the definition of a macro?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<!--\\n\\nNote: there is a zero-width space between the ) and the `$`, because otherwise it triggers a real variable substitution somewhere in the bowels of the TiddlyRemember rendering!\\n\\n-->\\n\"},\"Ta:20210101180536591\":{\"title\":\"Ta:20210101180536591\",\"answer\":\"When using parameters, it is more obvious at the point where the macro is called what the macro is doing and what inputs it takes.\",\"created\":\"20210101180538367\",\"modified\":\"20240929200936047\",\"origin\":\"Macros\",\"qtype\":\"rememberq\",\"question\":\"Why is it usually preferable to pass information to macros using parameters rather than defining variables and referring to them within the macro?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210102183959975\":{\"title\":\"Ta:20210102183959975\",\"answer\":\"The tag manager.\",\"created\":\"20210102184001422\",\"modified\":\"20210410175959587\",\"origin\":\"Classifying Tags\",\"qtype\":\"rememberq\",\"question\":\"What TiddlyWiki tool allows you to customize the colors and icons of tags?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210102184138118\":{\"title\":\"Ta:20210102184138118\",\"answer\":\"`[icon[$:/core/images/tag-button]tagging[]]`\",\"created\":\"20210102184139892\",\"modified\":\"20210410180003927\",\"origin\":\"Classifying Tags\",\"qtype\":\"rememberq\",\"question\":\"Write a filter to find all tiddlers tagged with a tag that uses the icon `$:/core/images/tag-button`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103163347118\":{\"title\":\"Ta:20210103163347118\",\"answer\":\"`list`\",\"created\":\"20210103163348597\",\"modified\":\"20210409135643224\",\"origin\":\"Ordering Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What field on each tiddler contains a special tiddler list used to order any tiddlers tagged by that tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103163502135\":{\"title\":\"Ta:20210103163502135\",\"answer\":\"When looking at a tag pill or table of contents for the tiddler T, `B` and `A` will be listed beneath it in that order.\",\"created\":\"20210103163503663\",\"modified\":\"20210409135651143\",\"origin\":\"Ordering Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"If you have a tag tiddler `T` and two tiddlers with that tag `A` and `B`, what is the effect of populating the `list` field of `T` with `B A`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103163854080\":{\"title\":\"Ta:20210103163854080\",\"answer\":\"`list-before` and `list-after`.\",\"created\":\"20210103163855379\",\"modified\":\"20210409135656550\",\"origin\":\"Ordering Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What two fields can you populate on a //tagged// tiddler `A` (rather than a //tagging// tiddler `T`) to influence where `A` comes in the list of `T`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103163935114\":{\"title\":\"Ta:20210103163935114\",\"answer\":\"If you don't want to edit the tiddler containing the list, perhaps because it is a shadow tiddler or belongs to someone else.\",\"created\":\"20210103163936808\",\"modified\":\"20210409135705174\",\"origin\":\"Ordering Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What is the primary reason you would want to use `list-before` and `list-after` rather than directly editing the `list` field of a tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103164048401\":{\"title\":\"Ta:20210103164048401\",\"answer\":\"`A D B C`\",\"created\":\"20210103164050397\",\"modified\":\"20210409135717900\",\"origin\":\"Ordering Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Given a tag tiddler `T` with list `A B C`, and a tiddler `D` also tagged `T` with a `list-before` field set to `B`, what order do the tiddlers tagged by `T` appear in?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103164354611\":{\"title\":\"Ta:20210103164354611\",\"answer\":\"`list-links-draggable`\",\"created\":\"20210103164356273\",\"modified\":\"20210409135720041\",\"origin\":\"Ordering Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What built-in macro allows you to drag and drop tiddlers that appear in a list field of a tiddler to reorder them?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103164623372\":{\"title\":\"Ta:20210103164623372\",\"answer\":\"`<<list-links-draggable \\\"My Tiddler\\\">>`\",\"created\":\"20210103164625111\",\"modified\":\"20241010132053041\",\"origin\":\"Ordering Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Use `list-links-draggable` (a built-in procedure) to allow the `list` field on the `My Tiddler` tiddler to be reordered.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103170007475\":{\"title\":\"Ta:20210103170007475\",\"answer\":\"The value in T's `list` field is ignored and the one in A's `list-before` field is used.\",\"created\":\"20210103170008818\",\"modified\":\"20210409135829116\",\"origin\":\"Ordering Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"How does TiddlyWiki order a tagged tiddler `A` if it is listed in the tag tiddler `T`'s `list` field, but `A` also has a `list-before` field?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103170224509\":{\"title\":\"Ta:20210103170224509\",\"answer\":\"After all tiddlers that have ordering information, in alphabetical order.\",\"created\":\"20210103170225838\",\"modified\":\"20210409135834297\",\"origin\":\"Ordering Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"How does TiddlyWiki order the tagged tiddlers `A` and `B` if they are missing from the `list` field of the tag tiddler `T`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103173543224\":{\"title\":\"Ta:20210103173543224\",\"answer\":\"`tabs`\",\"created\":\"20210103173544313\",\"modified\":\"20240929191339561\",\"origin\":\"Tabs\",\"qtype\":\"rememberq\",\"question\":\"What built-in procedure/macro allows you to create a set of tabs, like those in the sidebar?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103173645450\":{\"title\":\"Ta:20210103173645450\",\"answer\":\"`tabsList`, a filter describing the tiddlers to be used as tabs, and `default`, the title of the tab that is selected by default.\",\"created\":\"20210103173646735\",\"modified\":\"20240929191349567\",\"origin\":\"Tabs\",\"qtype\":\"rememberq\",\"question\":\"What are the names and functions of the first two parameters to `tabs`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103173804424\":{\"title\":\"Ta:20210103173804424\",\"answer\":\"`class:\\\"tc-vertical\\\"`\",\"created\":\"20210103173805655\",\"modified\":\"20240929191405138\",\"origin\":\"Tabs\",\"qtype\":\"rememberq\",\"question\":\"What parameter do you add to `tabs` to show tabs vertically instead of horizontally?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103173848047\":{\"title\":\"Ta:20210103173848047\",\"answer\":\"A tiddler.\",\"created\":\"20210103173849080\",\"modified\":\"20240929191416526\",\"origin\":\"Tabs\",\"qtype\":\"rememberq\",\"question\":\"What TiddlyWiki object populates each tab produced by `tabs`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103174222286\":{\"title\":\"Ta:20210103174222286\",\"answer\":\"`now`\",\"created\":\"20210103174223555\",\"modified\":\"20240929191431193\",\"origin\":\"Tabs\",\"qtype\":\"rememberq\",\"question\":\"What built-in procedure/macro allows you to get today's date?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103174256315\":{\"title\":\"Ta:20210103174256315\",\"answer\":\"Change the current tiddler to the tiddler being rendered as a tab.\",\"created\":\"20210103174257618\",\"modified\":\"20240929191438995\",\"origin\":\"Tabs\",\"qtype\":\"rememberq\",\"question\":\"When rendering each tab in a `tabs` call, what does TiddlyWiki unexpectedly //not// do?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103174333268\":{\"title\":\"Ta:20210103174333268\",\"answer\":\"`currentTab`\",\"created\":\"20210103174335087\",\"modified\":\"20240929191449956\",\"origin\":\"Tabs\",\"qtype\":\"rememberq\",\"question\":\"When rendering each tab in a `tabs` call, what variable contains the title of the tiddler being rendered?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103174719170\":{\"title\":\"Ta:20210103174719170\",\"answer\":\"Drag and drop it onto the browser window.\",\"created\":\"20210103174720050\",\"modified\":\"20240929190408141\",\"origin\":\"Images and Attachments\",\"qtype\":\"rememberq\",\"question\":\"What is the fastest way to import an image into your TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103174822368\":{\"title\":\"Ta:20210103174822368\",\"answer\":\"Transclude the image tiddler, like `{{image.png}}`.\",\"created\":\"20210103174824402\",\"modified\":\"20240929190409451\",\"origin\":\"Images and Attachments\",\"qtype\":\"rememberq\",\"question\":\"How can you quickly display an image that is part of your wiki within another tiddler if you don't need to adjust its size or other parameters?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103174916873\":{\"title\":\"Ta:20210103174916873\",\"answer\":\"`[img width=350 [image.png]]`\",\"created\":\"20210103174918105\",\"modified\":\"20210410185218452\",\"origin\":\"Images and Attachments\",\"qtype\":\"rememberq\",\"question\":\"What wikitext syntax would you use to display an image stored in the tiddler `image.png`, with a maximum width of 350 pixels?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103175005436\":{\"title\":\"Ta:20210103175005436\",\"answer\":\"Import the PDF into its own tiddler, then transclude that tiddler.\",\"created\":\"20210103175007009\",\"modified\":\"20210410185220397\",\"origin\":\"Images and Attachments\",\"qtype\":\"rememberq\",\"question\":\"How can you display a PDF within another tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103175033563\":{\"title\":\"Ta:20210103175033563\",\"answer\":\"It inflates the size of the file, causing backups to waste space and performance to slow down.\",\"created\":\"20210103175036531\",\"modified\":\"20210418131746732\",\"origin\":\"Images and Attachments\",\"qtype\":\"rememberq\",\"question\":\"Why is including too many images or other attachments in a single-file TiddlyWiki problematic?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103175124781\":{\"title\":\"Ta:20210103175124781\",\"answer\":\"Any that uses a folder wiki (one hosted on a Node.js webserver, where each tiddler is in a separate file).\",\"created\":\"20210103175125766\",\"modified\":\"20240929190418429\",\"origin\":\"Images and Attachments\",\"qtype\":\"rememberq\",\"question\":\"What method of hosting a TiddlyWiki does not suffer issues when many images are added to the wiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103175243272\":{\"title\":\"Ta:20210103175243272\",\"answer\":\"`[img [https://example.com/image.png]]`\",\"created\":\"20210103175244683\",\"modified\":\"20210410185254067\",\"origin\":\"Images and Attachments\",\"qtype\":\"rememberq\",\"question\":\"What wikitext syntax would you use to display an image hosted on the web at `https://example.com/image.png` within a tiddler in your wiki? (Do not make the image itself a tiddler in your wiki.)\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103175352198\":{\"title\":\"Ta:20210103175352198\",\"answer\":\"`[img [attachments/image.png]]`\",\"created\":\"20210103175354872\",\"modified\":\"20210410185300133\",\"origin\":\"Images and Attachments\",\"qtype\":\"rememberq\",\"question\":\"If you have a folder on your computer called `attachments` located in the same folder as your TiddlyWiki file, what wikitext syntax do you use to display the `image.png` image in that folder in a tiddler? (Do not make the image a tiddler in your wiki.)\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103175527476\":{\"title\":\"Ta:20210103175527476\",\"created\":\"20210103175528640\",\"modified\":\"20240929190427782\",\"origin\":\"Images and Attachments\",\"qtype\":\"remembercz\",\"question\":\"You can store a tiddler's content (such as an image) in a file outside your TiddlyWiki by setting the tiddler's {`_canonical_uri`} field to the path to that file.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103175644610\":{\"title\":\"Ta:20210103175644610\",\"answer\":\"The MIME type (//Type// dropdown) on the tiddler must be set to the correct file type.\",\"created\":\"20210103175645373\",\"modified\":\"20210410185304991\",\"origin\":\"Images and Attachments\",\"qtype\":\"rememberq\",\"question\":\"If you create a new tiddler using the `_canonical_uri` field and the content doesn't appear when you save the tiddler, but you're sure the path to the file is correct, what did you likely forget?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103175938846\":{\"title\":\"Ta:20210103175938846\",\"answer\":\"Store the images/files in a folder outside of the wiki and reference them from within the wiki.\",\"created\":\"20210103175940169\",\"modified\":\"20210418131836696\",\"origin\":\"Images and Attachments\",\"qtype\":\"rememberq\",\"question\":\"If you need to attach many images or other files to your single-file wiki, what approach should you take to avoid your wiki becoming too large?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103183826775\":{\"title\":\"Ta:20210103183826775\",\"answer\":\"\",\"created\":\"20210103183828819\",\"modified\":\"20240929200538886\",\"origin\":\"Data Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"A {data} tiddler is one that stores a number of key-value pairs.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103183848688\":{\"title\":\"Ta:20210103183848688\",\"answer\":\"TiddlyWiki's built-in “dictionary” format, or JSON.\",\"created\":\"20210103183849899\",\"modified\":\"20240929200539975\",\"origin\":\"Data Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Data tiddlers can be in what two formats?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103184048411\":{\"title\":\"Ta:20210103184048411\",\"answer\":\"E.g., the dates and names of events, the mappings for a letter substitution cipher, metadata about a wiki that needs to be editable by an external process\",\"created\":\"20210103184050547\",\"modified\":\"20240929200540916\",\"origin\":\"Data Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Give an example of something you might choose to store in a data tiddler (try to pick a new one).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103184206621\":{\"title\":\"Ta:20210103184206621\",\"created\":\"20210103184207725\",\"modified\":\"20240929200542225\",\"origin\":\"Data Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"A data tiddler's text field contains one or more {properties} (term for each item).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103184214736\":{\"title\":\"Ta:20210103184214736\",\"created\":\"20210103184215515\",\"modified\":\"20240929200543443\",\"origin\":\"Data Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"In a data tiddler, the key by which the value of a property is retrieved is called a/n {index}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103184314406\":{\"title\":\"Ta:20210103184314406\",\"answer\":\"`k: v` (on a separate line)\",\"created\":\"20210103184316716\",\"modified\":\"20240929200544386\",\"origin\":\"Data Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"In a data tiddler formatted as a dictionary, how would you write the key-value pair where `k` was the key and `v` was the value?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103184418750\":{\"title\":\"Ta:20210103184418750\",\"answer\":\"They can only contain a single level of key-value pairs – no nested arrays or objects.\",\"created\":\"20210103184419927\",\"modified\":\"20240929200545936\",\"origin\":\"Data Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What limitation is placed on JSON documents being used as data tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103184459909\":{\"title\":\"Ta:20210103184459909\",\"answer\":\"Set its //Type// to `application/x-tiddler-dictionary`.\",\"created\":\"20210103184501081\",\"leechignores\":\"1\",\"modified\":\"20240929200551616\",\"origin\":\"Data Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"How do you mark a tiddler as a data tiddler of the TiddlyWiki dictionary type?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103184557434\":{\"title\":\"Ta:20210103184557434\",\"answer\":\"`{{DataStore##X}}`\",\"created\":\"20210103184600258\",\"modified\":\"20240929200553655\",\"origin\":\"Data Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to transclude the value at index `X` from a data tiddler `DataStore`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103184640882\":{\"title\":\"Ta:20210103184640882\",\"answer\":\"`getindex`\",\"created\":\"20210103184642288\",\"modified\":\"20240929200555895\",\"origin\":\"Data Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What filter operator retrieves the value at a given index from its input data tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103184741717\":{\"title\":\"Ta:20210103184741717\",\"answer\":\"You probably want to store multiple pieces of information about each contact, and a data tiddler can only store one value per index.\",\"created\":\"20210103184743122\",\"modified\":\"20240929200603116\",\"origin\":\"Data Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Why are data tiddlers likely a poor choice for storing the email addresses of contacts?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103190602884\":{\"title\":\"Ta:20210103190602884\",\"created\":\"20210103190604113\",\"modified\":\"20240929204950704\",\"origin\":\"System Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"The entire interface of TiddlyWiki is built by {transcluding} a series of special tiddlers.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103190641443\":{\"title\":\"Ta:20210103190641443\",\"answer\":\"Its name begins with `$:/`.\",\"created\":\"20210103190642844\",\"modified\":\"20240929204950037\",\"origin\":\"System Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"A tiddler is said to be a //system tiddler// if what is true about it?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103190907688\":{\"title\":\"Ta:20210103190907688\",\"answer\":\"The //Explorer// section of the //More// tab.\",\"created\":\"20210103190910950\",\"modified\":\"20241013004956817\",\"origin\":\"System Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What section of the sidebar is usually the best way to browse for system tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103191403629\":{\"title\":\"Ta:20210103191403629\",\"answer\":\"The search bar and the //All// section.\",\"created\":\"20210103191405268\",\"modified\":\"20241013005025847\",\"origin\":\"System Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"From which of the following places are system tiddlers hidden by default? Select all that apply.<br>The //Explorer// section of the //More// sidebar tab; the standard search bar; filters; the //All// section of the //More// sidebar tab\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103191646606\":{\"title\":\"Ta:20210103191646606\",\"created\":\"20210103191648125\",\"modified\":\"20240929204958852\",\"origin\":\"Plugins\",\"qtype\":\"remembercz\",\"question\":\"A plugin is a single tiddler that contains multiple {shadow} tiddlers (TiddlyWiki term for a type of tiddler).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103191737048\":{\"title\":\"Ta:20210103191737048\",\"answer\":\"Drag and drop a link to the plugin tiddler from the plugin's demo/documentation wiki into your wiki.\",\"created\":\"20210103191740220\",\"modified\":\"20240929204959933\",\"origin\":\"Plugins\",\"qtype\":\"rememberq\",\"question\":\"What is the most common way to install a plugin in TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103191824456\":{\"title\":\"Ta:20210103191824456\",\"created\":\"20210103191825626\",\"modified\":\"20240929205001436\",\"origin\":\"Plugins\",\"qtype\":\"remembercz\",\"question\":\"Plugins, since they are typically used to add functionality to TiddlyWiki, usually contain primarily {system} tiddlers (TiddlyWiki term for a type of tiddler).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103191957794\":{\"title\":\"Ta:20210103191957794\",\"answer\":\"In the ''Plugins'' section of the ''More'' sidebar tab.\",\"created\":\"20210103191959273\",\"modified\":\"20240929205002581\",\"origin\":\"Plugins\",\"qtype\":\"rememberq\",\"question\":\"Where can you find a list of all plugins in your wiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210103192035897\":{\"title\":\"Ta:20210103192035897\",\"answer\":\"A plugin tiddler (`$:/core`, specifically).\",\"created\":\"20210103192037268\",\"modified\":\"20240929205003206\",\"origin\":\"Plugins\",\"qtype\":\"rememberq\",\"question\":\"TiddlyWiki's core code is contained in what type of single tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107013945419\":{\"title\":\"Ta:20210107013945419\",\"answer\":\"Shadow tiddlers are parts of their plugin tiddler, rather than truly separate tiddlers.\",\"created\":\"20210107013949322\",\"modified\":\"20210418134031544\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"How does TiddlyWiki's method of storing shadow tiddlers differ from its method of storing normal tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107014030925\":{\"title\":\"Ta:20210107014030925\",\"answer\":\"If another, normal, tiddler has the same name as the shadow tiddler.\",\"created\":\"20210107014032565\",\"modified\":\"20210418134034916\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"In what circumstances will a shadow tiddler provided by a plugin be ignored?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107014105988\":{\"title\":\"Ta:20210107014105988\",\"created\":\"20210107014106947\",\"modified\":\"20210418134037448\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"remembercz\",\"question\":\"When a shadow tiddler is ignored because a normal tiddler by the same name also exists in the wiki, the shadow tiddler is said to be {overridden}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107014146889\":{\"title\":\"Ta:20210107014146889\",\"answer\":\"TiddlyWiki will go back to using the shadow tiddler when a tiddler by that name is referenced.\",\"created\":\"20210107014148939\",\"modified\":\"20210418134041794\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What happens if you delete a tiddler that is overriding a shadow tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107014315547\":{\"title\":\"Ta:20210107014315547\",\"answer\":\"In the preview dropdown on the editor toolbar, you can select “differences from shadow.”\",\"created\":\"20210107014316562\",\"modified\":\"20241013004925319\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Where in a tiddler's interface can you look to see what differences it has to its corresponding shadow tiddler (if it has one)?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107014412226\":{\"title\":\"Ta:20210107014412226\",\"answer\":\"Taking upgrades to TiddlyWiki or your plugins.\",\"created\":\"20210107014413768\",\"modified\":\"20210418134059363\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What kind of wiki maintenance becomes more challenging when you have many overridden shadow tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107014504752\":{\"title\":\"Ta:20210107014504752\",\"answer\":\"Changing one of the settings overrides a shadow tiddler that contains the default value.\",\"created\":\"20210107014509330\",\"modified\":\"20210418134103200\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What mechanism does TiddlyWiki use to back most of the settings in the Control Panel, making it easy to restore the original settings if needed?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107014637538\":{\"title\":\"Ta:20210107014637538\",\"answer\":\"If the plugin updated the tiddler you overrode, it may be relying on changes to that tiddler -- but the updates won't be visible in your wiki, since your version is unchanged and blocks the shadow tiddler from being referenced.\",\"created\":\"20210107014642356\",\"modified\":\"20210418134204077\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Why can upgrading a plugin that contains a shadow tiddler you have overridden cause problems with your wiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107014737658\":{\"title\":\"Ta:20210107014737658\",\"answer\":\"They are displayed in bold font.\",\"created\":\"20210107014738844\",\"modified\":\"20241013004940684\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"In many TiddlyWiki views, such as the //Explorer// section of the //More// tab of the sidebar, how can you distinguish shadow tiddlers that have not been overridden from normal tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107014811997\":{\"title\":\"Ta:20210107014811997\",\"answer\":\"`[is[shadow]]`\",\"created\":\"20210107014813588\",\"modified\":\"20210418134219356\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What filter expression will display only shadow tiddlers that you have overridden?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107014848744\":{\"title\":\"Ta:20210107014848744\",\"answer\":\"`all[tiddlers+shadows]`\",\"created\":\"20210107014850336\",\"modified\":\"20210418134225094\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What filter constructor retrieves all shadow and non-shadow tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107014935575\":{\"title\":\"Ta:20210107014935575\",\"answer\":\"`[is[shadow]]` selects //overridden// shadow tiddlers (because its implied input is `all[tiddlers]`, which doesn't include non-overridden shadow tiddlers); `[all[shadows]]` selects all shadow tiddlers, whether overridden or not.\",\"created\":\"20210107015005532\",\"modified\":\"20240612034602261\",\"origin\":\"Shadow Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Explain the difference between the behavior of the `[is[shadow]]` and `[all[shadows]]` filter runs.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107015136701\":{\"title\":\"Ta:20210107015136701\",\"answer\":\"The `$:/tags/Global` tag.\",\"created\":\"20210107015140343\",\"modified\":\"20241001125039015\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"A //global// procedure is one that is in a tiddler with what property?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107015423886\":{\"title\":\"Ta:20210107015423886\",\"answer\":\"Use a pragma `\\\\import [prefix[W]]`.\",\"created\":\"20210107015425774\",\"modified\":\"20241001125251835\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"How would you load procedures found in all tiddlers that begin with the letter `W` into the context of the current tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107015521319\":{\"title\":\"Ta:20210107015521319\",\"answer\":\"E.g., automatically generate URLs matching a pattern, display some boilerplate text, perform a series of actions using action widgets\",\"created\":\"20210107015530781\",\"modified\":\"20241001125101482\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"Give an example of something you might define a global procedure to do (try to pick a new one).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107015740839\":{\"title\":\"Ta:20210107015740839\",\"created\":\"20210107015742014\",\"modified\":\"20240929205155334\",\"origin\":\"The View Template\",\"qtype\":\"remembercz\",\"question\":\"Every time TiddlyWiki displays a tiddler in the story river, it uses a {template} (TiddlyWiki concept) to determine what the tiddler should look like.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107015900784\":{\"title\":\"Ta:20210107015900784\",\"answer\":\"Anytime it is displaying a tiddler in the story river (and that tiddler isn't being edited).\",\"created\":\"20210107015902944\",\"modified\":\"20240929205154741\",\"origin\":\"The View Template\",\"qtype\":\"rememberq\",\"question\":\"Explain when TiddlyWiki uses the //view template//.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107020034725\":{\"title\":\"Ta:20210107020034725\",\"answer\":\"It transcludes all tiddlers that have the `$:/tags/ViewTemplate` tag in order, so that users only have to tag a template tiddler with this tag to include it in the view template.\",\"created\":\"20210107020036261\",\"modified\":\"20240929205153799\",\"origin\":\"The View Template\",\"qtype\":\"rememberq\",\"question\":\"What mechanism does TiddlyWiki's view template use to enable users to easily add additional components?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107020452964\":{\"title\":\"Ta:20210107020452964\",\"answer\":\"Add a transclusion of that template to the view template.\",\"created\":\"20210107020454241\",\"modified\":\"20241013005101448\",\"origin\":\"The View Template\",\"qtype\":\"rememberq\",\"question\":\"What mechanism would you likely use to display some template on all tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107020640926\":{\"title\":\"Ta:20210107020640926\",\"answer\":\"Use the HTML equivalent, `<h2>Section Name</h2>`. (Change the `2` to match the number of exclamation points.)\",\"created\":\"20210107020642128\",\"modified\":\"20240929205159597\",\"origin\":\"The View Template\",\"qtype\":\"rememberq\",\"question\":\"When creating a template, how can you change the markup `!! Section Name` to ensure that `Section Name` will never merge into a paragraph rather than creating a section heading?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107020846577\":{\"title\":\"Ta:20210107020846577\",\"answer\":\"The EditTemplate (`$:/core/ui/EditTemplate`)\",\"created\":\"20210107020851974\",\"modified\":\"20240929205200826\",\"origin\":\"The View Template\",\"qtype\":\"rememberq\",\"question\":\"What built-in TiddlyWiki template controls what appears when you edit a tiddler in the story river?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107184432126\":{\"title\":\"Ta:20210107184432126\",\"answer\":\"Tag it with `$:/tags/SideBar`.\",\"created\":\"20210107184434037\",\"modified\":\"20240929205217647\",\"origin\":\"Adding to the Sidebar\",\"qtype\":\"rememberq\",\"question\":\"How do you get a tiddler to appear as a tab in the sidebar?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107184506733\":{\"title\":\"Ta:20210107184506733\",\"answer\":\"When the tiddler is being rendered as part of the sidebar.\",\"created\":\"20210107184507891\",\"modified\":\"20210418141629203\",\"origin\":\"Adding to the Sidebar\",\"qtype\":\"rememberq\",\"question\":\"In what common context is the `currentTiddler` variable not defined at all?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107184538769\":{\"title\":\"Ta:20210107184538769\",\"answer\":\"`caption`\",\"created\":\"20210107184540021\",\"modified\":\"20210418141631978\",\"origin\":\"Adding to the Sidebar\",\"qtype\":\"rememberq\",\"question\":\"What field of a tiddler do you set to change the wording displayed on a tab rendered with the `tabs` macro?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107184624314\":{\"title\":\"Ta:20210107184624314\",\"answer\":\"`$:/tags/TextEditor/Snippet`\",\"created\":\"20210107184625332\",\"modified\":\"20210418141928034\",\"origin\":\"Stamps\",\"qtype\":\"rememberq\",\"question\":\"What tag do you add to a tiddler to make it available for insertion as a stamp?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107184722320\":{\"title\":\"Ta:20210107184722320\",\"answer\":\"To insert some predefined text into a tiddler that can't be effectively implemented as a transclusion.\",\"created\":\"20210107184727378\",\"modified\":\"20241010132136804\",\"origin\":\"Stamps\",\"qtype\":\"rememberq\",\"question\":\"What is the purpose of a //stamp//?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107184853444\":{\"title\":\"Ta:20210107184853444\",\"answer\":\"`[all[current]backlinks[]]`\",\"created\":\"20210107184854784\",\"modified\":\"20240929205248960\",\"origin\":\"Creating a List of Links and Backlinks\",\"qtype\":\"rememberq\",\"question\":\"Write a filter expression that displays the backlinks of the current tiddler. Do not use any field or variable transclusions.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107185221794\":{\"title\":\"Ta:20210107185221794\",\"answer\":\"`[{!!description}split[]first[100]join[]]`\",\"created\":\"20210107185224741\",\"modified\":\"20240929205254467\",\"origin\":\"Creating a List of Links and Backlinks\",\"qtype\":\"rememberq\",\"question\":\"Write a filter expression that outputs the first 100 characters of the wikitext in the `description` field of the current tiddler as a single output tiddler.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107185257971\":{\"title\":\"Ta:20210107185257971\",\"answer\":\"The `<div>` element.\",\"created\":\"20210107185259131\",\"modified\":\"20240929205255921\",\"origin\":\"Creating a List of Links and Backlinks\",\"qtype\":\"rememberq\",\"question\":\"What HTML element is used for a generic grouping of elements?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107185358615\":{\"title\":\"Ta:20210107185358615\",\"answer\":\"Cascading Style Sheets.\",\"created\":\"20210107185359638\",\"modified\":\"20240929205257164\",\"origin\":\"Creating a List of Links and Backlinks\",\"qtype\":\"rememberq\",\"question\":\"What does //CSS// stand for?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107185422937\":{\"title\":\"Ta:20210107185422937\",\"answer\":\"Its layout and formatting.\",\"created\":\"20210107185425728\",\"modified\":\"20240929205258984\",\"origin\":\"Creating a List of Links and Backlinks\",\"qtype\":\"rememberq\",\"question\":\"What aspect of a website is CSS responsible for controlling?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107185522336\":{\"title\":\"Ta:20210107185522336\",\"answer\":\"This ensures that you don't accidentally choose the same generic-sounding name (e.g., `item`) as some other plugin or TiddlyWiki's core.\",\"created\":\"20210107185524925\",\"modified\":\"20240929205300389\",\"origin\":\"Creating a List of Links and Backlinks\",\"qtype\":\"rememberq\",\"question\":\"In TiddlyWiki, why is it a good idea to prefix your CSS class names with your initials or some similar prefix?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107185757110\":{\"title\":\"Ta:20210107185757110\",\"answer\":\"Place the fallback text/widgets within the body of a `$transclude` widget that attempts the transclusion.\",\"created\":\"20210107185759185\",\"modified\":\"20240929205302233\",\"origin\":\"Creating a List of Links and Backlinks\",\"qtype\":\"rememberq\",\"question\":\"How can you easily display some text or widgets only if a specific tiddler cannot be transcluded (e.g., because it does not exist)?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107190031549\":{\"title\":\"Ta:20210107190031549\",\"answer\":\"A text reference.\",\"created\":\"20210107190032961\",\"modified\":\"20240929205403350\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"In the transclusion `{{MyTiddler!!myfield}}`, the part `MyTiddler!!myfield` is called what?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107190124407\":{\"title\":\"Ta:20210107190124407\",\"answer\":\"\",\"created\":\"20210107190128053\",\"modified\":\"20240929205403967\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"remembercz\",\"question\":\"A text reference uses the same syntax as a {field transclusion}, but without the outer curly braces.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107231203818\":{\"title\":\"Ta:20210107231203818\",\"answer\":\"The `$button` widget.\",\"created\":\"20210107231205603\",\"modified\":\"20240929205405185\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What widget is used to create a button?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107231453085\":{\"title\":\"Ta:20210107231453085\",\"answer\":\"`set` and `setTo`.\",\"created\":\"20210107231454259\",\"modified\":\"20240929205406763\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What two attributes of the `$button` widget do you use to make the button set a tiddler field to a value?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107231706966\":{\"title\":\"Ta:20210107231706966\",\"answer\":\"Their names begin with `$:/temp/`.\",\"created\":\"20210107231708431\",\"modified\":\"20240929205407769\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"Temporary tiddlers typically use what naming convention?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107231758177\":{\"title\":\"Ta:20210107231758177\",\"answer\":\"They are not saved, so they disappear when the wiki is closed and reopened.\",\"created\":\"20210107231759222\",\"modified\":\"20240929205409124\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What special behavior do tiddlers whose names begin with `$:/temp` have?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107231830085\":{\"title\":\"Ta:20210107231830085\",\"answer\":\"In a temporary tiddler.\",\"created\":\"20210107231831133\",\"modified\":\"20240929205410399\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"Even core UI elements like the search box store their contents where?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107231904601\":{\"title\":\"Ta:20210107231904601\",\"answer\":\"The `$edit-text` widget.\",\"created\":\"20210107231905951\",\"modified\":\"20240929205411774\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What widget is used to create a text box?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107231924180\":{\"title\":\"Ta:20210107231924180\",\"answer\":\"`tag=\\\"input\\\"`\",\"created\":\"20210107231925433\",\"modified\":\"20240929205413651\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What attribute and value passed to the `$edit-text` widget causes it to accept only a single line of text?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107231955280\":{\"title\":\"Ta:20210107231955280\",\"answer\":\"`tiddler`\",\"created\":\"20210107231956593\",\"modified\":\"20240929205414934\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What attribute of the `$edit-text` widget allows you to choose what tiddler the text box edits?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107232026427\":{\"title\":\"Ta:20210107232026427\",\"answer\":\"`class=\\\"tc-btn-invisible tc-tiddlylink\\\"`\",\"created\":\"20210107232027815\",\"modified\":\"20240929205416185\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What attribute can you add to the `$button` widget to make the button appear like a link?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107232300907\":{\"title\":\"Ta:20210107232300907\",\"answer\":\"`field`\",\"created\":\"20210107232302200\",\"modified\":\"20240929205418224\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What attribute of the `$edit-text` widget allows you to choose what tiddler field the text box edits?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107232346817\":{\"title\":\"Ta:20210107232346817\",\"answer\":\"All widgets displayed on the screen are told what tiddler has changed and invited to refresh themselves if they believe they are affected by that change.\",\"created\":\"20210107232350696\",\"modified\":\"20240929205419458\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"Explain the process TiddlyWiki uses to ensure the screen is up to date after a tiddler is changed.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107232428492\":{\"title\":\"Ta:20210107232428492\",\"answer\":\"`to`\",\"created\":\"20210107232429635\",\"modified\":\"20240929205423432\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What attribute of the `$button` widget allows you to make the button open and navigate to a specific tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107232510188\":{\"title\":\"Ta:20210107232510188\",\"answer\":\"`<table>`\",\"created\":\"20210107232511082\",\"modified\":\"20240929205424471\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What HTML element creates a table?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107232532110\":{\"title\":\"Ta:20210107232532110\",\"answer\":\"`<tr>` (//table row//)\",\"created\":\"20210107232533466\",\"modified\":\"20210418160904076\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What HTML element creates a row when used within a `<table>` element?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107232556365\":{\"title\":\"Ta:20210107232556365\",\"answer\":\"`<td>` (//table data//)\",\"created\":\"20210107232600707\",\"modified\":\"20210418160905902\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What HTML element creates a table cell when used within a `<tr>` element?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107232635219\":{\"title\":\"Ta:20210107232635219\",\"answer\":\"`<th>` (//table header//)\",\"created\":\"20210107232636637\",\"modified\":\"20210418160908411\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What HTML element creates a table header cell when used within a `<tr>` element?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107232708814\":{\"title\":\"Ta:20210107232708814\",\"answer\":\"`<table>`, `<tr>`, `<td>`, and `<th>`.\",\"created\":\"20210107232710161\",\"modified\":\"20210418160910734\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"What four basic HTML elements are used to construct tables?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107232923263\":{\"title\":\"Ta:20210107232923263\",\"answer\":\"`<$button to={{Linky!!target}}>Linky Target</$button>`\",\"created\":\"20210107232926736\",\"modified\":\"20240929205428248\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"Write wikitext to display a button that takes the user to the tiddler referenced in the `target` field of the `Linky` tiddler when clicked. The button text should be “Linky Target”.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107233329839\":{\"title\":\"Ta:20210107233329839\",\"answer\":\"`<$button set=\\\"!!target\\\" setTo={{$:/temp/NewTarget}}>Reset Target</$button>`\",\"created\":\"20210107233332947\",\"modified\":\"20240929205430960\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"Write wikitext to display a button that sets the `target` field of the current tiddler to the value currently stored in the `text` field of the `$:/temp/NewTarget` tiddler. The button text should be \\\"Reset Target\\\".\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107233516001\":{\"title\":\"Ta:20210107233516001\",\"answer\":\"`<$edit-text tag=\\\"input\\\" tiddler=<<describedTiddler>> field=\\\"description\\\"/>`\",\"created\":\"20210107233530534\",\"modified\":\"20240929205432936\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"rememberq\",\"question\":\"Write wikitext to display a single-line textbox which is bound to the `description` field of the tiddler whose name is stored in the `describedTiddler` variable.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210107233831498\":{\"title\":\"Ta:20210107233831498\",\"answer\":\"\",\"created\":\"20210107233835374\",\"modified\":\"20240929205436560\",\"origin\":\"Buttons and Input Widgets\",\"qtype\":\"remembercz\",\"question\":\"When a text box is allowing the user to edit the value of a specific tiddler field, we say that the text box is {bound} to the field.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109213545035\":{\"title\":\"Ta:20210109213545035\",\"answer\":\"\",\"created\":\"20210109213546170\",\"modified\":\"20240929205505018\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"remembercz\",\"question\":\"When you trigger a message, any widgets that are {higher up the widget tree} from the action are given the opportunity to respond to the message.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109213621592\":{\"title\":\"Ta:20210109213621592\",\"answer\":\"`tm-new-tiddler`\",\"created\":\"20210109213622593\",\"modified\":\"20240929205505992\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"What message creates a new tiddler and opens it for editing in the story river?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109214205308\":{\"title\":\"Ta:20210109214205308\",\"answer\":\"An action widget.\",\"created\":\"20210109214206247\",\"modified\":\"20240929205506870\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"What kind of widget makes something happen in the wiki, rather than displaying something?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109214221733\":{\"title\":\"Ta:20210109214221733\",\"answer\":\"Its name begins with `$action-`.\",\"created\":\"20210109214223269\",\"modified\":\"20240929205508268\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"How can you tell that a particular widget is an action widget?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109214237296\":{\"title\":\"Ta:20210109214237296\",\"answer\":\"`$action-sendmessage`\",\"created\":\"20210109214238419\",\"modified\":\"20240929205509120\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"What action widget creates a message?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109214259585\":{\"title\":\"Ta:20210109214259585\",\"answer\":\"The `$button` widget.\",\"created\":\"20210109214300417\",\"modified\":\"20240929205510160\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"Action widgets are most commonly triggered by what other widget?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109214406987\":{\"title\":\"Ta:20210109214406987\",\"answer\":\"The widget will never do anything at all.\",\"created\":\"20210109214410344\",\"modified\":\"20240929205512459\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"What happens if you put an action widget in a tiddler by itself, rather than within a triggering widget?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109214506860\":{\"title\":\"Ta:20210109214506860\",\"answer\":\"`actions`\",\"created\":\"20210109214508545\",\"modified\":\"20240929205513791\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"What attribute of a `$button` widget do you use to specify action widgets that it can trigger?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109214553628\":{\"title\":\"Ta:20210109214553628\",\"answer\":\"`<$button actions=<<myactions>>>Act</$button>`\",\"created\":\"20210109214554641\",\"modified\":\"20240929205531430\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"Given a procedure called `myactions` with no parameters that generates some action widgets, write wikitext for a button labeled //Act// that triggers those action widgets.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109214712041\":{\"title\":\"Ta:20210109214712041\",\"answer\":\"It performs each action in the order it is shown in the wikitext.\",\"created\":\"20210109214714279\",\"modified\":\"20240929205538998\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"How does TiddlyWiki deal with multiple action widgets associated with the same button?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109214837731\":{\"title\":\"Ta:20210109214837731\",\"answer\":\"`<$action-sendmessage $message=\\\"tm-new-tiddler\\\" title=NewT tags={{!!tags}}/>`\",\"created\":\"20210109214850266\",\"modified\":\"20240929205540248\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"Write wikitext for an `$action-sendmessage` widget that creates a new tiddler called `NewT` tagged with the same tags as the current tiddler and opens it for editing.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109214942680\":{\"title\":\"Ta:20210109214942680\",\"answer\":\"A series of arbitrary fields and values (so an attribute `foo=bar` would set the field `foo` to `bar` in the new tiddler).\",\"created\":\"20210109214944092\",\"modified\":\"20240929205544952\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"What parameters does the `tm-new-tiddler` message accept?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109215136556\":{\"title\":\"Ta:20210109215136556\",\"answer\":\"`$:/tags/PageControls`\",\"created\":\"20210109215137894\",\"modified\":\"20240929205550419\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"What tag causes a button to appear in the page toolbar?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109221827610\":{\"title\":\"Ta:20210109221827610\",\"answer\":\"`$:/config/PageControlButtons/Visibility/MyButton`\",\"created\":\"20210109221829400\",\"modified\":\"20240929205551857\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"If a tiddler called `MyButton` is part of the page controls, what tiddler controls whether it is visible above the search box?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109221946679\":{\"title\":\"Ta:20210109221946679\",\"answer\":\"Add a `tooltip` attribute to the `$button` widget.\",\"created\":\"20210109221947919\",\"modified\":\"20240929205553035\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"How do you add a tooltip to a button?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109222018175\":{\"title\":\"Ta:20210109222018175\",\"answer\":\"In the tag manager (pretend to select an icon for a tag).\",\"created\":\"20210109222019965\",\"modified\":\"20240929205554359\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"Where in TiddlyWiki can you quickly find a list of the default icons?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109225040407\":{\"title\":\"Ta:20210109225040407\",\"created\":\"20210109225041456\",\"modified\":\"20210502163005576\",\"origin\":\"JavaScript Macros\",\"qtype\":\"remembercz\",\"question\":\"A JavaScript macro should not have any {side effect}s when run.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109225118013\":{\"title\":\"Ta:20210109225118013\",\"answer\":\"TiddlyWiki may decide to rerun the macro at any time if the tiddler or element containing it needs to be refreshed.\",\"created\":\"20210109225119121\",\"modified\":\"20210502163007403\",\"origin\":\"JavaScript Macros\",\"qtype\":\"rememberq\",\"question\":\"Why are side effects in JavaScript macros dangerous?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109225153106\":{\"title\":\"Ta:20210109225153106\",\"answer\":\"Those making up the browser DOM.\",\"created\":\"20210109225223042\",\"modified\":\"20210502163011016\",\"origin\":\"JavaScript Macros\",\"qtype\":\"rememberq\",\"question\":\"JavaScript macros are unable to access what objects?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109225316323\":{\"title\":\"Ta:20210109225316323\",\"answer\":\"The type (set to `application/javascript`) and the `module-type` field (set to `macro`).\",\"created\":\"20210109225318236\",\"modified\":\"20210502163014502\",\"origin\":\"JavaScript Macros\",\"qtype\":\"rememberq\",\"question\":\"What two fields must you set on a tiddler containing a JavaScript macro to make it visible to TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109225359535\":{\"title\":\"Ta:20210109225359535\",\"answer\":\"You must save and reload the wiki for JavaScript changes to take effect.\",\"created\":\"20210109225400637\",\"modified\":\"20210502163016382\",\"origin\":\"JavaScript Macros\",\"qtype\":\"rememberq\",\"question\":\"If you change a JavaScript macro and the changes do not seem to be applying, what did you most likely forget?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109225449170\":{\"title\":\"Ta:20210109225449170\",\"answer\":\"Save and reload the wiki.\",\"created\":\"20210109225450191\",\"modified\":\"20210502163018214\",\"origin\":\"JavaScript Macros\",\"qtype\":\"rememberq\",\"question\":\"What must you do after adding or editing a JavaScript macro for the changes to take effect?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109225556485\":{\"title\":\"Ta:20210109225556485\",\"created\":\"20210109225557968\",\"modified\":\"20210502163242181\",\"origin\":\"Stylesheets\",\"qtype\":\"remembercz\",\"question\":\"Inline stylesheets are not {scoped to} the tiddler containing them.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109225643059\":{\"title\":\"Ta:20210109225643059\",\"answer\":\"Inline stylesheets within a tiddler are not scoped to that tiddler, so custom classes prevent the styles from accidentally applying to other tiddlers.\",\"created\":\"20210109225644650\",\"modified\":\"20210502163245714\",\"origin\":\"Stylesheets\",\"qtype\":\"rememberq\",\"question\":\"Why should you (almost) always use a class name with any CSS that you intend to apply only to a single tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109225754963\":{\"title\":\"Ta:20210109225754963\",\"answer\":\"`@@.my-favorite-class` at the start of the block, and `@@` at the end.\",\"created\":\"20210109225756671\",\"modified\":\"20210502163250430\",\"origin\":\"Stylesheets\",\"qtype\":\"rememberq\",\"question\":\"What wikitext syntax can you use to apply the class `my-favorite-class` to a block of wikitext?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109225841609\":{\"title\":\"Ta:20210109225841609\",\"answer\":\"`@@text-align: center;` at the start of the block, and `@@` at the end.\",\"created\":\"20210109225843207\",\"modified\":\"20210502163255271\",\"origin\":\"Stylesheets\",\"qtype\":\"rememberq\",\"question\":\"What wikitext syntax can you use to apply the style attribute `text-align: center` to a block of wikitext?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109225940595\":{\"title\":\"Ta:20210109225940595\",\"answer\":\"`$:/tags/Stylesheet`\",\"created\":\"20210109225941808\",\"modified\":\"20210502163259030\",\"origin\":\"Stylesheets\",\"qtype\":\"rememberq\",\"question\":\"What tag is used to make a tiddler part of the global stylesheet in a wiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109230027259\":{\"title\":\"Ta:20210109230027259\",\"answer\":\"If you use the wikitext content type, you can use transclusions in the stylesheet.\",\"created\":\"20210109230029770\",\"modified\":\"20241010132315627\",\"origin\":\"Stylesheets\",\"qtype\":\"rememberq\",\"question\":\"Why might you choose not to use the `text/css` content type for a tiddler containing CSS?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109230758790\":{\"title\":\"Ta:20210109230758790\",\"answer\":\"Node.js.\",\"created\":\"20210109230759914\",\"modified\":\"20210502163533577\",\"origin\":\"Creating Plugins\",\"qtype\":\"rememberq\",\"question\":\"TiddlyWiki plugins are usually developed using what external helper software?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109230844101\":{\"title\":\"Ta:20210109230844101\",\"answer\":\"A TiddlyWiki, which in addition to the plugin tiddler contains its documentation.\",\"created\":\"20210109230846035\",\"modified\":\"20210502163546781\",\"origin\":\"Creating Plugins\",\"qtype\":\"rememberq\",\"question\":\"Plugins are typically distributed in what kind of container?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109230943374\":{\"title\":\"Ta:20210109230943374\",\"answer\":\"`/home/alice/myplugin-wiki/plugins/MyPlugin`\",\"created\":\"20210109230944603\",\"modified\":\"20210502163553026\",\"origin\":\"Creating Plugins\",\"qtype\":\"rememberq\",\"question\":\"If you are creating a plugin called `MyPlugin`, and your `tiddlywiki.info` file is in the folder `/home/alice/myplugin-wiki`, in what folder should you place the tiddlers that make up your plugin?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109231032557\":{\"title\":\"Ta:20210109231032557\",\"answer\":\"It is a tiddler list where each element is automatically prefixed with the title of your plugin (e.g., `$:/plugins/alice/myplugin/`).\",\"created\":\"20210109231033412\",\"modified\":\"20210502163557713\",\"origin\":\"Creating Plugins\",\"qtype\":\"rememberq\",\"question\":\"What is unusual about the `list` field in a `plugin.info` file?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109231513717\":{\"title\":\"Ta:20210109231513717\",\"answer\":\"`plugin.info`\",\"created\":\"20210109231516123\",\"modified\":\"20210502163606302\",\"origin\":\"Creating Plugins\",\"qtype\":\"rememberq\",\"question\":\"What file at the root of a plugin's folder contains metadata about the plugin?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109231640740\":{\"title\":\"Ta:20210109231640740\",\"answer\":\"`tiddlywiki --build index`\",\"created\":\"20210109231641995\",\"modified\":\"20210502163613775\",\"origin\":\"Creating Plugins\",\"qtype\":\"rememberq\",\"question\":\"What TiddlyWiki Node.js command will create a single-file wiki from a folder wiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109231700230\":{\"title\":\"Ta:20210109231700230\",\"answer\":\"`tiddlywiki --listen`\",\"created\":\"20210109231701258\",\"modified\":\"20210502163616490\",\"origin\":\"Creating Plugins\",\"qtype\":\"rememberq\",\"question\":\"What TiddlyWiki Node.js command will start a local web server so you can edit the wiki in the current folder?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109232307261\":{\"title\":\"Ta:20210109232307261\",\"answer\":\"Each in a separate file containing their fields.\",\"created\":\"20210109232308241\",\"modified\":\"20210502164041560\",\"origin\":\"Writing Shell Scripts Against a TiddlyWiki\",\"qtype\":\"rememberq\",\"question\":\"How are tiddlers stored in a folder wiki (the format used by the Node.js version of TiddlyWiki)?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109232335937\":{\"title\":\"Ta:20210109232335937\",\"answer\":\"On separate lines at the top of the tiddler file, with a colon separating the field name and its value.\",\"created\":\"20210109232337191\",\"modified\":\"20210502164045301\",\"origin\":\"Writing Shell Scripts Against a TiddlyWiki\",\"qtype\":\"rememberq\",\"question\":\"How are fields other than `text` stored within tiddler files in a folder wiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109232419178\":{\"title\":\"Ta:20210109232419178\",\"answer\":\"After all of the other fields, separated from them by a blank line.\",\"created\":\"20210109232421364\",\"modified\":\"20210502164048174\",\"origin\":\"Writing Shell Scripts Against a TiddlyWiki\",\"qtype\":\"rememberq\",\"question\":\"How is the `text` field stored within a tiddler file in a folder wiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109232511957\":{\"title\":\"Ta:20210109232511957\",\"answer\":\"The `text` (content) field is stored in a separate file, alongside a `.meta` file containing the other fields.\",\"created\":\"20210109232512868\",\"modified\":\"20210502164049691\",\"origin\":\"Writing Shell Scripts Against a TiddlyWiki\",\"qtype\":\"rememberq\",\"question\":\"How are tiddlers containing binary data (e.g., images) stored in a folder wiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109232618910\":{\"title\":\"Ta:20210109232618910\",\"answer\":\"The subcommands/operations are introduced by double-dashes, like `--render`, while the options are positional.\",\"created\":\"20210109232620274\",\"modified\":\"20210502164054250\",\"origin\":\"Writing Shell Scripts Against a TiddlyWiki\",\"qtype\":\"rememberq\",\"question\":\"What unusual syntax does the `tiddlywiki` CLI have?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210109232706049\":{\"title\":\"Ta:20210109232706049\",\"answer\":\"The CLI is stateless, so no record of a different wiki being loaded is preserved to the next call. A second `--operation` needs to be added to the end of the command line to get a useful effect.\",\"created\":\"20210109232707605\",\"modified\":\"20210502164057041\",\"origin\":\"Writing Shell Scripts Against a TiddlyWiki\",\"qtype\":\"rememberq\",\"question\":\"Why is the TiddlyWiki CLI command `tiddlywiki --load SOURCE_WIKI` a no-op?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110165551205\":{\"title\":\"Ta:20210110165551205\",\"created\":\"20210110165553461\",\"modified\":\"20210408174542944\",\"origin\":\"The TiddlyWiki Interface\",\"qtype\":\"remembercz\",\"question\":\"The TiddlyWiki interface is divided into two sections: the {story river} on the left, and the {sidebar} on the right.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110165730167\":{\"title\":\"Ta:20210110165730167\",\"answer\":\"The double right arrow in the far upper-right corner.\",\"created\":\"20210110165731674\",\"modified\":\"20210408174545974\",\"origin\":\"The TiddlyWiki Interface\",\"qtype\":\"rememberq\",\"question\":\"Where in TiddlyWiki would you click to hide the sidebar if you wanted more horizontal space?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110165752901\":{\"title\":\"Ta:20210110165752901\",\"created\":\"20210110165755586\",\"modified\":\"20210408174549367\",\"origin\":\"The TiddlyWiki Interface\",\"qtype\":\"remembercz\",\"question\":\"The story river shows the {tiddlers} in your wiki which are currently open.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110165831811\":{\"title\":\"Ta:20210110165831811\",\"answer\":\"The //view toolbar//.\",\"created\":\"20210110165833421\",\"modified\":\"20210418131950521\",\"origin\":\"The TiddlyWiki Interface\",\"qtype\":\"rememberq\",\"question\":\"What is the toolbar in the upper-right corner of each tiddler when viewing it called?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110165850766\":{\"title\":\"Ta:20210110165850766\",\"answer\":\"The //page toolbar//.\",\"created\":\"20210110165851940\",\"modified\":\"20210408174556144\",\"origin\":\"The TiddlyWiki Interface\",\"qtype\":\"rememberq\",\"question\":\"What is the toolbar at the top of the sidebar called?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110165916732\":{\"title\":\"Ta:20210110165916732\",\"created\":\"20210110165918510\",\"modified\":\"20210408174558302\",\"origin\":\"The TiddlyWiki Interface\",\"qtype\":\"remembercz\",\"question\":\"The //Recent// tab of the sidebar shows those tiddlers that have been {changed} recently.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110165952850\":{\"title\":\"Ta:20210110165952850\",\"answer\":\"The //Tools// tab (check or uncheck items to control their placement on the toolbar).\",\"created\":\"20210110165954329\",\"modified\":\"20210408174605138\",\"origin\":\"The TiddlyWiki Interface\",\"qtype\":\"rememberq\",\"question\":\"Where in the sidebar can you choose which tools appear on the page toolbar?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110170043269\":{\"title\":\"Ta:20210110170043269\",\"created\":\"20210110170044390\",\"modified\":\"20210408174608962\",\"origin\":\"The TiddlyWiki Interface\",\"qtype\":\"remembercz\",\"question\":\"The left side of TiddlyWiki's interface, showing the tiddlers that are currently open, is called the {story river}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110172653534\":{\"title\":\"Ta:20210110172653534\",\"created\":\"20210110172655081\",\"modified\":\"20210409021847680\",\"origin\":\"Structuring Our Wiki\",\"qtype\":\"remembercz\",\"question\":\"It's helpful to be {consistent} when structuring a TiddlyWiki so that we don't struggle to find things that don't match conventions later.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110172813200\":{\"title\":\"Ta:20210110172813200\",\"answer\":\"We applied a tag representing the type of content to each tiddler.\",\"created\":\"20210110172814395\",\"modified\":\"20210409021849832\",\"origin\":\"Structuring Our Wiki\",\"qtype\":\"rememberq\",\"question\":\"In our sample TiddlyWiki, how did we classify tiddlers based on the type of content in them (e.g., journal, contact, project)?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110172919136\":{\"title\":\"Ta:20210110172919136\",\"answer\":\"Since tiddlers are small and focus on a single idea, if they aren't connected to adjacent ideas it will be particularly difficult to find them.\",\"created\":\"20210110172920901\",\"modified\":\"20240614020338027\",\"origin\":\"Structuring Our Wiki\",\"qtype\":\"rememberq\",\"question\":\"Explain why associating tiddlers with one another is particularly critical in TiddlyWiki compared to other notes systems.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110173202946\":{\"title\":\"Ta:20210110173202946\",\"answer\":\"E.g., Ingredient, Recipe, Store, Cookbook, Tip\",\"created\":\"20210110173204331\",\"modified\":\"20210409021900183\",\"origin\":\"Structuring Our Wiki\",\"qtype\":\"rememberq\",\"question\":\"Give an example of a type (classification) of tiddler you might invent in a TiddlyWiki that stores recipes and other cooking notes (try to pick a new one).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110173316061\":{\"title\":\"Ta:20210110173316061\",\"answer\":\"When you are looking for this information later, it is unlikely you will remember that the information came up during that specific meeting.\",\"created\":\"20210110173324319\",\"modified\":\"20210409021904060\",\"origin\":\"Structuring Our Wiki\",\"qtype\":\"rememberq\",\"question\":\"Why should you consider moving information that is of long-term importance out of your meeting notes into some other location after a meeting?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110174256345\":{\"title\":\"Ta:20210110174256345\",\"answer\":\"<code>&#96;monospace text&#96;</code>\",\"created\":\"20210110174257685\",\"modified\":\"20210409022755636\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax for monospace text applied to a few individual words?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210110182159208\":{\"title\":\"Ta:20210110182159208\",\"answer\":\"UTC (otherwise known as GMT)\",\"created\":\"20210110182200524\",\"modified\":\"20210409024941234\",\"origin\":\"Meeting Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What time zone are TiddlyWiki timestamps stored in?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210115212301253\":{\"title\":\"Ta:20210115212301253\",\"answer\":\"WYSIWYM editors involve the use of markup syntax (extra phrases and symbols) to explain what a page should look like when viewed, while WYSIWYG editors make the editor look like the page will look when it's viewed.\",\"created\":\"20210115212302541\",\"modified\":\"20210408175554092\",\"origin\":\"Wikitext\",\"qtype\":\"rememberq\",\"question\":\"Explain how a WYSIWYM editor differs from a WYSIWYG editor.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210115212635781\":{\"title\":\"Ta:20210115212635781\",\"answer\":\"An editor toolbar presenting a number of buttons that insert common snippets used to create formatting like bold, italics, and links.\",\"created\":\"20210115212637089\",\"modified\":\"20210408175600964\",\"origin\":\"Wikitext\",\"qtype\":\"rememberq\",\"question\":\"What tool does TiddlyWiki's editor provide to help you remember wikitext syntax?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210115212752286\":{\"title\":\"Ta:20210115212752286\",\"created\":\"20210115212753295\",\"modified\":\"20210408175605341\",\"origin\":\"Wikitext\",\"qtype\":\"remembercz\",\"question\":\"Text written in a raw markup language may be referred to as {source} text.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210115212808753\":{\"title\":\"Ta:20210115212808753\",\"created\":\"20210115212809740\",\"modified\":\"20210408175606717\",\"origin\":\"Wikitext\",\"qtype\":\"remembercz\",\"question\":\"The process of turning the source of a markup language into output is called {rendering}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210115212940187\":{\"title\":\"Ta:20210115212940187\",\"answer\":\"A WYSIWYM editor (using a markup language).\",\"created\":\"20210115212941377\",\"modified\":\"20210408175610078\",\"origin\":\"Wikitext\",\"qtype\":\"rememberq\",\"question\":\"What type of editor shows a description of how the text should be formatted, rather than a visual representation of that formatting?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210115213922401\":{\"title\":\"Ta:20210115213922401\",\"answer\":\"One (`[[my text|my target]]`).\",\"created\":\"20210115213923680\",\"modified\":\"20240929170728431\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"How many pipe characters are used when specifying a link with different displayed text and target?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210115213943747\":{\"title\":\"Ta:20210115213943747\",\"answer\":\"Two (`{{My Tiddler||My Template}}`).\",\"created\":\"20210115213946406\",\"modified\":\"20240929170636440\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"How many pipe characters are used when specifying a template transclusion?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116004748514\":{\"title\":\"Ta:20210116004748514\",\"answer\":\"`[[my text|MyTiddler]]`\",\"created\":\"20210116004751472\",\"modified\":\"20210418131753420\",\"origin\":\"Links\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to link to a tiddler called `MyTiddler`, with the link text `my text`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116010959834\":{\"title\":\"Ta:20210116010959834\",\"created\":\"20210116011003179\",\"modified\":\"20210408175611881\",\"origin\":\"Wikitext\",\"qtype\":\"remembercz\",\"question\":\"{Syntax} comprises the rules for producing correctly formed sentences or expressions in a natural or computer language.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116171504180\":{\"title\":\"Ta:20210116171504180\",\"answer\":\"It contains a space between filter steps, which TiddlyWiki interprets as part of the operator name, thus asking it to select tiddlers that have an empty field called <code>&nbsp;backlinks</code> (namely, all of them).\",\"created\":\"20210116171505337\",\"modified\":\"20210409152451829\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"rememberq\",\"question\":\"Why does the filter expression `[!is[system] backlinks[]]` not retrieve a list of tiddlers that link to other non-system tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116234613487\":{\"title\":\"Ta:20210116234613487\",\"answer\":\"`[[a search engine|https://www.google.com]]`\",\"created\":\"20210116234614891\",\"modified\":\"20210408180654771\",\"origin\":\"Links\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to create a link to Google (`https://www.google.com`) with the link text `a search engine`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116234645661\":{\"title\":\"Ta:20210116234645661\",\"answer\":\"An internal link links to another tiddler in your wiki. An external link links to a website or other URL outside your wiki.\",\"created\":\"20210116234647021\",\"modified\":\"20210408180657514\",\"origin\":\"Links\",\"qtype\":\"rememberq\",\"question\":\"Explain the difference between an //internal link// and an //external link//.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116234706260\":{\"title\":\"Ta:20210116234706260\",\"answer\":\"An external link.\",\"created\":\"20210116234707458\",\"modified\":\"20240612035518904\",\"origin\":\"Links\",\"qtype\":\"rememberq\",\"question\":\"What kind of link does not represent a relationship between two tiddlers when placed in a tiddler's `text` field?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116235201834\":{\"title\":\"Ta:20210116235201834\",\"created\":\"20210116235203718\",\"modified\":\"20240929202504273\",\"origin\":\"Block Mode and Inline Mode\",\"qtype\":\"remembercz\",\"question\":\"The two //modes// TiddlyWiki uses when reading wikitext are {block} mode and {inline} mode.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116235225037\":{\"title\":\"Ta:20210116235225037\",\"created\":\"20210116235227184\",\"modified\":\"20240929202505355\",\"origin\":\"Block Mode and Inline Mode\",\"qtype\":\"remembercz\",\"question\":\"In block mode, elements are stacked {vertically} (vertical/horizontal).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116235249040\":{\"title\":\"Ta:20210116235249040\",\"created\":\"20210116235250122\",\"modified\":\"20240929202507288\",\"origin\":\"Block Mode and Inline Mode\",\"qtype\":\"remembercz\",\"question\":\"In inline mode, elements are stacked {horizontally} (vertical/horizontal).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116235314838\":{\"title\":\"Ta:20210116235314838\",\"answer\":\"\",\"created\":\"20210116235316108\",\"modified\":\"20240929202509490\",\"origin\":\"Block Mode and Inline Mode\",\"qtype\":\"remembercz\",\"question\":\"You cannot start a new paragraph or insert vertical space within {inline} mode.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116235422856\":{\"title\":\"Ta:20210116235422856\",\"answer\":\"By leaving a blank line in your wikitext.\",\"created\":\"20210116235424609\",\"modified\":\"20240929202513520\",\"origin\":\"Block Mode and Inline Mode\",\"qtype\":\"rememberq\",\"question\":\"If you are in inline mode within some wikitext, how do you re-enter block mode prior to a block-mode element such as a list?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116235525673\":{\"title\":\"Ta:20210116235525673\",\"answer\":\"If you don't leave a blank line, TiddlyWiki will still be in inline mode from rendering the paragraph, but a list is a block-mode element and can't start in inline mode.\",\"created\":\"20210116235528737\",\"modified\":\"20240929202518160\",\"origin\":\"Block Mode and Inline Mode\",\"qtype\":\"rememberq\",\"question\":\"Using the concept of rendering modes, explain why you must leave a blank line between a paragraph and a bulleted list in TiddlyWiki.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116235640904\":{\"title\":\"Ta:20210116235640904\",\"answer\":\"e.g., including a field containing a piece of data like a phone number, email address, or link to another tiddler in a paragraph, bulleted list, or table\",\"created\":\"20210116235642580\",\"modified\":\"20240929202520954\",\"origin\":\"Block Mode and Inline Mode\",\"qtype\":\"rememberq\",\"question\":\"Give an example of when you might want to transclude a field in inline mode (try to pick a new one).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116235725120\":{\"title\":\"Ta:20210116235725120\",\"answer\":\"E.g., when transcluding an entire tiddler containing multiple paragraphs, when transcluding a complex template\",\"created\":\"20210116235726982\",\"modified\":\"20240929202523204\",\"origin\":\"Block Mode and Inline Mode\",\"qtype\":\"rememberq\",\"question\":\"Give an example of when you might want to transclude a field in block mode (try to pick a new one).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210116235841638\":{\"title\":\"Ta:20210116235841638\",\"answer\":\"Italic text (the `em` HTML element) is an inline-mode element. When TiddlyWiki is inside an inline-mode element, it will not look for block-mode elements like new paragraphs.\",\"created\":\"20210116235910756\",\"modified\":\"20240929202528396\",\"origin\":\"Block Mode and Inline Mode\",\"qtype\":\"rememberq\",\"question\":\"Using the concept of inline mode, explain why opening italics with `//` and never closing them results in the remainder of the tiddler turning into a single paragraph.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210117001839027\":{\"title\":\"Ta:20210117001839027\",\"answer\":\"Continue periodically reviewing the takeaways by opening the book and clicking on the review banner.\",\"created\":\"20210117001840527\",\"modified\":\"20210504013630914\",\"origin\":\"How to Use This Book\",\"qtype\":\"rememberq\",\"question\":\"If you need to take a break from learning TiddlyWiki, what should you do to avoid forgetting what you've learned in //Grok TiddlyWiki//?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210117012531956\":{\"title\":\"Ta:20210117012531956\",\"answer\":\"The comment ends after the first `-->`, so `comment. -->` appears in the output.\",\"created\":\"20210117012534804\",\"modified\":\"20210409173357510\",\"origin\":\"Comments\",\"qtype\":\"rememberq\",\"question\":\"What is wrong with this comment?: `<!-- here is an <!-- especially commenty --> comment. -->`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210117012550524\":{\"title\":\"Ta:20210117012550524\",\"created\":\"20210117012551481\",\"modified\":\"20210409173400551\",\"origin\":\"Comments\",\"qtype\":\"remembercz\",\"question\":\"Turning what would otherwise be functional wikitext into a comment temporarily, preventing it from appearing in the output, is called {commenting out} that wikitext.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210117013403056\":{\"title\":\"Ta:20210117013403056\",\"answer\":\"`The password is \\\"purple<!-- elephant-->\\\".`\",\"created\":\"20210117013406348\",\"modified\":\"20210409173415228\",\"origin\":\"Comments\",\"qtype\":\"rememberq\",\"question\":\"Make the following wikitext appear to say that the password is \\\"purple\\\" when it's rendered, by inserting a comment: `The password is \\\"purple elephant\\\".`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210117013433768\":{\"title\":\"Ta:20210117013433768\",\"answer\":\"`<!--`\",\"created\":\"20210117013435287\",\"modified\":\"20210409173426018\",\"origin\":\"Comments\",\"qtype\":\"rememberq\",\"question\":\"What string of characters begins a comment in HTML or wikitext?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210117013445546\":{\"title\":\"Ta:20210117013445546\",\"answer\":\"`-->`\",\"created\":\"20210117013447362\",\"modified\":\"20210409173427726\",\"origin\":\"Comments\",\"qtype\":\"rememberq\",\"question\":\"What string of characters ends a comment in HTML or wikitext?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210120022054991\":{\"title\":\"Ta:20210120022054991\",\"created\":\"20210120022056041\",\"modified\":\"20210409174725932\",\"origin\":\"When Things Go Wrong\",\"qtype\":\"remembercz\",\"question\":\"If you ever find yourself unsure how something works, try creating a/n {experiment} that will answer your question.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210120022211371\":{\"title\":\"Ta:20210120022211371\",\"answer\":\"If your first attempt at one of the chunks doesn't work right, you have a better idea of where the problem could be.\",\"created\":\"20210120022212709\",\"modified\":\"20210409174729267\",\"origin\":\"When Things Go Wrong\",\"qtype\":\"rememberq\",\"question\":\"Why should you split complicated problems into multiple chunks and solve each chunk by itself?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210120232130346\":{\"title\":\"Ta:20210120232130346\",\"answer\":\"Explain in detail to the duck what you are trying to do, in the hopes that this will call attention to your mistake.\",\"created\":\"20210120232131457\",\"modified\":\"20210409174734273\",\"origin\":\"When Things Go Wrong\",\"qtype\":\"rememberq\",\"question\":\"How can you use a rubber duck to help solve your TiddlyWiki problems?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210120232349960\":{\"title\":\"Ta:20210120232349960\",\"answer\":\"The element inspector (a part of the browser's developer tools).\",\"created\":\"20210120232350802\",\"modified\":\"20210409174739152\",\"origin\":\"When Things Go Wrong\",\"qtype\":\"rememberq\",\"question\":\"What web browser feature can you use to inspect the HTML of a specific element within TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210120232418473\":{\"title\":\"Ta:20210120232418473\",\"answer\":\"On the menu when you right-click anywhere on the page.\",\"created\":\"20210120232419282\",\"modified\":\"20210409174744170\",\"origin\":\"When Things Go Wrong\",\"qtype\":\"rememberq\",\"question\":\"Where do you find the option to open your web browser's HTML inspector?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210120232620760\":{\"title\":\"Ta:20210120232620760\",\"answer\":\"Display the values of the intermediate variables or fields by themselves to check whether they contain what you expect.\",\"created\":\"20210120232623385\",\"modified\":\"20240929214844080\",\"origin\":\"When Things Go Wrong\",\"qtype\":\"rememberq\",\"question\":\"What technique can you use to trace which part of some complicated wikitext is having a problem, without having to break the wikitext apart into smaller pieces?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210120232711407\":{\"title\":\"Ta:20210120232711407\",\"answer\":\"Step away from the computer for a few minutes.\",\"created\":\"20210120232712727\",\"modified\":\"20210409174804924\",\"origin\":\"When Things Go Wrong\",\"qtype\":\"rememberq\",\"question\":\"If you become frustrated at a TiddlyWiki problem, what is the fastest way to get back on track?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210120233224812\":{\"title\":\"Ta:20210120233224812\",\"answer\":\"Explaining the problem to a rubber duck (or a person).\",\"created\":\"20210120233231796\",\"modified\":\"20210409174807110\",\"origin\":\"When Things Go Wrong\",\"qtype\":\"rememberq\",\"question\":\"What troubleshooting technique helps you to identify places where you believe your wikitext does one thing, but it actually does something else?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210123231355355\":{\"title\":\"Ta:20210123231355355\",\"answer\":\"`all[current]`\",\"created\":\"20210123231400916\",\"modified\":\"20241012230804136\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"What filter step using the `all` operator constructs one output tiddler, the title of the current tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210124162823766\":{\"title\":\"Ta:20210124162823766\",\"answer\":\"Membership.\",\"created\":\"20210124162824443\",\"modified\":\"20210409020145969\",\"origin\":\"Tags\",\"qtype\":\"rememberq\",\"question\":\"What type of relationship is expressed by a TiddlyWiki tag?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210124183029121\":{\"title\":\"Ta:20210124183029121\",\"answer\":\"Place `<<<` above and below the section of text you want to quote.\",\"created\":\"20210124183030116\",\"modified\":\"20210409022758252\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to create a block quote that spans multiple lines?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210124183102272\":{\"title\":\"Ta:20210124183102272\",\"answer\":\"Place <code>&#96;&#96;&#96;</code> above and below the section of text you want to include in the code block.\",\"created\":\"20210124183103500\",\"modified\":\"20210409022802316\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to create a code (monospaced) block with multiple lines?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210124183159608\":{\"title\":\"Ta:20210124183159608\",\"answer\":\"Begin each list item on a new line with the character `*`.\",\"created\":\"20210124183201434\",\"modified\":\"20210409022808630\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to create a bulleted list?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210124183212683\":{\"title\":\"Ta:20210124183212683\",\"answer\":\"Begin each list item on a new line with the character `#`.\",\"created\":\"20210124183214276\",\"modified\":\"20210409022810241\",\"origin\":\"Journal Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"What is the wikitext syntax to create a numbered list?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130212746305\":{\"title\":\"Ta:20210130212746305\",\"created\":\"20210130212747987\",\"modified\":\"20210418131804163\",\"origin\":\"Tiddler Titles\",\"qtype\":\"remembercz\",\"question\":\"A knowledge tiddler should be focused on a single {idea}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130212814069\":{\"title\":\"Ta:20210130212814069\",\"created\":\"20210130212815216\",\"modified\":\"20210409130127397\",\"origin\":\"Tiddler Titles\",\"qtype\":\"remembercz\",\"question\":\"If a noun phrase seems insufficiently precise for titling a tiddler, try using a {claim} (type of statement) instead.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130212836866\":{\"title\":\"Ta:20210130212836866\",\"answer\":\"//Not//.\",\"created\":\"20210130212837495\",\"modified\":\"20210409130133180\",\"origin\":\"Tiddler Titles\",\"qtype\":\"rememberq\",\"question\":\"What word should be avoided to make your tiddler titles sharper?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130213337117\":{\"title\":\"Ta:20210130213337117\",\"answer\":\"Namespacing (starting all their names with a constant prefix, perhaps followed by a slash or colon).\",\"created\":\"20210130213338912\",\"modified\":\"20210409131331825\",\"origin\":\"Naming Conventions\",\"qtype\":\"rememberq\",\"question\":\"What naming technique may help organize a large number of tiddlers of the same type or on the same topic?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130213501953\":{\"title\":\"Ta:20210130213501953\",\"answer\":\"It can make you bring hierarchical thinking to places where it doesn't belong, discouraging you from reusing the tiddlers in different contexts.\",\"created\":\"20210130213503269\",\"modified\":\"20210418132025561\",\"origin\":\"Naming Conventions\",\"qtype\":\"rememberq\",\"question\":\"How can namespacing your tiddlers limit your thinking if the technique is used inappropriately?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130214416899\":{\"title\":\"Ta:20210130214416899\",\"answer\":\"A tag pill.\",\"created\":\"20210130214417669\",\"modified\":\"20210409020147458\",\"origin\":\"Tags\",\"qtype\":\"rememberq\",\"question\":\"What is the colored ellipse around a tag's name in TiddlyWiki called?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130214444181\":{\"title\":\"Ta:20210130214444181\",\"answer\":\"Click on the tag pill; the drop-down menu that appears will show the tagged tiddlers.\",\"created\":\"20210130214445363\",\"modified\":\"20210418131851643\",\"origin\":\"Tags\",\"qtype\":\"rememberq\",\"question\":\"If you are looking at a tag in TiddlyWiki's interface, how can you obtain a list of all tiddlers with that tag?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130223813261\":{\"title\":\"Ta:20210130223813261\",\"answer\":\"Integration, reference, and serendipity.\",\"created\":\"20210130223814292\",\"modified\":\"20210409141341567\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"rememberq\",\"question\":\"What three functions does //Grok TiddlyWiki// say notes have? (in alphabetical order)\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130223903147\":{\"title\":\"Ta:20210130223903147\",\"answer\":\"Writing the notes prompts you to think about the information more deeply, so you are more likely to remember it without needing the notes in the future.\",\"created\":\"20210130223904258\",\"modified\":\"20210409141407324\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"rememberq\",\"question\":\"Explain how notes help you //integrate// information (one of their three functions).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130223931544\":{\"title\":\"Ta:20210130223931544\",\"answer\":\"You remember that you took relevant notes on some topic you're thinking about, and you go find those notes.\",\"created\":\"20210130223932856\",\"modified\":\"20210409141415396\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"rememberq\",\"question\":\"Explain how notes are used for //reference// (one of their three functions).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130224008308\":{\"title\":\"Ta:20210130224008308\",\"answer\":\"You run across the notes at a time they are useful, having completely forgotten you took them.\",\"created\":\"20210130224009549\",\"modified\":\"20210409141418099\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"rememberq\",\"question\":\"Explain how notes can create //serendipity// (one of their three functions).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130224110199\":{\"title\":\"Ta:20210130224110199\",\"answer\":\"Once you have a lot of notes, the keywords you search for are likely found in so many places it will be difficult to find the notes.\",\"created\":\"20210130224111387\",\"modified\":\"20210409141426858\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"rememberq\",\"question\":\"Why is full-text search insufficient to find notes that are not stored in a relevant retrieval context? (reason relating to scale)\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130224154129\":{\"title\":\"Ta:20210130224154129\",\"answer\":\"Reference (knowing some relevant notes exist and looking for them).\",\"created\":\"20210130224157118\",\"modified\":\"20210409141431428\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"rememberq\",\"question\":\"Full-text search can only help you use notes in which one of //Grok TiddlyWiki//'s functions of notes?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210130224237554\":{\"title\":\"Ta:20210130224237554\",\"answer\":\"A context in which you are likely to want to find the information in the notes.\",\"created\":\"20210130224238806\",\"modified\":\"20210409141448578\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"rememberq\",\"question\":\"In the context of evergreen notes, what is a //retrieval context//?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131035147675\":{\"title\":\"Ta:20210131035147675\",\"answer\":\"At the time you create the note, you do not know what context you may need the note in later, so the more relevant contexts you place it in, the more likely you pick a useful one.\",\"created\":\"20210131035149131\",\"modified\":\"20210409141457218\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"rememberq\",\"question\":\"Why is it valuable to relate a new note to as many relevant things as possible? Use the concept of a //retrieval context//.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131035234849\":{\"title\":\"Ta:20210131035234849\",\"created\":\"20210131035236136\",\"modified\":\"20210409141543558\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"remembercz\",\"question\":\"Notes that are placed in a retrieval context, are related to many other ideas, and are continually updated as more information comes available can be called {evergreen} notes.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131035326236\":{\"title\":\"Ta:20210131035326236\",\"created\":\"20210131035327968\",\"modified\":\"20210409141546766\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"remembercz\",\"question\":\"Notes should be placed only in contexts in which they may actually be {useful} in the future.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131035518635\":{\"title\":\"Ta:20210131035518635\",\"created\":\"20210131035521797\",\"modified\":\"20210409141548429\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"remembercz\",\"question\":\"The {broken windows} theory (sociology term) of notes: when your notes are wrong or out of date, you are discouraged from using or updating the notes, producing a spiral of decay.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131035624182\":{\"title\":\"Ta:20210131035624182\",\"answer\":\"Filling your notes with ideas that have no long-term importance draws your attention away from the parts that matter, making your notes harder to use.\",\"created\":\"20210131035625205\",\"modified\":\"20210409141551184\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"rememberq\",\"question\":\"Why should you avoid making all your notes into evergreen notes?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131035704014\":{\"title\":\"Ta:20210131035704014\",\"created\":\"20210131035705764\",\"modified\":\"20210409141554057\",\"origin\":\"Creating Evergreen Notes\",\"qtype\":\"remembercz\",\"question\":\"To decide whether a note should be turned into an evergreen note, ask yourself whether you want the note to {outlive the day}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131162834222\":{\"title\":\"Ta:20210131162834222\",\"answer\":\"Click the gear icon in the page toolbar, under the wiki's title in the sidebar.\",\"created\":\"20210131162835586\",\"modified\":\"20210818141636826\",\"origin\":\"Tweaking Your Settings\",\"qtype\":\"rememberq\",\"question\":\"How do you open the //control panel// in a stock TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131162854519\":{\"title\":\"Ta:20210131162854519\",\"created\":\"20210131162855974\",\"modified\":\"20210408175058224\",\"origin\":\"Tweaking Your Settings\",\"qtype\":\"remembercz\",\"question\":\"The color scheme used by a TiddlyWiki is called its {palette}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131205501655\":{\"title\":\"Ta:20210131205501655\",\"answer\":\"A macro.\",\"created\":\"20210131205502716\",\"modified\":\"20241008122221457\",\"origin\":\"Macros\",\"qtype\":\"rememberq\",\"question\":\"Text substitution occurs only within what type of variable?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131205538119\":{\"title\":\"Ta:20210131205538119\",\"created\":\"20210131205539128\",\"modified\":\"20240929201050593\",\"origin\":\"Macros\",\"qtype\":\"remembercz\",\"question\":\"While TiddlyWiki is doing text substitution, it stops processing {wikitext markup}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131205933326\":{\"title\":\"Ta:20210131205933326\",\"answer\":\"`<<__myparameter__>>`\",\"created\":\"20210131205934532\",\"modified\":\"20240929201113676\",\"origin\":\"Macros\",\"qtype\":\"rememberq\",\"question\":\"What wikitext syntax can you use to refer to the value of a parameter `myparameter` of a macro without doing text substitution?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131210204783\":{\"title\":\"Ta:20210131210204783\",\"answer\":\"The former syntax doesn't result in text substitution, so there is no possibility of errors if special characters like `]]` or `\\\"` are used to surround <code>&#36;myparameter&#36;</code> but also appear in its value.\",\"created\":\"20210131210208174\",\"modified\":\"20240929201141457\",\"origin\":\"Macros\",\"qtype\":\"rememberq\",\"question\":\"Why is it usually better to write `<<__myparameter__>>` rather than <code>&#36;myparameter&#36;</code> within a macro, if it would have the same effect?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131211152969\":{\"title\":\"Ta:20210131211152969\",\"answer\":\"It does not begin with a capital letter.\",\"created\":\"20210131211154457\",\"modified\":\"20210321231640425\",\"origin\":\"CamelCase\",\"qtype\":\"rememberq\",\"question\":\"Why is `camelCaseWord` not in CamelCase?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131211210978\":{\"title\":\"Ta:20210131211210978\",\"answer\":\"It does not contain a capital letter immediately following a lowercase letter.\",\"created\":\"20210131211212504\",\"modified\":\"20210320135849194\",\"origin\":\"CamelCase\",\"qtype\":\"rememberq\",\"question\":\"Why is `Camel2Camel` not in CamelCase?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131211235165\":{\"title\":\"Ta:20210131211235165\",\"answer\":\"`\\\\rules except wikilink`\",\"created\":\"20210131211236448\",\"modified\":\"20210311183357631\",\"origin\":\"CamelCase\",\"qtype\":\"rememberq\",\"question\":\"CamelCase linking can be turned off for a specific tiddler using what pragma?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131211319408\":{\"title\":\"Ta:20210131211319408\",\"answer\":\"Precede it with a tilde, `~CamelCase`.\",\"created\":\"20210131211320419\",\"modified\":\"20210311183354737\",\"origin\":\"CamelCase\",\"qtype\":\"rememberq\",\"question\":\"How do you escape the word `CamelCase`, so that it does not turn into a link when camel-case linking is on?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131212436299\":{\"title\":\"Ta:20210131212436299\",\"answer\":\"E.g., link from the meeting to the project, link from the project to the meeting, put a `meetings` list field on the project, tag the meeting with the project tiddler, create a giant table mapping meetings to projects\",\"created\":\"20210131212437525\",\"modified\":\"20210409025824923\",\"origin\":\"Project Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Suggest a way to relate a meeting to a project (try to pick a new one).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210131212528420\":{\"title\":\"Ta:20210131212528420\",\"answer\":\"Effectively using custom fields this way usually requires creating a small amount of custom logic so you can easily see and edit the fields.\",\"created\":\"20210131212529677\",\"modified\":\"20241013004813137\",\"origin\":\"Project Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Why are fields a higher-effort method of relating tiddlers than tags?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206151704888\":{\"title\":\"Ta:20210206151704888\",\"created\":\"20210206151706663\",\"modified\":\"20210418131749070\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"remembercz\",\"question\":\"With a single filter run, you can only find tiddlers that match {all of} a set of conditions.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206151741395\":{\"title\":\"Ta:20210206151741395\",\"answer\":\"By placing the conditions for each branch of the OR in a separate filter run.\",\"created\":\"20210206151742797\",\"modified\":\"20210410181916526\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"rememberq\",\"question\":\"In a filter expression, you create an OR condition how?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206151820321\":{\"title\":\"Ta:20210206151820321\",\"answer\":\"`[tag[Journal]] [tag[Meeting]]`\",\"created\":\"20210206151821987\",\"modified\":\"20210410183003166\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"rememberq\",\"question\":\"Write a filter expression that shows all tiddlers that are tagged `Journal` or `Meeting`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206151843430\":{\"title\":\"Ta:20210206151843430\",\"created\":\"20210206151845763\",\"modified\":\"20210410183007155\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"remembercz\",\"question\":\"In a filter expression, you can include spaces between filter {runs} but not between filter {steps}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206152022536\":{\"title\":\"Ta:20210206152022536\",\"answer\":\"A tiddler list is a basic filter expression, consisting of several runs, each of which select a single tiddler.\",\"created\":\"20210206152024753\",\"modified\":\"20210410183030931\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"rememberq\",\"question\":\"Explain the relationship between tiddler lists and filter expressions.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206152226708\":{\"title\":\"Ta:20210206152226708\",\"answer\":\"//Dominant appending// (the tiddler appears in the last place it showed up and is removed from any prior position in the list).\",\"created\":\"20210206152230480\",\"modified\":\"20210410183041079\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"rememberq\",\"question\":\"When the same tiddler appears in the output of multiple consecutive filter runs, what concept does TiddlyWiki use to determine where the tiddler should be listed?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206152347300\":{\"title\":\"Ta:20210206152347300\",\"answer\":\"`=` (or `:all`)\",\"created\":\"20210206152348589\",\"modified\":\"20210410183058421\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"rememberq\",\"question\":\"What prefix can you add to a filter run to inhibit dominant appending and allow duplicate values in the list?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206152409644\":{\"title\":\"Ta:20210206152409644\",\"answer\":\"`+` (or `:and`)\",\"created\":\"20210206152410753\",\"modified\":\"20210410183109577\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"rememberq\",\"question\":\"What prefix can you add to a filter run to AND it with the accumulated results of previous runs?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206152427628\":{\"title\":\"Ta:20210206152427628\",\"answer\":\"`-` (or `:except`)\",\"created\":\"20210206152428907\",\"modified\":\"20210410183127863\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"rememberq\",\"question\":\"What prefix can you add to a filter run to remove all outputs of this run from the accumulated results?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206152454854\":{\"title\":\"Ta:20210206152454854\",\"answer\":\"`~` (or `:else`)\",\"created\":\"20210206152455981\",\"modified\":\"20210410183144993\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"rememberq\",\"question\":\"What prefix can you add to a filter run to ignore it unless the accumulated results are empty?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206152557092\":{\"title\":\"Ta:20210206152557092\",\"answer\":\"Removes them from their current position and puts them at the end of the results.\",\"created\":\"20210206152558864\",\"modified\":\"20210410183203836\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"rememberq\",\"question\":\"In a dominant append, TiddlyWiki does what to tiddlers that are already in the accumulated results?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206152939201\":{\"title\":\"Ta:20210206152939201\",\"answer\":\"`[tag[Journal]] -[search:text[fudge]tag[Meeting]]`\",\"created\":\"20210206152939704\",\"modified\":\"20241013004202288\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"rememberq\",\"question\":\"Write a filter expression that shows all tiddlers that are tagged `Journal`, but do not both contain the word `fudge` in their `text` field and have the tag `Meeting` (having one of the latter two conditions is OK).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206153058234\":{\"title\":\"Ta:20210206153058234\",\"answer\":\"`[tag[Contact]] [search:text[JaneDoe]] +[sort[]]`\",\"created\":\"20210206153059645\",\"modified\":\"20241013004215806\",\"origin\":\"Multi-Run Filters\",\"qtype\":\"rememberq\",\"question\":\"Write a filter expression that finds all tiddlers that are either tagged `Contact` or contain the word `JaneDoe` in their `text` field. The list should be sorted alphabetically.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206163511138\":{\"title\":\"Ta:20210206163511138\",\"answer\":\"Slice your content up into appropriate tiddlers.\",\"created\":\"20210206163512092\",\"modified\":\"20210409133647911\",\"origin\":\"Slicing Up Content\",\"qtype\":\"rememberq\",\"question\":\"What is the best way to create opportunities for reuse of content in TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206163533246\":{\"title\":\"Ta:20210206163533246\",\"created\":\"20210206163534157\",\"modified\":\"20210409133649829\",\"origin\":\"Slicing Up Content\",\"qtype\":\"remembercz\",\"question\":\"Rule of thumb for dividing tiddlers: create more tiddlers than {you think you should}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206163552612\":{\"title\":\"Ta:20210206163552612\",\"created\":\"20210206163554160\",\"modified\":\"20210409133652153\",\"origin\":\"Slicing Up Content\",\"qtype\":\"remembercz\",\"question\":\"Rule of thumb for dividing tiddlers: a tiddler should not get so large that {it doesn't fit on your screen without scrolling}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206163621213\":{\"title\":\"Ta:20210206163621213\",\"answer\":\"Conceptual ones.\",\"created\":\"20210206163622535\",\"modified\":\"20210409133655044\",\"origin\":\"Slicing Up Content\",\"qtype\":\"rememberq\",\"question\":\"Dividing content into tiddlers should be done based on what type of boundaries?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206163646455\":{\"title\":\"Ta:20210206163646455\",\"created\":\"20210206163647779\",\"modified\":\"20210409133658178\",\"origin\":\"Slicing Up Content\",\"qtype\":\"remembercz\",\"question\":\"Tiddlers are used to model {nouns} (language metaphor).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206163709629\":{\"title\":\"Ta:20210206163709629\",\"answer\":\"By making the noun a tiddler and the properties fields of that tiddler.\",\"created\":\"20210206163710743\",\"modified\":\"20210409133700398\",\"origin\":\"Slicing Up Content\",\"qtype\":\"rememberq\",\"question\":\"How do we describe the properties of a noun in TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206163838278\":{\"title\":\"Ta:20210206163838278\",\"answer\":\"\",\"created\":\"20210206163841179\",\"modified\":\"20210409133707423\",\"origin\":\"Slicing Up Content\",\"qtype\":\"remembercz\",\"question\":\"When tiddlers gather together lists of other tiddlers that meet some criteria, they act like {sentences} (language metaphor).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206163910099\":{\"title\":\"Ta:20210206163910099\",\"created\":\"20210206163911006\",\"modified\":\"20210409133710434\",\"origin\":\"Slicing Up Content\",\"qtype\":\"remembercz\",\"question\":\"When tiddlers perform actions on other tiddlers, they act like {machines} (object in the physical world).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206164032797\":{\"title\":\"Ta:20210206164032797\",\"answer\":\"Transclusion.\",\"created\":\"20210206164033785\",\"modified\":\"20210409133739809\",\"origin\":\"Slicing Up Content\",\"qtype\":\"rememberq\",\"question\":\"What TiddlyWiki concept allows tiddlers to appear within other tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206164140818\":{\"title\":\"Ta:20210206164140818\",\"answer\":\"E.g., `caption`, `author`, `publisher`, `publication-year`, `genre`, `isbn`, `rating`, `price`\",\"created\":\"20210206164142791\",\"modified\":\"20210418131821886\",\"origin\":\"Slicing Up Content\",\"qtype\":\"rememberq\",\"question\":\"Give an example of a field you might use on a tiddler describing a book (try to pick a new one).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206170818374\":{\"title\":\"Ta:20210206170818374\",\"created\":\"20210206170822321\",\"modified\":\"20240929170638974\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"remembercz\",\"question\":\"Templates behave like {lenses}, objects that modify the way we see other objects.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206182434279\":{\"title\":\"Ta:20210206182434279\",\"answer\":\"`myop:one:two[param]`\",\"created\":\"20210206182435827\",\"modified\":\"20240929214546847\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"If a filter operator `myop` accepts multiple suffixes, `one` and `two`, and a single parameter `param`, what does the resulting filter step look like?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206182504129\":{\"title\":\"Ta:20210206182504129\",\"answer\":\"`myop[one],[two]`\",\"created\":\"20210206182505096\",\"modified\":\"20240929214552949\",\"origin\":\"Anatomy of Filter Steps\",\"qtype\":\"rememberq\",\"question\":\"If a filter operator `myop` accepts multiple parameters, `one` and `two`, and has no suffix, what does the resulting filter step look like?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206183151676\":{\"title\":\"Ta:20210206183151676\",\"answer\":\"`[tag[Contact]search:phone[1234]]` (Careful: not `phone[1234]`, which requires the phone number to be //exactly// `1234`, or `contains:phone[1234]`, which would select a `1234` item from a tiddler list.)\",\"created\":\"20210206183206851\",\"modified\":\"20221015160957260\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"Write a filter run that finds all contacts whose phone number contains the number `1234`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206183227682\":{\"title\":\"Ta:20210206183227682\",\"answer\":\"`*`\",\"created\":\"20210206183229677\",\"modified\":\"20210409165638425\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"What suffix to the `search` operator causes it to find matches in any field of a tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206183311072\":{\"title\":\"Ta:20210206183311072\",\"answer\":\"`title,text` (in context, `search:title,text[your search query here]`)\",\"created\":\"20210206183312052\",\"modified\":\"20210409165641047\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"What suffix to the search operator causes it to find matches in either the `title` or `text` field of a tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206231316184\":{\"title\":\"Ta:20210206231316184\",\"answer\":\"The `$count` widget.\",\"created\":\"20210206231317022\",\"modified\":\"20210502161012539\",\"origin\":\"Miscellaneous Widgets\",\"qtype\":\"rememberq\",\"question\":\"What widget displays the number of tiddlers that match a filter?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206231346639\":{\"title\":\"Ta:20210206231346639\",\"answer\":\"`<$count filter=\\\"[tag[Contact]]\\\"/>`\",\"created\":\"20210206231348368\",\"modified\":\"20210502161016052\",\"origin\":\"Miscellaneous Widgets\",\"qtype\":\"rememberq\",\"question\":\"Write a `$count` widget to describe how many tiddlers have the tag `Contact`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206233305368\":{\"title\":\"Ta:20210206233305368\",\"answer\":\"The `$tiddler` widget.\",\"created\":\"20210206233306616\",\"modified\":\"20210502161018205\",\"origin\":\"Miscellaneous Widgets\",\"qtype\":\"rememberq\",\"question\":\"What widget is specifically designed to allow you to set the current tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206233413592\":{\"title\":\"Ta:20210206233413592\",\"answer\":\"`<$tiddler tiddler=<<myTiddler>>>{{||Example Template}}</$tiddler>` (you could also use a `$transclude` widget inside)\",\"created\":\"20210206233415186\",\"modified\":\"20210512023556342\",\"origin\":\"Miscellaneous Widgets\",\"qtype\":\"rememberq\",\"question\":\"Write a `$tiddler` widget with content that transcludes the tiddler specified in the `myTiddler` variable through the `Example Template` tiddler.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206233716739\":{\"title\":\"Ta:20210206233716739\",\"answer\":\"`<$radio field=\\\"color\\\" value=\\\"teal\\\">&nbsp;Teal</$radio>`\",\"created\":\"20210206233718557\",\"modified\":\"20210502161057496\",\"origin\":\"Miscellaneous Widgets\",\"qtype\":\"rememberq\",\"question\":\"Write a `$radio` widget that sets the value of the `color` field of the current tiddler to `teal`. The label on the button should say “Teal”.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206233839505\":{\"title\":\"Ta:20210206233839505\",\"answer\":\"The `$select` widget.\",\"created\":\"20210206233840308\",\"modified\":\"20210502161100735\",\"origin\":\"Miscellaneous Widgets\",\"qtype\":\"rememberq\",\"question\":\"What widget allows you to create a drop-down menu?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206233859381\":{\"title\":\"Ta:20210206233859381\",\"answer\":\"A series of `<option>` elements.\",\"created\":\"20210206233901108\",\"modified\":\"20210502161102676\",\"origin\":\"Miscellaneous Widgets\",\"qtype\":\"rememberq\",\"question\":\"The various choices offered by a `$select` widget are defined using what nested HTML element?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206234005759\":{\"title\":\"Ta:20210206234005759\",\"answer\":\"`<option value=\\\"excellent\\\">An Excellent Choice</option>`\",\"created\":\"20210206234006739\",\"modified\":\"20210502161108117\",\"origin\":\"Miscellaneous Widgets\",\"qtype\":\"rememberq\",\"question\":\"Write an `option` HTML element which displays the text “An Excellent Choice” and places the text `excellent` in its `$select` widget's bound field.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206234201889\":{\"title\":\"Ta:20210206234201889\",\"answer\":\"`<$select field=\\\"selection\\\"><$list filter=\\\"[tag[Ingredient]]\\\"><option value={{!!title}}>{{!!caption}}</option></$list></$select>`\",\"created\":\"20210206234203279\",\"modified\":\"20240929211133008\",\"origin\":\"Miscellaneous Widgets\",\"qtype\":\"rememberq\",\"question\":\"Write a `$select` widget that allows you to choose from all items with the tag `Ingredient`, placing the value of the selected ingredient's `title` field inside the `selection` field of the current tiddler. The text of each drop-down selection should be the `caption` field of the ingredient.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206234235502\":{\"title\":\"Ta:20210206234235502\",\"answer\":\"`$select`, `$list`, and `option`.\",\"created\":\"20210206234236937\",\"modified\":\"20210502161132257\",\"origin\":\"Miscellaneous Widgets\",\"qtype\":\"rememberq\",\"question\":\"What three widgets/HTML elements must be nested together to produce a drop-down list with dynamically chosen elements in TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210206234447506\":{\"title\":\"Ta:20210206234447506\",\"answer\":\"A drop-down menu always takes up the same (reasonable) amount of space, while radio buttons could consume an amount of space limited only by the number of matching items.\",\"created\":\"20210206234448719\",\"modified\":\"20240929211139758\",\"origin\":\"Miscellaneous Widgets\",\"qtype\":\"rememberq\",\"question\":\"Why is it usually better to use a `$select` widget than a `$radio` widget to select from a list of options matching a filter when you don't know how many items may be found by the filter?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207005116544\":{\"title\":\"Ta:20210207005116544\",\"answer\":\"They are assumed to be zero.\",\"created\":\"20210207005117396\",\"modified\":\"20210502162346961\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"What happens if you leave digits out of a TiddlyWiki timestamp?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207005145077\":{\"title\":\"Ta:20210207005145077\",\"answer\":\"12:00 noon.\",\"created\":\"20210207005146102\",\"modified\":\"20210502162348732\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"What time should you set a TiddlyWiki timestamp to if you care only about the date?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207005228571\":{\"title\":\"Ta:20210207005228571\",\"answer\":\"If you have a negative UTC offset, the date will otherwise be one day too early when adjusted for time zone and displayed.\",\"created\":\"20210207005229873\",\"modified\":\"20210502162351454\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"Why is it a good idea to list a time of noon on timestamps if you care only about the date?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207005253185\":{\"title\":\"Ta:20210207005253185\",\"answer\":\"The `$view` widget.\",\"created\":\"20210207005254137\",\"modified\":\"20210502162354660\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"What widget is used for displaying a date stored as a timestamp in a field of a tiddler in a user-friendly date format?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207005320123\":{\"title\":\"Ta:20210207005320123\",\"answer\":\"`<$view field=\\\"modified\\\" format=\\\"date\\\" template=\\\"YYYY\\\"/>`\",\"created\":\"20210207005321950\",\"modified\":\"20210502162403716\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"Write a `$view` widget to display the four-digit year in which the current tiddler was last modified.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207005357385\":{\"title\":\"Ta:20210207005357385\",\"answer\":\"`format=\\\"date\\\"`\",\"created\":\"20210207005358389\",\"modified\":\"20210502162407228\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"What attribute and value passed to the `$view` widget causes it to format a field as a date?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207005414293\":{\"title\":\"Ta:20210207005414293\",\"answer\":\"`template`\",\"created\":\"20210207005415452\",\"modified\":\"20210502162409032\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"What additional attribute must be supplied to the `$view` widget when choosing `format=\\\"date\\\"`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207005448591\":{\"title\":\"Ta:20210207005448591\",\"created\":\"20210207005450211\",\"modified\":\"20210502162411552\",\"origin\":\"Working with Dates\",\"qtype\":\"remembercz\",\"question\":\"The template used to describe how to format a date in TiddlyWiki is often known as a {format string}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207005515157\":{\"title\":\"Ta:20210207005515157\",\"answer\":\"The `now` macro.\",\"created\":\"20210207005516658\",\"modified\":\"20210502162419118\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"What macro retrieves the current date and time and displays it in your chosen format?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207005537472\":{\"title\":\"Ta:20210207005537472\",\"answer\":\"`<<now \\\"YYYY\\\">>`\",\"created\":\"20210207005539067\",\"modified\":\"20210502162422784\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"Write a call to the `now` macro that displays the current four-digit year.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207005559946\":{\"title\":\"Ta:20210207005559946\",\"answer\":\"The `days` operator.\",\"created\":\"20210207005601117\",\"modified\":\"20210502162426032\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"What filter operator finds tiddlers with dates that are before or after a specific time?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207014041832\":{\"title\":\"Ta:20210207014041832\",\"answer\":\"`is[draft]`\",\"created\":\"20210207014043275\",\"modified\":\"20210418163720035\",\"origin\":\"Getting the Current Tiddler Right on Drafts\",\"qtype\":\"rememberq\",\"question\":\"What filter step checks if the input tiddler is a draft tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207014108901\":{\"title\":\"Ta:20210207014108901\",\"answer\":\"In a field called `draft.of`.\",\"created\":\"20210207014109677\",\"modified\":\"20210418163723652\",\"origin\":\"Getting the Current Tiddler Right on Drafts\",\"qtype\":\"rememberq\",\"question\":\"How does a draft tiddler store the name of the tiddler it is a draft of?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207014142455\":{\"title\":\"Ta:20210207014142455\",\"answer\":\"Check if the current tiddler is a draft tiddler, and if it is change the current tiddler to the tiddler the draft is of.\",\"created\":\"20210207014143636\",\"modified\":\"20210418163731056\",\"origin\":\"Getting the Current Tiddler Right on Drafts\",\"qtype\":\"rememberq\",\"question\":\"What pattern can be used to allow logic depending on the name of the current tiddler to function in a side-by-side preview?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207032034836\":{\"title\":\"Ta:20210207032034836\",\"answer\":\"Give it a filter that has either one or zero output tiddlers depending on the state of the condition; if it has one, the body of the widget will be displayed, and if it has zero, it won't.\",\"created\":\"20210207032035835\",\"modified\":\"20240929210438986\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"How can you use the `$list` widget to display some content only if a condition is true?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207032115114\":{\"title\":\"Ta:20210207032115114\",\"answer\":\"The `$list` widget and the `$reveal` widget.\",\"created\":\"20210207032116183\",\"modified\":\"20240929210445546\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"What two widgets can be used to display any content only if a condition is true?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207032239853\":{\"title\":\"Ta:20210207032239853\",\"answer\":\"`<$list filter=\\\"[[$:/config/MyConfigTiddler]text[yes]]\\\"> ... </$list>`\",\"created\":\"20210207032242027\",\"modified\":\"20240929210520002\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"Write a `$list` widget that displays its contents only if the `text` field of the tiddler `$:/config/MyConfigTiddler` is set to the exact value `yes`. Use only hard parameters (no transclusions).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207032310040\":{\"title\":\"Ta:20210207032310040\",\"answer\":\"`emptyMessage`\",\"created\":\"20210207032311129\",\"modified\":\"20240929210501937\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"What attribute of the `$list` widget allows you to display some content if there are zero results from the filter?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207032407897\":{\"title\":\"Ta:20210207032407897\",\"answer\":\"`first[]`\",\"created\":\"20210207032408993\",\"modified\":\"20240929210531335\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"What filter operator is often used with conditionals based on the `$list` widget to ensure the contents of the widget doesn't get displayed more than once?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207032540788\":{\"title\":\"Ta:20210207032540788\",\"created\":\"20210207032541862\",\"modified\":\"20240929210548730\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"remembercz\",\"question\":\"The `$reveal` widget displays its contents only if a specified {c1::field} matches a {c1::value}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207033024829\":{\"title\":\"Ta:20210207033024829\",\"answer\":\"It creates a new `<span>` or `<div>` element to contain its contents, which may be illegal or have unwanted effects in some places.\",\"created\":\"20210207033028546\",\"modified\":\"20210418165634896\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"Why does the `$reveal` widget lead to incorrectly formatted output in some contexts?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207033253889\":{\"title\":\"Ta:20210207033253889\",\"answer\":\"`name`, `value`, `filter`, and `emptyValue`.\",\"created\":\"20210207033254670\",\"modified\":\"20210418165643151\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"What four attributes of `$set` are used to make its value conditional on whether a filter has results?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207033439159\":{\"title\":\"Ta:20210207033439159\",\"answer\":\"`emptyValue`\",\"created\":\"20210207033441465\",\"modified\":\"20210418165740872\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"When the `filter` attribute is used to make a `$set` widget conditional, what attribute contains the value to be used if the filter returns no results?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207033446919\":{\"title\":\"Ta:20210207033446919\",\"answer\":\"`value`\",\"created\":\"20210207033447893\",\"modified\":\"20210418165744760\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"When the `filter` attribute is used to make a `$set` widget conditional, what attribute contains the value to be used if the filter returns at least one result?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207033542865\":{\"title\":\"Ta:20210207033542865\",\"answer\":\"`<$set name=\\\"hasContacts\\\" filter=\\\"[tag[Contact]]\\\" value=\\\"yes\\\" emptyValue=\\\"no\\\"> ... </$set>`\",\"created\":\"20210207033544029\",\"modified\":\"20240929210626459\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"Write a `$set` widget that sets the variable `hasContacts` to `yes` if at least one tiddler in the wiki is tagged `Contact`, to `no` otherwise.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207033918887\":{\"title\":\"Ta:20210207033918887\",\"answer\":\"Place the fallback in the content/body of the widget.\",\"created\":\"20210207033921565\",\"modified\":\"20210418165801683\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"How can you provide fallback content to the `$transclude` widget to be used if the tiddler field it specifies does not exist?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207033930875\":{\"title\":\"Ta:20210207033930875\",\"answer\":\"Place the fallback in the content/body of the widget.\",\"created\":\"20210207033933255\",\"modified\":\"20210418165832577\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"rememberq\",\"question\":\"How can you provide fallback content to the `$view` widget to be used if the tiddler field it specifies does not exist?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207034003070\":{\"title\":\"Ta:20210207034003070\",\"created\":\"20210207034004011\",\"modified\":\"20210418165834559\",\"origin\":\"Hiding and Showing Things\",\"qtype\":\"remembercz\",\"question\":\"The `$view` widget differs from the `$transclude` widget in that it does not {wikify} the contents of the field it is accessing.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207060709278\":{\"title\":\"Ta:20210207060709278\",\"answer\":\"We are able to reuse tiddlified ideas in a wider variety of contexts.\",\"created\":\"20210207060712248\",\"modified\":\"20210408175118923\",\"origin\":\"Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"Why does breaking up information into tiddlers make our notes and our thoughts more flexible?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210207180624866\":{\"title\":\"Ta:20210207180624866\",\"answer\":\"`fields[]`\",\"created\":\"20210207180626371\",\"modified\":\"20240929211256213\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"What filter operator finds the names of all the fields used on the input tiddlers?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210208023219597\":{\"title\":\"Ta:20210208023219597\",\"answer\":\"The `qualify` macro.\",\"created\":\"20210208023220835\",\"modified\":\"20210502162612438\",\"origin\":\"Qualification\",\"qtype\":\"rememberq\",\"question\":\"What macro creates a name that is unique among all places the call to the macro is transcluded?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210208023320983\":{\"title\":\"Ta:20210208023320983\",\"answer\":\"(any situation that involves using a template in multiple places, where the template refers to a single tiddler storing state which should differ between uses of the template)\",\"created\":\"20210208023322067\",\"modified\":\"20210502162614372\",\"origin\":\"Qualification\",\"qtype\":\"rememberq\",\"question\":\"Describe a situation in which you would need to use the `qualify` macro (try to pick a new one).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210208023605710\":{\"title\":\"Ta:20210208023605710\",\"answer\":\"A field of the tiddler where the template is being transcluded.\",\"created\":\"20210208023607305\",\"modified\":\"20210502162616280\",\"origin\":\"Qualification\",\"qtype\":\"rememberq\",\"question\":\"The `qualify` macro is usually //not// needed when storing state used on a template where?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210208023626366\":{\"title\":\"Ta:20210208023626366\",\"answer\":\"A separate temporary tiddler.\",\"created\":\"20210208023628034\",\"modified\":\"20210502162618236\",\"origin\":\"Qualification\",\"qtype\":\"rememberq\",\"question\":\"The `qualify` macro //is// needed when storing the state of a template in what kind of tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210208023806895\":{\"title\":\"Ta:20210208023806895\",\"answer\":\"One, the base `title` to which a unique number will be suffixed.\",\"created\":\"20210208023808130\",\"modified\":\"20210502162620685\",\"origin\":\"Qualification\",\"qtype\":\"rememberq\",\"question\":\"What parameters does the `qualify` macro have?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210214165634956\":{\"title\":\"Ta:20210214165634956\",\"answer\":\"Purple.\",\"created\":\"20210214165635960\",\"modified\":\"20210214172141205\",\"origin\":\"TestyTest\",\"qtype\":\"rememberq\",\"question\":\"What color is a purple cow?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210327180615955\":{\"title\":\"Ta:20210327180615955\",\"created\":\"20210327180617038\",\"modified\":\"20210409133748552\",\"origin\":\"Slicing Up Content\",\"qtype\":\"remembercz\",\"question\":\"When tiddlers modify the way other tiddlers are displayed, they act like {lenses} (object in the physical world).\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210327180930007\":{\"title\":\"Ta:20210327180930007\",\"answer\":\"Which tag you want to look for.\",\"created\":\"20210327180931096\",\"modified\":\"20210409165646046\",\"origin\":\"Common Filter Operators\",\"qtype\":\"rememberq\",\"question\":\"You need to use `tagging[]` instead of `tag[]` when you don't know what at the time you write the filter?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20210327182023927\":{\"title\":\"Ta:20210327182023927\",\"answer\":\"Its square brackets are mismatched; there is a missing closing bracket at the end.\",\"created\":\"20210327182025345\",\"modified\":\"20210409152458301\",\"origin\":\"Using Filter Expressions\",\"qtype\":\"rememberq\",\"question\":\"Why does the filter expression `[tag[Contact]` not work?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240614031901039\":{\"title\":\"Ta:20240614031901039\",\"answer\":\"All lowercase.\",\"created\":\"20240614031902944\",\"modified\":\"20240929162436950\",\"origin\":\"Contact Tiddlers\",\"qtype\":\"rememberq\",\"question\":\"How are field names usually capitalized?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929154355182\":{\"title\":\"Ta:20240929154355182\",\"answer\":\"The `$let` widget.\",\"created\":\"20240929154356572\",\"modified\":\"20240929162555796\",\"origin\":\"Variables\",\"qtype\":\"rememberq\",\"question\":\"What widget allows you to set any number of variables to new values?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929154746057\":{\"title\":\"Ta:20240929154746057\",\"created\":\"20240929154758125\",\"modified\":\"20240929162549118\",\"origin\":\"Variables\",\"qtype\":\"remembercz\",\"question\":\"Putting a variable's name between double angle brackets `<<>>` where you want its value to appear is called {transcluding the variable's value}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929155859363\":{\"title\":\"Ta:20240929155859363\",\"answer\":\"Transclusions can't be nested inside other complex wikitext elements like links.\",\"created\":\"20240929155901071\",\"modified\":\"20240929162542934\",\"origin\":\"Using Variables as Attributes\",\"qtype\":\"rememberq\",\"question\":\"Why does this syntax not produce a usable link? `[[Wikipedia|<<wp>>]]`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929155943495\":{\"title\":\"Ta:20240929155943495\",\"answer\":\"`<a href=<<url>>>Search the web</a>`\",\"created\":\"20240929155949698\",\"modified\":\"20240929162536678\",\"origin\":\"Using Variables as Attributes\",\"qtype\":\"rememberq\",\"question\":\"Given a variable `url` containing the URL of Google, create a link to Google whose text is `Search the web`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929160159417\":{\"title\":\"Ta:20240929160159417\",\"answer\":\"A backtick.\",\"created\":\"20240929160200720\",\"modified\":\"20240929162531558\",\"origin\":\"Using Variables as Attributes\",\"qtype\":\"rememberq\",\"question\":\"In the context of TiddlyWiki, what is the character <code>&#96;</code> called?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929160755112\":{\"title\":\"Ta:20240929160755112\",\"answer\":\"A //substituted attribute value//.\",\"created\":\"20240929160759545\",\"modified\":\"20240929162526254\",\"origin\":\"Using Variables as Attributes\",\"qtype\":\"rememberq\",\"question\":\"What's this kind of attribute value, delimited by backticks, called? <code><a href=&#96;&#36;(wpLink)$/Aardvark&#96;>Aardvarks</a></code>\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929160831411\":{\"title\":\"Ta:20240929160831411\",\"created\":\"20240929160832419\",\"modified\":\"20240929162520241\",\"origin\":\"Using Variables as Attributes\",\"qtype\":\"remembercz\",\"question\":\"A substituted attribute value allows you to combine {constant text} and {the values of variables} into one attribute value.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929161330455\":{\"title\":\"Ta:20240929161330455\",\"answer\":\"<code>&#36;(bling)$</code>\",\"created\":\"20240929161333827\",\"modified\":\"20240929162514164\",\"origin\":\"Using Variables as Attributes\",\"qtype\":\"rememberq\",\"question\":\"Within a substituted attribute value, what syntax do you use to refer to the variable `bling`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929161437104\":{\"title\":\"Ta:20240929161437104\",\"answer\":\"The value of an attribute must be //just// a transclusion, //just// a constant string, or //just// a substituted attribute value -- not several of those things put together.\",\"created\":\"20240929161439086\",\"modified\":\"20240929162505024\",\"origin\":\"Using Variables as Attributes\",\"qtype\":\"rememberq\",\"question\":\"Why doesn't this syntax yield a working link? `<a href=<<wpBase>>\\\"/Aardvark\\\">`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929170839829\":{\"title\":\"Ta:20240929170839829\",\"answer\":\"`<$transclude $tiddler=\\\"ContactInformationTemplate\\\"/>`\",\"created\":\"20240929170842545\",\"modified\":\"20240929170909238\",\"origin\":\"Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Transclude the `text` field of the tiddler `ContactInformationTemplate` using a `$transclude` widget.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929170839830\":{\"title\":\"Ta:20240929170839830\",\"answer\":\"`<$transclude $tiddler=\\\"ContactInformationTemplate\\\" $field=\\\"description\\\"/>`\",\"created\":\"20240929170913242\",\"modified\":\"20240929170931264\",\"origin\":\"Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Transclude the `description` field of the tiddler `ContactInformationTemplate` using a `$transclude` widget.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929171020153\":{\"title\":\"Ta:20240929171020153\",\"answer\":\"`{{JaneDoe}}` changes the current tiddler to `JaneDoe` during the transclusion. `$transclude` has no effect on the current tiddler.\",\"created\":\"20240929171021646\",\"modified\":\"20240929171021646\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"What major and unexpected difference is there between the effect of `{{JaneDoe}}` and `<$transclude $tiddler=\\\"JaneDoe\\\"/>`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929171043170\":{\"title\":\"Ta:20240929171043170\",\"answer\":\"`$tiddler`\",\"created\":\"20240929171046127\",\"modified\":\"20240929171046127\",\"origin\":\"Templates and the Current Tiddler\",\"qtype\":\"rememberq\",\"question\":\"What widget is the most concise and idiomatic way to change the current tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929181236028\":{\"title\":\"Ta:20240929181236028\",\"answer\":\"Only the title of the first meeting (first result of the filter) is shown.\",\"created\":\"20240929181237345\",\"modified\":\"20241013003923252\",\"origin\":\"Filters and Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What behavior does this snippet exhibit that you might not expect? `<$text text={{{ [tag[Meeting]] }}}/>`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929181552822\":{\"title\":\"Ta:20240929181552822\",\"answer\":\"<code><&#36;widget attribute=&#96;text and &#36;{ [filter-expression[]] }&#36;&#96;/></code>\",\"created\":\"20240929181556009\",\"modified\":\"20240929181558944\",\"origin\":\"Filters and Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What syntax allows transcluding a filter expression as //part// of the value of an attribute?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929181836470\":{\"title\":\"Ta:20240929181836470\",\"answer\":\"`\\\\parameters`\",\"created\":\"20240929181837586\",\"modified\":\"20241013003938901\",\"origin\":\"Parameterizing Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What pragma is used to give a field/tiddler parameters?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929181933683\":{\"title\":\"Ta:20240929181933683\",\"answer\":\"`{{Sn:Hi|A|B}}`\",\"created\":\"20240929181934822\",\"modified\":\"20240929181934822\",\"origin\":\"Parameterizing Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Modify this transclusion to pass two values, `A` and `B`, as parameters: `{{Sn:Hi}}`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929182116673\":{\"title\":\"Ta:20240929182116673\",\"answer\":\"(1) transcludes `A` through the template `B` (i.e., it transcludes the tiddler `B`, setting the current tiddler to `A`).   (2) transcludes the tiddler `A`, passing `B` as the value of its first parameter.\",\"created\":\"20240929182132020\",\"modified\":\"20240929182132020\",\"origin\":\"Parameterizing Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Explain the difference in meaning between these two transclusions: (1) `{{A||B}}` (2) `{{A|B}}`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929182224200\":{\"title\":\"Ta:20240929182224200\",\"answer\":\"`<$transclude $tiddler=\\\"Hi\\\" name=\\\"Emily\\\"/> `\",\"created\":\"20240929182235085\",\"modified\":\"20240929182235085\",\"origin\":\"Parameterizing Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Use a `$transclude` widget to transclude the tiddler `Hi` with the parameter `name` set to `Emily`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929182408006\":{\"title\":\"Ta:20240929182408006\",\"answer\":\"`{{A||B|C}}`\",\"created\":\"20240929182410926\",\"modified\":\"20240929182410926\",\"origin\":\"Parameterizing Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Transclude the tiddler `A` through the template `B`, passing parameter `C`, using the brace syntax.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929182444440\":{\"title\":\"Ta:20240929182444440\",\"created\":\"20240929182445040\",\"modified\":\"20240929182445040\",\"origin\":\"Parameterizing Field Transclusions\",\"qtype\":\"remembercz\",\"question\":\"The `\\\\parameters` pragma is a shortcut for a {`$parameters` widget}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929182540797\":{\"title\":\"Ta:20240929182540797\",\"answer\":\"`<$slot $name=\\\"statement\\\" />`\",\"created\":\"20240929182547128\",\"modified\":\"20241013004003264\",\"origin\":\"Parameterizing Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Write a widget that retrieves the contents of a slot named `statement`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929182735224\":{\"title\":\"Ta:20240929182735224\",\"answer\":\"`<$transclude $tiddler=\\\"X\\\"><$fill $name=\\\"statement\\\">Y</$fill></$transclude>`\",\"created\":\"20240929182756829\",\"modified\":\"20240929182819070\",\"origin\":\"Parameterizing Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Transclude the tiddler `X`, filling its `statement` slot with `Y`.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929183057195\":{\"title\":\"Ta:20240929183057195\",\"answer\":\"Because of its different syntax, it's easier to include content that is long or contains lots of formatting.\",\"created\":\"20240929183100991\",\"modified\":\"20240929183100991\",\"origin\":\"Parameterizing Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"Why use a slot rather than a parameter?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929184628075\":{\"title\":\"Ta:20240929184628075\",\"created\":\"20240929184629664\",\"modified\":\"20240929184629664\",\"origin\":\"Functions\",\"qtype\":\"remembercz\",\"question\":\"A function is a special kind of variable that contains a {filter expression}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929184714885\":{\"title\":\"Ta:20240929184714885\",\"answer\":\"It evaluates the filter expression inside the function and shows the results.\",\"created\":\"20240929184716508\",\"modified\":\"20240929184727273\",\"origin\":\"Functions\",\"qtype\":\"rememberq\",\"question\":\"When you call a function, what action does TiddlyWiki take, different from what it does when calling a procedure?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929184803749\":{\"title\":\"Ta:20240929184803749\",\"answer\":\"The `$transclude` widget (with the same `$variable` attribute and parameters a procedure would use).\",\"created\":\"20240929184805176\",\"modified\":\"20241012230628630\",\"origin\":\"Functions\",\"qtype\":\"rememberq\",\"question\":\"What widget is used to call a function in modern TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929184844965\":{\"title\":\"Ta:20240929184844965\",\"answer\":\"To make the main filter expression shorter and easier to understand, by giving the extracted part a name that describes what it does.\",\"created\":\"20240929184845820\",\"modified\":\"20240929184845820\",\"origin\":\"Functions\",\"qtype\":\"rememberq\",\"question\":\"What's the purpose of extracting part of a filter expression into a function?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929184939778\":{\"title\":\"Ta:20240929184939778\",\"answer\":\"`function[]`\",\"created\":\"20240929184942793\",\"modified\":\"20240929184942793\",\"origin\":\"Functions\",\"qtype\":\"rememberq\",\"question\":\"What filter operator calls a function with an arbitrary name and places its results in the filter pipeline?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929185008670\":{\"title\":\"Ta:20240929185008670\",\"answer\":\"`{{{ [function[multiply-by-two],[4]] }}}`\",\"created\":\"20240929185011551\",\"modified\":\"20240929185011551\",\"origin\":\"Functions\",\"qtype\":\"rememberq\",\"question\":\"Call the function `multiply-by-two` in a filter expression with a single parameter `4`, using the `function` operator.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929185048955\":{\"title\":\"Ta:20240929185048955\",\"answer\":\"`{{{ [.multiply-by-two[4]] }}}`\",\"created\":\"20240929185052321\",\"modified\":\"20241013004227939\",\"origin\":\"Functions\",\"qtype\":\"rememberq\",\"question\":\"Call the function `.multiply-by-two` in a filter expression, with the parameter `4`, using the shortcut syntax.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929185124406\":{\"title\":\"Ta:20240929185124406\",\"answer\":\"It must contain a dot (`.`).\",\"created\":\"20240929185127423\",\"modified\":\"20240929185127423\",\"origin\":\"Functions\",\"qtype\":\"rememberq\",\"question\":\"To use the shortcut syntax for calling a function within a filter pipeline (treating it like an operator), what must be true of the function's name?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929185738402\":{\"title\":\"Ta:20240929185738402\",\"answer\":\"This is fine: TiddlyWiki doesn't do anything with the bodies of any of the declarations (pragmas) until it has read all of them.\",\"created\":\"20240929185741274\",\"modified\":\"20241008120418661\",\"origin\":\"Functions\",\"qtype\":\"rememberq\",\"question\":\"What happens if you call a function or procedure that's defined //after// the current one in a tiddler's wikitext?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929185828539\":{\"title\":\"Ta:20240929185828539\",\"answer\":\"Only the first result will be transcluded by `<<variable transclusion syntax>>`.\",\"created\":\"20240929185830723\",\"modified\":\"20240929185830723\",\"origin\":\"Functions\",\"qtype\":\"rememberq\",\"question\":\"What's different about the result of calling a function using `<<variable transclusion syntax>>` and calling it from within a filter?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929190210958\":{\"title\":\"Ta:20240929190210958\",\"answer\":\"If you make a mistake and this clause actually //is// reachable, it is much easier to recognize and fix the problem if you show an error message there.\",\"created\":\"20240929190212962\",\"modified\":\"20241013004238726\",\"origin\":\"Functions\",\"qtype\":\"rememberq\",\"question\":\"Why is it sometimes helpful to add an `<% else %>` clause to a chain of conditional expressions even if you think you have covered all conditions?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929201238567\":{\"title\":\"Ta:20240929201238567\",\"answer\":\"`\\\\define` (not `\\\\macro`!)\",\"created\":\"20240929201241419\",\"modified\":\"20240929201241419\",\"origin\":\"Macros\",\"qtype\":\"rememberq\",\"question\":\"What pragma is used to define a macro?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929201435327\":{\"title\":\"Ta:20240929201435327\",\"answer\":\"`$myparameter$`\",\"created\":\"20240929201437257\",\"modified\":\"20240929201437257\",\"origin\":\"Macros\",\"qtype\":\"rememberq\",\"question\":\"What's the syntax to text-substitute a parameter `myparameter` into the body of a macro?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929201523651\":{\"title\":\"Ta:20240929201523651\",\"answer\":\"Due to their use of text substitution, macros can fail in unexpected ways when tiddler names contain certain special characters (such as quotation marks or closing braces).\",\"created\":\"20240929201525200\",\"modified\":\"20240929201525200\",\"origin\":\"Macros\",\"qtype\":\"rememberq\",\"question\":\"Why are procedures usually safer to use than macros?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929201814667\":{\"title\":\"Ta:20240929201814667\",\"answer\":\"`$articleName$` is performing text substitution (only available in a macro), which means the replacement happens without regard for syntax. After the parameters are substituted, the link will be valid wikitext.\",\"created\":\"20240929201819661\",\"modified\":\"20240929201840688\",\"origin\":\"Macros\",\"qtype\":\"rememberq\",\"question\":\"Why does this method of including a parameter in a wikitext link work in a macro, while it would not in a procedure? `[[$articleName$|https://en.wikipedia.org/wiki/$articleName$]]`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929202435397\":{\"title\":\"Ta:20240929202435397\",\"answer\":\"Because the transclusion of `myText` is not quoted, TiddlyWiki will wikify it only once, leaving the `<<text>>` variable transclusion unexpanded.\",\"created\":\"20240929202437580\",\"modified\":\"20240929202437580\",\"origin\":\"Wikification\",\"qtype\":\"rememberq\",\"question\":\"Why will this snippet fail to place \\\"test text\\\" in the `wikitext` variable?<br>`\\\\procedure myText(text) Text: <<text>>`<br>` <$wikify name=\\\"wikitext\\\" text=<<myText \\\"test text\\\">>>...`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929202653877\":{\"title\":\"Ta:20240929202653877\",\"answer\":\"A procedure.\",\"created\":\"20240929202655657\",\"modified\":\"20240929202655657\",\"origin\":\"Custom Widgets\",\"qtype\":\"rememberq\",\"question\":\"A custom widget is internally what other TiddlyWiki object?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929202718241\":{\"title\":\"Ta:20240929202718241\",\"answer\":\"(1) They must begin with a `$`, like all widgets. (2) They must contain a dot `.` (unless overriding a built-in widget).\",\"created\":\"20240929202720641\",\"modified\":\"20240929202813544\",\"origin\":\"Custom Widgets\",\"qtype\":\"rememberq\",\"question\":\"What two restrictions are placed on the names of custom widgets?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929202757206\":{\"title\":\"Ta:20240929202757206\",\"answer\":\"`\\\\widget`\",\"created\":\"20240929202758080\",\"modified\":\"20240929202758080\",\"origin\":\"Custom Widgets\",\"qtype\":\"rememberq\",\"question\":\"What pragma is used to define a custom widget?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929202845764\":{\"title\":\"Ta:20240929202845764\",\"answer\":\"`ts-raw`\",\"created\":\"20240929202847430\",\"modified\":\"20240929202847430\",\"origin\":\"Custom Widgets\",\"qtype\":\"rememberq\",\"question\":\"What named slot contains the body of a custom widget?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929202944408\":{\"title\":\"Ta:20240929202944408\",\"answer\":\"`\\\\widget $italicize.text() //<$slot $name=\\\"ts-raw\\\" />//`\",\"created\":\"20240929202946793\",\"modified\":\"20240929202946793\",\"origin\":\"Custom Widgets\",\"qtype\":\"rememberq\",\"question\":\"Define a custom widget `$italicize.text` that renders its body in italics.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929205625975\":{\"title\":\"Ta:20240929205625975\",\"answer\":\"`$action-log`\",\"created\":\"20240929205627235\",\"modified\":\"20240929205627235\",\"origin\":\"Creating Tiddlers With Predefined Fields\",\"qtype\":\"rememberq\",\"question\":\"What action widget can be used to log the values of variables to your browser console when a button is pressed?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929205726683\":{\"title\":\"Ta:20240929205726683\",\"answer\":\"When it is overriding a built-in widget.\",\"created\":\"20240929205727446\",\"modified\":\"20240929205727446\",\"origin\":\"Overriding Built-In Widgets\",\"qtype\":\"rememberq\",\"question\":\"In what case does the name of a custom widget not need to contain a `.`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929205819621\":{\"title\":\"Ta:20240929205819621\",\"answer\":\"TiddlyWiki will instead use the definition of the newly created, overriding widget, and get stuck in an infinite loop.\",\"created\":\"20240929205820463\",\"modified\":\"20240929205820463\",\"origin\":\"Overriding Built-In Widgets\",\"qtype\":\"rememberq\",\"question\":\"Why can we not add extra behavior to a built-in widget by simply using that widget within an overriding custom widget?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929205834451\":{\"title\":\"Ta:20240929205834451\",\"answer\":\"The `$genesis` widget.\",\"created\":\"20240929205835644\",\"modified\":\"20240929205835644\",\"origin\":\"Overriding Built-In Widgets\",\"qtype\":\"rememberq\",\"question\":\"What widget allows us to call the original (not overridden) version of a widget we are overriding?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929205952443\":{\"title\":\"Ta:20240929205952443\",\"answer\":\"If you override a built-in widget with a broken version globally, it may make it difficult or impossible to edit the tiddler again and undo the changes.\",\"created\":\"20240929205956237\",\"modified\":\"20240929205956237\",\"origin\":\"Overriding Built-In Widgets\",\"qtype\":\"rememberq\",\"question\":\"When overriding a built-in widget, why should you start by scoping your override to a single tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929211458797\":{\"title\":\"Ta:20240929211458797\",\"answer\":\"Having it be a function allows it to be fully called as the attribute of a widget, since the first wikification of a function causes the entire filter expression to be evaluated. If it were a procedure, it would be passed in to the widget attribute as the literal macro call syntax `<<now ...>>`, rather than the current time.\",\"created\":\"20240929211500356\",\"modified\":\"20240929211501942\",\"origin\":\"Working with Dates\",\"qtype\":\"rememberq\",\"question\":\"Why is this potentially more useful written as a function than as a procedure?  `\\\\function now-timestamp() [<now [UTC]YYYY0MM0DD0hh0mm0ssXXX>]`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929211649615\":{\"title\":\"Ta:20240929211649615\",\"answer\":\"`data-tiddler-title` and `data-tags`.\",\"created\":\"20240929211702232\",\"modified\":\"20240929211702232\",\"origin\":\"Stylesheets\",\"qtype\":\"rememberq\",\"question\":\"What two data attributes does TiddlyWiki add to the HTML elements of tiddlers rendered in the story river?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929211734391\":{\"title\":\"Ta:20240929211734391\",\"answer\":\"You can use an attribute selector on the `data-tags` data attribute to target your CSS rules to only these tiddlers.\",\"created\":\"20240929211735796\",\"modified\":\"20240929211735796\",\"origin\":\"Stylesheets\",\"qtype\":\"rememberq\",\"question\":\"What mechanism can you use to style tiddlers with a particular tag differently from others?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929214906971\":{\"title\":\"Ta:20240929214906971\",\"answer\":\"The `$log` widget.\",\"created\":\"20240929214908252\",\"modified\":\"20240929214908252\",\"origin\":\"When Things Go Wrong\",\"qtype\":\"rememberq\",\"question\":\"What widget can you use to assist with displaying the values of variables in the middle of complicated wikitext?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240929214935650\":{\"title\":\"Ta:20240929214935650\",\"answer\":\"Any number of arbitrarily named parameters, each with (typically) a variable as its value.\",\"created\":\"20240929214936814\",\"modified\":\"20240929214936814\",\"origin\":\"When Things Go Wrong\",\"qtype\":\"rememberq\",\"question\":\"What parameters does the `$log` widget take?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20240930021427548\":{\"title\":\"Ta:20240930021427548\",\"answer\":\"`<$macrocall $name=\\\"mymacro\\\" param1=\\\"value1\\\"/>`\",\"created\":\"20240930021430383\",\"modified\":\"20240930021430383\",\"origin\":\"Macros\",\"qtype\":\"rememberq\",\"question\":\"How would you use the old `$macrocall` syntax to call a macro named `mymacro` with the parameter `param1=value1`?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001120058112\":{\"title\":\"Ta:20241001120058112\",\"answer\":\"Variable or field (no limitations).\",\"created\":\"20241001120059093\",\"modified\":\"20241001120059093\",\"origin\":\"Parameterizing Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"A slot can be used with what type of transclusion?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001123050663\":{\"created\":\"20241001123051664\",\"tags\":\"Takeaway\",\"modified\":\"20241001123051664\",\"title\":\"Ta:20241001123050663\",\"type\":\"text/vnd.tiddlywiki\",\"question\":\"Conditional expressions are based on {filters} (TiddlyWiki concept). \",\"qtype\":\"remembercz\",\"origin\":\"Conditional Expressions\"},\"Ta:20241001123114756\":{\"title\":\"Ta:20241001123114756\",\"created\":\"20241001123115525\",\"modified\":\"20241001123115525\",\"origin\":\"Conditional Expressions\",\"qtype\":\"remembercz\",\"question\":\"A conditional expression is true if its filter returns {at least one result}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001123238034\":{\"title\":\"Ta:20241001123238034\",\"answer\":\"`<% if FILTER %> ... <% endif %>`\",\"created\":\"20241001123238956\",\"modified\":\"20241001123238956\",\"origin\":\"Conditional Expressions\",\"qtype\":\"rememberq\",\"question\":\"What syntax (quasi-HTML tag pair) starts and ends a conditional expression?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001123303207\":{\"title\":\"Ta:20241001123303207\",\"created\":\"20241001123304787\",\"modified\":\"20241001123304787\",\"origin\":\"Conditional Expressions\",\"qtype\":\"remembercz\",\"question\":\"TiddlyWiki's formal name for the syntax used by conditional expressions is the {conditional shortcut syntax}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001123425111\":{\"title\":\"Ta:20241001123425111\",\"answer\":\"Placing quotes around the filter expression causes the result to become a constant string and the condition to always be true.\",\"created\":\"20241001123426326\",\"modified\":\"20241013004141333\",\"origin\":\"Conditional Expressions\",\"qtype\":\"rememberq\",\"question\":\"What's wrong with this syntax? `<% if \\\"[<storyTiddler>match[When Pigs Fly]]\\\" %>`\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001123501560\":{\"title\":\"Ta:20241001123501560\",\"answer\":\"`<% else %>`\",\"created\":\"20241001123502876\",\"modified\":\"20241001123502876\",\"origin\":\"Conditional Expressions\",\"qtype\":\"rememberq\",\"question\":\"What tag do you add to a conditional expression to render some wikitext only if none of the previous filters returned a result?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001123543179\":{\"title\":\"Ta:20241001123543179\",\"answer\":\"`<% elseif FILTER %>`\",\"created\":\"20241001123544171\",\"modified\":\"20241001123544171\",\"origin\":\"Conditional Expressions\",\"qtype\":\"rememberq\",\"question\":\"What tag do you add to a conditional expression to evaluate another filter, only if no previous filter in the set of filters has returned a result?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001123813694\":{\"title\":\"Ta:20241001123813694\",\"answer\":\"Tag the tiddler with `$:/tags/Global`.\",\"created\":\"20241001123817609\",\"modified\":\"20241013004255137\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"How do you make the procedures in a tiddler accessible in every tiddler in the wiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001123924508\":{\"title\":\"Ta:20241001123924508\",\"created\":\"20241001123925718\",\"modified\":\"20241001123925718\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"remembercz\",\"question\":\"A procedure that is accessible in any tiddler in the wiki is said to be in the {global scope}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001123935437\":{\"title\":\"Ta:20241001123935437\",\"created\":\"20241001123936283\",\"modified\":\"20241001123936283\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"remembercz\",\"question\":\"A procedure that is accessible in only one tiddler is said to be in a {local scope}.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001124024011\":{\"title\":\"Ta:20241001124024011\",\"answer\":\"If you inadvertently use the same name in multiple places, you'll end up with a confusing conflict.\",\"created\":\"20241001124027591\",\"modified\":\"20241001124027591\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"Why not put all names in the global scope?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001124231868\":{\"title\":\"Ta:20241001124231868\",\"answer\":\"This makes it far less likely that your names will conflict with someone else's (e.g., a plugin's).\",\"created\":\"20241001124233096\",\"modified\":\"20241001124233096\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"Why should you consider prefixing names that you put in the global scope with your initials or wiki name?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001124251903\":{\"title\":\"Ta:20241001124251903\",\"answer\":\"`.` or `-`, depending on context.\",\"created\":\"20241001124253487\",\"modified\":\"20241001124315977\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"Which two characters do we often choose to separate name prefixes from the rest of a name in TiddlyWiki?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001124357012\":{\"title\":\"Ta:20241001124357012\",\"answer\":\"The inner procedure is only accessible from within the outer procedure, not beyond its boundaries.\",\"created\":\"20241001124357957\",\"modified\":\"20241001124357957\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"What effect does placing a procedure inside another procedure have on the names made available in the surrounding scope?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001124406565\":{\"title\":\"Ta:20241001124406565\",\"created\":\"20241001124407355\",\"modified\":\"20241001124407355\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"remembercz\",\"question\":\"Placing a procedure inside another procedure is called {nesting} procedures.\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001124442506\":{\"title\":\"Ta:20241001124442506\",\"answer\":\"The `\\\\end` of each procedure must list the name of the procedure that is ending (e.g., `\\\\end my-procedure`).\",\"created\":\"20241001124443797\",\"modified\":\"20241001124443797\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"When you nest procedures, what do you have to change in the syntax of your `\\\\procedure` pragmas?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001124616839\":{\"title\":\"Ta:20241001124616839\",\"answer\":\"`\\\\import`\",\"created\":\"20241001124617825\",\"modified\":\"20241001124617825\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"What pragma makes procedures that aren't global accessible in another tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001124645414\":{\"title\":\"Ta:20241001124645414\",\"answer\":\"In the tiddler where you want them to be available, `\\\\import [tag[MyTwProcedures]]`.\",\"created\":\"20241001124646881\",\"modified\":\"20241001124646881\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"How do you make the procedures in all tiddlers with the tag `MyTwProcedures` available in a particular tiddler?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241001124730049\":{\"title\":\"Ta:20241001124730049\",\"answer\":\"`$:/tags/Macro`\",\"created\":\"20241001124731051\",\"modified\":\"20241001124731051\",\"origin\":\"Much More Than You Wanted to Know About Scopes\",\"qtype\":\"rememberq\",\"question\":\"What tag was the equivalent of `$:/tags/Global` in older versions of TiddlyWiki, and is still around?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Ta:20241013004053882\":{\"title\":\"Ta:20241013004053882\",\"answer\":\"You can't access them within filters or pass them on to a different procedure or tiddler.\",\"created\":\"20241013004055542\",\"modified\":\"20241013004055542\",\"origin\":\"Parameterizing Field Transclusions\",\"qtype\":\"rememberq\",\"question\":\"What drawback do slots have in terms of flexibility compared to parameters or variables?\",\"tags\":\"Takeaway\",\"type\":\"text/vnd.tiddlywiki\"},\"Tabs\":{\"title\":\"Tabs\",\"created\":\"20200717215952541\",\"description\":\"The `tabs` procedure facilitates compact display of a number of related tiddlers, as in the sidebar of a stock TiddlyWiki.\",\"modified\":\"20241010125935497\",\"parent\":\"More Organizational Tools\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"It's often useful to create a summary or links tiddler that uses tabs to show the contents of some other tiddlers, just like the sidebar does in the default installation of TiddlyWiki. We can easily create new sets of tabs with the built-in `tabs` {{Ltc:TabsProcedure||LieToChildrenTemplate}}.\\n\\nA typical call to the `tabs` procedure looks like this:\\n\\n```html\\n<<tabs tabsList:\\\"foo bar baz\\\" default:\\\"foo\\\">>\\n```\\n\\n`tabsList`, in its simplest incarnation, is just a list of tiddler titles, but it can actually be any filter (recall that a list of tiddler titles is in the same format of [[a series of simple filter runs|Multi-Run Filters]]), which makes it possible to choose what tabs should be shown on the fly. For instance, we can create tabs for all of the basic `Concept`s tagged in this book:\\n\\n{{Sn:ConceptTabs||MagicSnippet}}\\n\\nNow, if we add new concepts to the wiki, they'll immediately show up as new tabs. The `caption` field of each tiddler, if it exists, will be used as the text on the tab; otherwise the title will be used.\\n\\nThe optional `default` parameter, set to the title of one of the tiddlers being made into a tab, chooses which tab starts selected. If you leave it blank, you'll have to click on a tab to see anything expand.\\n\\nThe `tabs` macro has several other optional parameters that are occasionally useful, which you can read about in [[the documentation|https://tiddlywiki.com/#tabs%20Macro]].\\n\\nYou can make tabs show up vertically instead of horizontally, like they do under the ''More'' tab of the sidebar, using the parameter `class:\\\"tc-vertical\\\"`.\\n\\n!! Exercises\\n\\n{{Ex:MeetingsToday||ExerciseTemplate}}\\n{{Ex:ContactTabs||ExerciseTemplate}}\\n{{Ex:FixingContactTabs||ExerciseTemplate}}\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Tags\":{\"title\":\"Tags\",\"created\":\"20200530170303661\",\"description\":\"Tags are a special type of link used to categorize tiddlers and arrange them in hierarchies.\",\"modified\":\"20210409020111576\",\"parent\":\"The Shape of TiddlyWiki\",\"tags\":\"Concept Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Forget everything you know about tags for a moment, because TiddlyWiki has a slightly different notion of tags from most tools.\\n\\nTiddlyWiki tags are a way of ''relating two tiddlers''. (You might consider a tag a special kind of [[link|Links]] to another tiddler that's stored in a `tags` [[field|Fields]] instead of the `text` field.) Specifically, the type of relationship expressed by a tag is ''membership''. If I create a tiddler about myself called `Soren` and tag it `Person`, I'm saying that the `Soren` tiddler is a conceptual member of another tiddler called `Person`; or, put another way, “`Soren` is a `Person`.” As with [[traditional links|Links]] in TiddlyWiki, this is a bidirectional relationship and you can search based on that relationship in either direction: `Person` will know that it is //tagging// `Soren`, while `Soren` will know that it is //tagged// `Person`. \\n\\nMaking tagging into a means of relating tiddlers rather than a means of sticking little labels on things dramatically expands the range of things tags can be used for. Traditional tags can only be used for “tag-based” organization -- you can filter your content based on its having or not having a particular tag or set of tags, and that's about it. You can still do this with TiddlyWiki tags, but you can also use them to create more complex structures like multi-level hierarchies -- seemingly the antithesis of traditional tags. If tiddler C is tagged with B, and tiddler B is tagged with A, you have an A > B > C hierarchy. TiddlyWiki provides tools such as [[tables of contents|Creating Hierarchies with a Table of Contents]] for viewing these hierarchies.\\n\\nIn some way, this also just makes sense: if [[everything's a tiddler|Tiddlers]] in TiddlyWiki, why should tags be any different?\\n\\nJust like you can link to a tiddler that doesn't exist yet, you can tag a tiddler with a tiddler that doesn't exist yet. For the more traditional methods of using tags (e.g., filtering tiddlers based on whether they do or do not have a particular tag), you never need to create the tagging tiddler at all -- but you always have the option if you need it, or if you want a convenient place to describe what the tag is used for.\\n\\nIf you look at the top of this section, you can see that its tiddler is tagged <<tag Concept>> and <<tag Section>>. The colored ellipses around the tag names are called ''tag pills'', and if you click on one you will see a list of all tiddlers with that tag. Usually the tagged tiddlers are shown in alphabetical order, but we'll learn later that they can be [[put in any order you like|Ordering Tiddlers]].\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"TakeAway Help/General Takeaway Functions\":{\"title\":\"TakeAway Help/General Takeaway Functions\",\"caption\":\"General takeaway functions\",\"created\":\"20210101234652033\",\"description\":\"Once you've answered a takeaway for the first time, you'll see several options below it, whether you're seeing the takeaway [[in the text|TakeAway Help/Studying In Text]] (//List// tab), [[in the browser|Takeaway Browser]], or [[in review|TakeAway Help/Reviewing]].\",\"modified\":\"20210407194540991\",\"tags\":\"Fragment\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"{{TakeAway Help/General Takeaway Functions!!description}}\\n\\n* ''next review'' or ''due for review'' (only shown in the text and the browser) -- this indicates when you'll next see the takeaway, or //due for review// if it's time to review it now. See [[Reviewing takeaways|TakeAway Help/Reviewing]] for more information. If the takeaway is due later than tomorrow, you can click //forgot// to tell TakeAway that you've already forgotten the takeaway and would like to see it again right away tomorrow.\\n* ''edit'' -- Open the takeaway's tiddler to edit its text or view its scheduling information.\\n* ''uncollect'' -- If you don't want to see this takeaway at all in review anymore, this option will remove it from review, clear its scheduling history, and put the takeaway back to showing only the question in the text.\\n* ''send feedback'' -- If you think the prompt is unclear or could be improved, click here to send a quick note to the author.\\n* ''help'' -- Open the TakeAway help screen.\\n\\nIn the reviewer and the browser, you'll also notice a link and an ID number in square brackets over on the right. You can click the link to ''return to the section in the text where the takeaway was introduced'', if you need a refresher.\"},\"TakeAway Help/Leeches\":{\"title\":\"TakeAway Help/Leeches\",\"created\":\"20210123182104528\",\"lapses\":\"5\",\"modified\":\"20210407194337860\",\"tags\":\"Fragment\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"''Leeches'' are takeaways that you keep on forgetting. Because you keep forgetting them over and over, they cause frustration and take up a disproportionate amount of your review time. TakeAway will display a banner like this one when it finds a leech:\\n\\n{{||$:/plugins/sobjornstad/TakeAway/LeechBanner}}\\n\\nThe number of times you have to forget a takeaway before this banner appears is called the //leech threshold//. It defaults to 4, but can be adjusted in the [[settings|TakeAway Settings]]. For purposes of leech detection, you're only considered to have “forgotten” a takeaway if you answer something other than “forgot” and then forget it again. That is, pressing “forgot” several days in a row doesn't count as having forgotten the takeaway -- in that case, you never really knew it at all.\\n\\n\\n!! Why leeches happen\\n\\nLeeches are usually a symptom of some other problem, not the problem in themselves:\\n\\n* The takeaway might be worded in a way that's confusing to you (see [[Editing takeaways|TakeAway Help/Editing]]). This could be the result of the author writing the takeaway poorly, or you having a different mental model of the topic or different related knowledge than most other people.\\n* You may not fully understand the topic the takeaway is asking about.\\n* You may be confusing this takeaway with another one (//memory interference//).\\n\\n!! Fixing leeches\\n\\nWhen you see the leech banner, take a moment to see if you can ''identify why you're struggling'', then fix the problem, perhaps by doing some background reading or editing the takeaway text. Click //hide warning// when you've taken care of it. The warning will appear again at each multiple of the leech threshold; by default, this is when you've forgotten the takeaway 8 times, 12 times, 16 times, etc.\\n\\nAnother entirely reasonable option, if you don't believe the information in the takeaway is particularly valuable to you, is to simply ''uncollect it'', preventing it from showing up in reviews again. This will allow you to reallocate your limited study time to material that isn't as frustrating or difficult to retain.\\n\\nFor much more on leeches in spaced-repetition study, check out the article [[Dealing with Leeches|https://controlaltbackspace.org/memory/dealing-with-leeches/]]. The article is focused on Anki, but most of its guidance will apply to TakeAway too.\"},\"Templates and the Current Tiddler\":{\"title\":\"Templates and the Current Tiddler\",\"created\":\"20200530170337337\",\"description\":\"Combining transclusions and manipulation of TiddlyWiki's `currentTiddler` variable gives us //templates//, tiddlers that control the way other tiddlers are displayed.\",\"modified\":\"20241017013949599\",\"parent\":\"Transclusion\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Field transclusions have another useful trick up their sleeve: the option to treat the tiddler being transcluded as a ''template''. A template transclusion, like a normal field transclusion, is a means of reusing content, but it allows the tiddler being transcluded to refer to information {{Ltc:TiddlerDoingTransclusion||LieToChildrenTemplate}}.\\n\\nTo return to the metaphor we began back in [[Slicing Up Content]], templates are a sort of lens or optical apparatus with which to look at a tiddler: still nouns themselves, but ones that can be used to modify the way we see other nouns.\\n\\nBe forewarned that templates are probably somewhat unlike anything you've encountered before, so this section might bend your brain a bit. It's OK if you don't get it the first time around.\\n\\n\\n!! The current tiddler\\n\\nTo understand templates, we have to first understand TiddlyWiki's unexpectedly complex concept of the ''current tiddler''. We casually referred to the current tiddler in the [[Field Transclusions]] section when talking about the syntax `{{!!field}}`, and you probably assumed that the “current” tiddler is the one that you're typing the transclusion into. And in many cases, such as in several of the exercises in that section, it is. But it turns out there's a bit more to it.\\n\\nAn {{Ltc:CurrentTiddlerDefinition||LieToChildrenTemplate}} is straightforward: it's just ''the tiddler that's named in the value of the `<<currentTiddler>>` [[variable|Variables]]''. However, the current tiddler is much more interesting than your average variable, because references to this variable are deeply embedded into the syntax and inner workings of TiddlyWiki.\\n\\nHere are some places you can ''access the current tiddler'':\\n\\n* Via the `<<currentTiddler>>` variable.\\n* In a field transclusion that does not name any tiddler. `{{!!field}}` refers to the `field` field of the current tiddler, as noted in [[Field Transclusions]].\\n* Via the `all[current]` [[filter step|Common Filter Operators]].\\n* Many [[widgets|Widgets]] assume the tiddler to operate on is the current tiddler unless you say otherwise.\\n\\nHere are some things that ''change the current tiddler'':\\n\\n* Transcluding another tiddler with the `{{curly braces}}` syntax.\\n* Using a `$list` widget to enumerate the outputs of a filter ([[unless you specify otherwise|Ex:ContainingCurrentTiddler/answer]]).\\n* Directly setting `currentTiddler` with a `$set` or `$let` widget.\\n* Using a `$tiddler` widget to change the current tiddler.\\n\\nFor completeness, here are some things that ''//don't// change the current tiddler'' that people often guess would change it:\\n\\n* Transcluding another tiddler with a `$transclude` widget.\\n* Transcluding another tiddler with the `{{||piped curly braces}}` syntax (this syntax will be described in detail later in the section).\\n* Transcluding the contents of a tiddler as a [[tab|Tabs]].\\n\\nWhen you are looking at a tiddler `X` directly in the story river and haven't done anything in that tiddler's wikitext to change the current tiddler, the current tiddler is `X`. It's when you start using widgets and transclusions within tiddler `X` that it gets complicated -- or if the tiddler `X` is not displayed directly within the story river but is instead transcluded within another tiddler `Y`.\\n\\n\\n!! The current tiddler changes when transcluding a tiddler\\n\\nLet's take a closer look at what happens when we ''transclude a tiddler''. Think back to the [[first exercise|Ex:JaneDataTransclusion]] in the [[Field Transclusions]] section, the one in which we made Jane's contact information appear on the `JaneDoe` tiddler by adding a bunch of transclusions like `{{!!email}}` and `{{!!family}}` to the `JaneDoe` tiddler:\\n\\n```html\\n!! Information about Jane\\n\\n* ''Email'': {{!!email}}\\n* ''Phone'': {{!!phone}}\\n* ''Family'': {{!!family}}\\n* ''Manager'': {{!!manager}}\\n```\\n\\nThese field references referred to the `JaneDoe` tiddler, since they were in `JaneDoe`, we hadn't done anything in the `JaneDoe` tiddler to change the current tiddler, and we were looking at the `JaneDoe` tiddler directly in the story river at the time.\\n\\nEasy enough, right? Now let's think about what happens when we transclude Jane's tiddler in another tiddler called `AllContacts`. (If you want, you can go try this in your wiki right now.) If we're looking at `AllContacts`, we definitely don't want the current tiddler to be `AllContacts` while rendering the content of the `JaneDoe` tiddler -- if it were, we wouldn't be able to see any of Jane's contact information, because we referred to it with, e.g., `{{!!phone}}`, and the `AllContacts` tiddler doesn't have a `phone` field, much less one containing Jane's phone number.\\n\\nFor this reason, anytime we transclude a field of a tiddler using the `{{braces syntax}}`, the current tiddler is ''changed to the tiddler we're transcluding'', the contents of the field are processed, and then the current tiddler is changed back. You can imagine that TiddlyWiki does something like this:\\n\\n```html\\n<$let currentTiddler=\\\"JaneDoe\\\">\\n  {{JaneDoe}}\\n</$let>\\n```\\n\\nIn reality, of course, you don't have to put the `$let` widget there yourself, it just happens when you say `{{JaneDoe}}`.\\n\\n\\n!! When the current tiddler shouldn't change\\n\\nIt gets more complicated, because while resetting the current tiddler like this makes sense as a default and is often exactly what you want, there are other occasions on which it proves unhelpful.\\n\\nGoing back to the exercise, we did a nice job of displaying Jane's contact information on //Jane's// tiddler…but what about every other contact's tiddler? If we want the contact fields to appear on every contact's tiddler, the most obvious way would be to copy and paste the same list of information and field references to every contact tiddler, but that sounds pretty annoying. This sounds like an ideal place to use transclusion, which lets us include the same content in many different tiddlers without repeating the content.\\n\\nLet's try this, then: let's excise the “Information about Jane” section we created above from her tiddler (if you've forgotten, there is a button on the editor toolbar to do this, or you can press Ctrl+E). Call the excised tiddler `ContactInformationTemplate`, and replace it with a transclusion; `{{ContactInformationTemplate}}` should appear in the wikitext of `JaneDoe`.\\n\\nNice. But wait…none of the information is showing up now. Did you catch why?\\n\\n<$details summary=\\\"Answer\\\">\\nWhen we transclude the `ContactInformationTemplate` into `JaneDoe`, the current tiddler is changed to `ContactInformationTemplate`, which means we don't have access to the fields on `JaneDoe` anymore. We could get around this by changing the transclusions on the `ContactInformationTemplate` to look like, e.g., `{{JaneDoe!!phone}}`, but then this `ContactInformationTemplate` tiddler could only be used with the `JaneDoe` tiddler -- and being able to reuse the `ContactInformationTemplate` tiddler was the entire point of extracting it into a separate tiddler.\\n</$details>\\n\\nSuddenly the behavior that looked nice just a moment ago is exactly what we don't want!\\n\\n\\n!! Transcluding a tiddler through a template\\n\\nTo make the `ContactInformationTemplate` work the way we want, we need a way of //not// changing the current tiddler during a field transclusion, or, more generally, making the current tiddler a tiddler of our choice during the transclusion.\\n\\nThis is called ''transcluding a tiddler through a template''. The syntax is `{{tiddler||template}}`. So here it would be:\\n\\n```html\\n{{JaneDoe||ContactInformationTemplate}}\\n```\\n\\nAdd that in the `JaneDoe` tiddler in place of plain `{{ContactInformationTemplate}}`, and you should immediately see Jane's information show up again, because we told TiddlyWiki to transclude `ContactInformationTemplate`, but to make the current tiddler during the transclusion be `JaneDoe`, rather than `ContactInformationTemplate`. Sweet!\\n\\nThere's a shorter and more flexible way to write this. Just like we can write `{{!!field}}` to transclude the `field` field of the current tiddler, we can write `{{||template}}` to transclude the current tiddler through `template` (i.e., not change the current tiddler at all while transcluding `template`). So here we can just say:\\n\\n```html\\n{{||ContactInformationTemplate}}\\n```\\n\\nIn this case, we could also simply use the `$transclude` widget, which does not change the current tiddler. The above syntax is equivalent to:\\n\\n```html\\n<$transclude $tiddler=\\\"ContactInformationTemplate\\\"/>\\n```\\n\\n(If you want to use the `$transclude` widget rather than braces but you //do// want to change the current tiddler, you can set the `currentTiddler` variable yourself around the `$transclude` widget. The idiomatic way to do this is with the `$tiddler` widget, like `<$tiddler tiddler=\\\"NewCurrentTiddler\\\">`.)\\n\\n\\n!! How to think about templates\\n\\n`{{tiddler||template}}`, and the concept of “transcluding a tiddler through a template,” ''feels backwards'' to many people at first. This operation actually transcludes the //template//, giving it access to the fields of the tiddler; our intuitive notion of transcluding a tiddler seems rather to suggest that the //tiddler// should be transcluded with reference to the information in the template. A good way to read `{{tiddler||template}}` is “Put the contents of //template// right here, but as you're deciding what //template// looks like, the current tiddler is //tiddler//, not //template//.”\\n\\nIt's important to remember that, since [[everything's a tiddler|Tiddlers]], ''a template is not really a thing in itself''. That is, unlike in many other similar tools, your TiddlyWiki is not separated into two distinct categories of content, tiddlers and templates. Rather, when you transclude a tiddler through a template, you are using a particular tiddler //as// a template, to display the content in the other tiddler. A tiddler can be used as a template in one place, and as an ordinary content tiddler with a link to it, or for that matter as a tag, in another. In fact, in many cases, transclusion will have exactly the same effect whether the transcluded tiddler is treated as a template or not. For instance, `{{EmployeeProfileSetupMeeting}}`, `{{||EmployeeProfileSetupMeeting}}`, and `{{JaneDoe||EmployeeProfileSetupMeeting}}` should all do the same thing if you try them: the contents of the `EmployeeProfileSetupMeeting` tiddler appears. That's because the `EmployeeProfileSetupMeeting` tiddler doesn't contain any references that depend on the current tiddler, such as `{{!!field transclusions}}`.\\n\\nLook out as you move forward: the syntax for templates uses two consecutive pipe characters (`||`). In [[Parameterizing Field Transclusions]], we'll see that a single pipe within a field transclusion does something entirely different! (And don't confuse either with a single pipe in a [[link|Links]], which separates the tiddler name or URL from its text.)\\n\\n\\n!! When is an error not an error?\\n\\nWhen it's displayed on a tiddler you intend to use as a template.\\n\\nSince templates are usually written expecting the current tiddler to be some other tiddler -- not the template tiddler itself -- when you look at a template tiddler directly, it may look pretty funny. For instance, there will likely be some data missing. The formatting may even be incorrect, or TiddlyWiki may show an outright error (e.g., a //Recursive transclusion error//). This should not worry you. In general, the only way to know if a template tiddler is written correctly is to actually use it as a template and see if the expected output appears there.\\n\\n\\n!! Exercises\\n\\n!!! On the current tiddler\\n\\n{{Ex:CurrentTiddlerAndListWidget||ExerciseTemplate}}\\n{{Ex:MeetingListWithoutCurrentTiddler||ExerciseTemplate}}\\n{{Ex:ContainingCurrentTiddler||ExerciseTemplate}}\\n{{Ex:MethodsOfTransclusion||ExerciseTemplate}}\\n{{Ex:TranscludedProcedureScope||ExerciseTemplate}}\\n\\n!!! On templates\\n\\n{{Ex:AddContactTemplates||ExerciseTemplate}}\\n{{Ex:CreateMeetingTemplate||ExerciseTemplate}}\\n{{Ex:TicketTrackingTemplate||ExerciseTemplate}}\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\\n\"},\"The Finer Points of Procedures\":{\"title\":\"The Finer Points of Procedures\",\"created\":\"20240727195829171\",\"description\":\"Procedures come in many forms.\",\"modified\":\"20241010130147339\",\"parent\":\"Transclusion\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"We just skimmed the surface of procedures in the previous section, and you may be left with quite a few questions. Let's try to tackle some of the most important ones.\\n\\n{{$:/plugins/sobjornstad/TakeAway/ContextualHelp/DetailsWidget}}\\n\\n<$details summary=\\\"Procedures have scope\\\">\\n\\nIn the [[Variables]] section, we learned that after the closing `</$set>` or `</$let>` tag, a variable goes out of scope and is no longer available for use. So you might wonder, what's the scope of a procedure?\\n\\nThe answer is, generally, the procedure is available until the end of the tiddler. It's also possible to define //global procedures// -- ones that you can use across any tiddler in your wiki. We'll discuss how to do that in [[Much More Than You Wanted to Know About Scopes]], next chapter.\\n\\n</$details><$details summary=\\\"Procedures can have zero parameters\\\">\\n\\nIt's possible, and even common, to have a procedure with //no// parameters, which is just a different way of writing a variable scoped to the entire tiddler. For instance, this is equivalent to the example of the corporate disclaimer previously discussed in the [[Variables]] section:\\n\\n{{Sn:ParameterlessProcedure||MagicSnippet}}\\n\\n\\n</$details><$details summary=\\\"Procedures can have multiple parameters\\\">\\n\\nLet's come back to our good old `wikipediaLink` procedure again. Let's say we want the user to be able to specify the text as well as the article we're linking to. Here's how we can do that:\\n\\n{{Sn:MultipleParameterProcedure||MagicSnippet}}\\n\\nNote that parameters are separated by a space in the procedure call but by a comma in the procedure definition. No, this doesn't really make any sense, but a lot of programming languages do it this way too.\\n\\nAlso notice the use of \\\"double quotation marks\\\" when a parameter contains spaces.\\n\\n\\n</$details><$details summary=\\\"Procedures can be called with parameters containing double quotes\\\">\\n\\nA moment ago, we saw that you can include spaces in a parameter by surrounding it with double quotes. But what happens when the parameter itself contains double quotes? Uh-oh:\\n\\n{{Sn:QuoteWithinQuotesProcedure||MagicSnippet}}\\n\\nIn this case, we can use //tripled// double quotes (colloquially called //triple quotes//) to mark the start and end of the parameter:\\n\\n{{Sn:TripleDoublesProcedure||MagicSnippet}}\\n\\nThis trick works elsewhere in TiddlyWiki as well, if you ever find yourself needing to quote something that contains quotes.\\n\\nIt's also possible to use 'single quotes' / apostrophes in place of double quotes, if you don't use any inside the parameter text. But since it's common to have apostrophes in text, while triple quotes are virtually never found inside text, triple quotes are a more generally useful tactic.\\n\\n</$details><$details summary=\\\"Procedures can be called with parameter names\\\">\\n\\nIf we don't like the order that the procedure parameters are specified in, or there are a lot of parameters and it's hard to remember what order they come in, we can list the parameters by name. If we do this, the order becomes unimportant.\\n\\n{{Sn:ProcedureParameterNames||MagicSnippet}}\\n\\nSometimes this is called using ''named parameters'', in contrast to using //positional parameters//.\\n\\nA space may optionally be added after the colon `:`, but most people find it easier to read without a space.\\n\\n\\n</$details><$details summary=\\\"Procedures can have optional parameters\\\">\\n\\nWhen defining a procedure, we can specify a default value for a parameter by writing it after the parameter name and a colon. Then we only need to provide a value in the procedure call if we don't want to use the default.\\n\\n{{Sn:DefaultProcedureParameterValues||MagicSnippet}}\\n\\nAgain, a space may optionally be added after the colon.\\n\\n</$details><$details summary=\\\"Procedures can be defined on a single line\\\">\\n\\nYou can place short procedures whose bodies need only one line on the same line as the `\\\\procedure` pragma and omit the `\\\\end`:\\n\\n{{Sn:SingleLineProcedure||MagicSnippet}}\\n\\n\\n</$details><$details summary=\\\"Procedures can be called using a $transclude widget\\\">\\n\\nIn addition to the handy `<<double angle bracket>>` syntax, it's possible to call a procedure using the `$transclude` [[widget|Widgets]]. As we discussed in the widgets section, this is a common pattern in TiddlyWiki: anything you can do with convenient wikitext syntax can also be done with HTML tags or widgets, and those forms may offer some additional options for advanced use.\\n\\nHere's how we could create our aardvark link with a widget:\\n\\n{{Sn:SimpleProcedureCallWidget||MagicSnippet}}\\n\\nNotice the dollar sign in front of `$variable`, which is easily missed. (It's there so that your procedure can have parameters with any names, including `variable`, without conflicting.)\\n\\n</$details><$details summary=\\\"The $transclude widget can take variables as parameters\\\">\\n\\nFrom the above, it was probably not immediately obvious why you would ever want to write out a procedure call the long way with a widget. Here's the main reason why: you can //transclude other things// into the parameters of the procedure. For instance, maybe we want to link to a few different Wikipedia pages, but use the same link name:\\n\\n{{Sn:TranscludedProcedureCallWidget||MagicSnippet}}\\n\\n</$details>\\n\\n\\n!! Exercises\\n\\n{{Ex:TicketTrackingLink||ExerciseTemplate}}\\n{{Ex:ReversedOptionalParameters||ExerciseTemplate}}\\n{{Ex:QuotedProcedureCall||ExerciseTemplate}}\\n{{Ex:UnclosedProcedureCall||ExerciseTemplate}}\\n\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"The Shape of TiddlyWiki\":{\"title\":\"The Shape of TiddlyWiki\",\"caption\":\"1: The Shape of TiddlyWiki\",\"created\":\"20200603023507957\",\"description\":\"In which we download and install TiddlyWiki, learn the basics of TiddlyWiki's data model, and begin creating some tiddlers in a sample wiki.\",\"list\":\"[[Installing TiddlyWiki]] [[Downloading Grok TiddlyWiki]] [[The TiddlyWiki Interface]] [[Tweaking Your Settings]] Tiddlers Fields Wikitext Links Tags [[Requirements for the Sample Wiki]] [[Structuring Our Wiki]] [[Journal Tiddlers]] [[Contact Tiddlers]] [[Meeting Tiddlers]] [[Project Tiddlers]] [[Knowledge Tiddlers]] [[Reviewing the Basics]]\",\"modified\":\"20240907020404246\",\"parent\":\"Outline\",\"tags\":\"Chapter\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Welcome to TiddlyWiki! This first chapter will help you get your bearings. At the end of it, you will have a fully functional and useful sample wiki; it just won't take advantage of many of the features that [[make TiddlyWiki special|Why TiddlyWiki?]].\\n\\nThe chapter has three phases:\\n\\n# First, we'll ''set up a sample wiki'' for use in the rest of the book, by [[installing TiddlyWiki|Installing TiddlyWiki]], [[downloading a copy of this book|Downloading Grok TiddlyWiki]], [[exploring the TiddlyWiki interface|The TiddlyWiki Interface]], and [[tweaking settings|Tweaking Your Settings]].\\n# Second, we'll learn about ''five basic concepts'' in TiddlyWiki: [[tiddlers|Tiddlers]], [[fields|Fields]], [[wikitext|Wikitext]], [[links|Links]], and [[tags|Tags]].\\n# Last, we'll go through a ''seven-section tutorial'' to set up the basic structure of the sample wiki, [[gathering requirements|Requirements for the Sample Wiki]], [[outlining the structure of the wiki|Structuring Our Wiki]], and then creating [[journal entries|Journal Tiddlers]], [[contacts|Contact Tiddlers]], [[meeting notes|Meeting Tiddlers]], [[projects|Project Tiddlers]], and [[miscellaneous notes|Knowledge Tiddlers]] in accordance with the requirements and structure. Along the way, you'll learn how to navigate TiddlyWiki's interface, use the basic features of [[wikitext|Wikitext]], and model data in TiddlyWiki.\\n\\nThis chapter will be unusual in that it will include few exercises. Instead, you'll be working nonstop in your sample wiki as you read. Once we move into chapter 2, we'll switch to discussing some concepts and then turning you loose to try them out on your own.\\n\\nIf you haven't yet read [[How to Use This Book]] or watched the video tour there, you may wish to do so now. If you're feeling impatient, you can figure out how it works as you go along and return to that section later if needed.\\n\\n!! In this chapter\\n\\n{{||ChapterOutlineTemplate}}\"},\"The TiddlyWiki Interface\":{\"title\":\"The TiddlyWiki Interface\",\"created\":\"20201125202250940\",\"description\":\"Study an annotated screenshot of TiddlyWiki's interface to help you put names to what you're seeing.\",\"modified\":\"20241013021015117\",\"parent\":\"The Shape of TiddlyWiki\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Let's take a quick look at the interface of a brand-new TiddlyWiki, in annotated form:\\n\\n<$link to=\\\"interface.png\\\">{{interface.png}}</$link>\\n\\nBefore we get started, it's worth pointing out that the interface of TiddlyWiki is highly customizable and extensible, as we will learn in <<gtw.link-chapter-number \\\"Looking Under the Hood\\\">>, [[Looking Under the Hood]]. If you carefully compare the screenshot above to the interface of //Grok TiddlyWiki//, you'll notice some differences -- for instance, many toolbars will have a different set of buttons, and the tabs in the sidebar will be different. The interface described in this section and in the remainder of the book is that of a stock `empty.html` TiddlyWiki downloaded from https://tiddlywiki.com, except where we change it during the course of the exercises. To avoid confusion, use the example wiki you created in [[Installing TiddlyWiki]] anytime you want to study the interface or see how TiddlyWiki behaves by default.\\n\\nWith that out of the way, take a look at the screenshot again. You can see that the screen is divided into two parts, the ''story river'' (red highlight) and the ''sidebar'' (magenta highlight). If your screen is too narrow to show both side-by-side (for instance, if you're viewing the wiki on a smartphone), the sidebar will come at the top of the page and the story river below it.\\n\\nThe story river shows the tiddlers which are currently open. We'll talk more about [[tiddlers|Tiddlers]] and their function in a moment; for now, just think of them as containers for the content of your wiki, like files or sheets of paper. When you open a new tiddler, it gets a new “card” over in the story river and leaves existing tiddlers open, so you can easily work with several tiddlers at once. The toolbar in the upper-right corner of each tiddler (the ''view toolbar'') lets you edit it, close it, delete it, get a link to it, collapse it, and so on.\\n\\nThe sidebar allows you to navigate to tiddlers that you don't have open and take various system actions. The toolbar at the top-right (the ''page toolbar'') lets you create new tiddlers, adjust options, and save your wiki by default, but it's possible to customize what buttons show up here. Then there is a fast full-text search for all tiddlers in the wiki; we'll discuss this in the [[Searching]] section. Last come four tabs which contain the majority of the sidebar's functionality:\\n\\n; Open\\n: A concise list of the tiddlers in the story river, useful if you have a ton of them open at once or you want to reorder them (just drag and drop).\\n; Recent\\n: A list of tiddlers you've changed recently.\\n; Tools\\n: A list of system actions like importing content, advanced search, changing the colors, and so on. You can place the tools you use most frequently on the page toolbar by checking or unchecking the box next to each tool.\\n; More\\n: A variety of other ways to find tiddlers, which we'll discuss in detail in [[Browsing Your Tiddlers]].\\n\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\\n\"},\"The View Template\":{\"title\":\"The View Template\",\"created\":\"20200718024513554\",\"description\":\"The ViewTemplate is a special template TiddlyWiki uses internally to render each story in the story river; you can customize it to add custom content to all tiddlers or a subset of tiddlers.\",\"modified\":\"20240926004421049\",\"parent\":\"Looking Under the Hood\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"So far, every time we have created a template to display some fields or other useful information about a tiddler, we have had to manually say in each tiddler that we wanted to display that template. For instance, in [[Ex:AddContactTemplates]], you added a `{{||ContactInformationTemplate}}` to every contact in your wiki. This is convenient when we only want to display the template in a few tiddlers, perhaps in different places, but if we want it at the start or end of every tiddler that matches some obvious criteria, it is boring, error-prone, and a waste of time. Let's look at a better way.\\n\\n!! Understanding the ViewTemplate\\n\\nSpeaking of templates, every time TiddlyWiki displays a tiddler in the story river, it uses a template to do so. There are two important templates for this purpose, the ViewTemplate and the EditTemplate. The ''ViewTemplate'' controls what displays when the tiddler is viewed, and the ''EditTemplate'' controls what displays after you click the edit button. Let's look at the ViewTemplate; the EditTemplate will work very similarly.\\n\\nIf you open up and edit $:/core/ui/ViewTemplate, you'll see something of a hornet's nest of filters. If you look closely at the end, though, you'll spot this bit:\\n\\n```html\\n<$list filter=\\\"[all[shadows+tiddlers]tag[$:/tags/ViewTemplate]!has[draft.of]]\\\" variable=\\\"listItem\\\">\\n  <$transclude tiddler=<<listItem>>/>\\n</$list>\\n```\\n\\nThis is beautiful, because it means most of the time we need not edit the ViewTemplate itself (and thus have to override a complicated shadow tiddler that could change in a future version of TiddlyWiki). Instead, we merely have to ''adjust the individual tiddlers'' tagged with `$:/tags/ViewTemplate` which define parts of the interface. Go ahead and find that tag in the ''Explorer'' and open it up. You'll see that it has a `list` field, to place the interface elements which appear when rendering a tiddler in a certain order (see [[Ordering Tiddlers]]). In a default installation as of TiddlyWiki 5.3.5, the list looks like this:\\n\\n* $:/core/ui/ViewTemplate/title\\n* $:/core/ui/ViewTemplate/unfold\\n* $:/core/ui/ViewTemplate/subtitle\\n* $:/core/ui/ViewTemplate/tags\\n* $:/core/ui/ViewTemplate/classic\\n* $:/core/ui/ViewTemplate/body\\n\\nWhat we need to do is define our own view tiddler and sneak it into the list wherever we want to display it. We can then transclude the `ContactInformationTemplate` within that view tiddler. (We could also simply tag the `ContactInformationTemplate` itself with `$:/tags/ViewTemplate`, but this would be less flexible, as we'll see in a moment.)\\n\\n!! Adding to the ViewTemplate\\n\\nLet's call our new tiddler `$:/yourname/TiddlerTypeTemplates/Contact`; this will leave space for us to add similar templates for other types of tiddlers. Drop in `{{||ContactInformationTemplate}}` there, add the `$:/tags/ViewTemplate` tag, remove `{{||ContactInformationTemplate}}` from all your contacts so the information isn't displayed twice, and you should be set.\\n\\nActually, there are two small problems. The first is that instead of a header `Information about JaneDoe`, the double exclamation point is ''literally appearing on each tiddler''. This is because the transclusion is starting in [[inline mode|Block Mode and Inline Mode]]. Unfortunately, this can be tricky to fix; I find the easiest way is begin with a block-level HTML element instead of wikitext, so here change the `!! title` to `<h2>title</h2>`. In this case, there's no way TiddlyWiki can parse it wrong; an `<h2>` simply cannot be an inline element, whereas `!!` can be since it could be part of some running text.\\n\\nThe second is that our contact information is now appearing ''even on tiddlers that aren't contacts''! Oops. Fixing this part is left as an exercise.\\n\\n!! Exercises\\n\\n{{Ex:ContactsOnlyOnContacts||ExerciseTemplate}}\\n{{Ex:MoveContactInformation||ExerciseTemplate}}\\n{{Ex:MeetingInformation||ExerciseTemplate}}\\n{{Ex:EditTemplateInformation||ExerciseTemplate}}\\n{{Ex:DontOverrideViewTemplateTag||ExerciseTemplate}}\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Tiddler Titles\":{\"title\":\"Tiddler Titles\",\"created\":\"20200603023508383\",\"description\":\"Carefully naming tiddlers and concepts has many benefits, but is often more art than science.\",\"modified\":\"20241014125221373\",\"parent\":\"Filing and Organizing\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"In the [[basic searching|Searching]] section, we mentioned that it was a good idea to include the keywords you're likely to search for in the titles of your tiddlers. So far I've just been giving you titles, so let's talk a bit more about what makes a good tiddler title.\\n\\n\\n!! The obvious\\n\\nSometimes your titles are going to be ''obvious''. For instance, in creating our [[contact tiddlers|Contact Tiddlers]], we made the tiddler titles the person's name. For the Employee Information System, which was a software application, the title was the name of the application. If you're creating a tiddler for something that already //has// a name, then you're probably in pretty decent shape just using that as a name.\\n\\nThere's one exception to that rule: if the name is ambiguous. For instance, if you're creating a tiddler for the technology company Apple, calling your tiddler simply `Apple` could be problematic: are you talking about the company, the [[original computer|https://en.wikipedia.org/wiki/Apple_I]] the company made, the fruit, the [[record label|https://en.wikipedia.org/wiki/Apple_Records]], or something else entirely? If your wiki focuses entirely on music or food, you're probably fine, but otherwise you might want to add an extra word or two to disambiguate.\\n\\n\\n!! Titles for knowledge tiddlers\\n\\nIn many cases, though, we want to create tiddlers that don't have a specific named thing associated with them. For instance, the [[project for our onboarding|Project Tiddlers]] probably does not have an official corporate name, nor does the [[meeting|Meeting Tiddlers]] at which Jane showed us how to use the information system, nor will a tiddler we create describing a new insight we came up with that might help us improve our process.\\n\\nWriting titles is tricky, as anyone who's stared at a blank sheet of paper or a computer screen trying to figure out what to call their essay or poem or book knows. But there's a great deal of value in getting them right. The popular academic-writing guide //They Say, I Say// describes titles as //metacommentary//, “a way of commenting on your claims and telling readers how and how not to think about them” (p. 127). It goes on to explain:\\n\\n> Thinking of a title as metacommentary can actually help you to develop sharper titles, leading you to write something that gives readers some sense of your argument rather than merely announcing your topic, or that it's an “English Essay” -- or having no title at all. Essays that bear no title send the message that the writer has simply not bothered to reflect on what he or she is saying.\\n\\nOf course, the audience for your wiki may be only yourself. This doesn't get you off the hook, though; as the old adage goes in computer programming, “There are always at least two people involved, you and you six weeks from now.” And having a good title not only makes it easier to find ideas, it actually makes it easier to //think// about ideas: once the tiddler is no longer fresh in your mind, looking at a good title still immediately gives you that “sense of the argument” therein, without having to look into the contents, and when you do look at the contents it frames your initial impression of it.\\n\\nFurther, we can only hold a small amount of information in our short-term memory at a time; if the title is clear enough to help us understand the idea, we can forget everything except the title, leaving us free to use that capacity to relate the title to other things.\\n\\nGiving your idea or note a title is coming up with a name for that thing. For more on the importance of naming things, check out my blog post, [[The Power of Names|https://controlaltbackspace.org/psychology/the-power-of-names/]]. Also, if you're of a technical bent, Andy Matuschak [[describes|https://notes.andymatuschak.org/Evergreen_note_titles_are_like_APIs]] note titles as ''idea APIs'' -- a way of referencing a complicated idea with a simple interface. \\n\\n!! In practice\\n\\nWe just spent the last few paragraphs describing //why// you should create good titles for things without obvious names, but not //how// to do it. The //how// is much more art than science, and it differs somewhat from wiki to wiki, but if you get in the habit of reflecting on what you're writing about as you create a title, you'll get better at choosing titles over time. That said, here are a few suggestions to help guide your experimentation:\\n\\n* Make sure that your tiddlers are really focused on a ''single idea''. If you have multiple ideas, you should have multiple tiddlers. This is an important skill to develop to get the most out of TiddlyWiki in general, but it's also quite helpful in producing titles. Scoping the title appropriately may make it easier to figure out what content goes in the tiddler, and vice versa.\\n* If a noun phrase (e.g., “Good keyboards” or “Benefits of using a good keyboard”) doesn't seem like it would describe the idea in the tiddler with sufficient precision, try ''making a claim'' instead (e.g., “Using a good keyboard makes injury less likely”).\\n* ''Avoid the word “not,”'' and negations in general, when possible; titles that state what is, rather than what is not, are easier to interpret and are less likely to result in overly broad tiddlers.\\n* If there are any ''keywords'' you know you'll be using when searching for this tiddler later, try including them in the title, as we noted in the [[Searching]] section.\\n\\n\\n!! Exercises\\n\\n{{Ex:NamingOldNotes||ExerciseTemplate}}\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Tiddlers\":{\"title\":\"Tiddlers\",\"created\":\"20200530170154864\",\"description\":\"Tiddlers are the unit of information in TiddlyWiki.\",\"modified\":\"20241013021525992\",\"parent\":\"The Shape of TiddlyWiki\",\"tags\":\"Section Concept\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Before we start creating our sample wiki, we need to go over a few concepts. I know, theory is boring and you want to get your hands on the software, so I'll just introduce five foundational concepts that we can't do without right now, and we'll fill in the rest as we need them.\\n\\n''Tiddlers'' are the unit of information in TiddlyWiki. If we didn't want to use a weird neologism, we might call tiddlers //notes//, or //cards//, or //records//, or //files//, or //pages//, or //articles//. However, tiddlers aren't quite like any of these things, so the designers concluded a word that doesn't carry any baggage from other information systems would ultimately be less confusing. (A tiddler is a kind of small fish -- thus the logo for //Grok TiddlyWiki//.)\\n\\nFor now, you can think of a tiddler as a 3×5 index card: a blank slate used to store a small amount of information. Even better, think of it as an [[edge-notched card|https://www.youtube.com/watch?v=v8qHPXPnQps]], an index card that can be mechanically sorted based on metadata punched out of the edges of the card. (In the mid-20th century, these were the height of sophistication for the amateur information geek, and they're still pretty cool even in the computer age!) Tiddlers can do much more complicated things than this, however, so in [[Slicing Up Content]] in chapter 2 we'll see a different, more conceptual metaphor which will be more helpful as we continue.\\n\\n<div style=\\\"text-align: center;\\\">\\n<$link to=\\\"edge-notched.jpg\\\">[img width=300 [edge-notched.jpg]]</$link>\\n<div>//A homemade edge-notched card system with vintage sorting needle and notching punch (click to expand). TiddlyWiki eliminates the [[chads|https://en.wikipedia.org/wiki/Chad_(paper)]], but it keeps alive the spirit of small units of information, non-hierarchical thinking, and easy sorting inherent in these systems.//</div>\\n</div>\\n\\nIn TiddlyWiki, ''everything is a tiddler'': content, configuration, plugins, {{Ltc:CoreCodeTiddlers||LieToChildrenTemplate}}. This means you get to use the same set of powerful tools for working with all these things. It's much like Unix's [[everything's a file|https://en.wikipedia.org/wiki/Everything_is_a_file]] philosophy, and it has the same benefits.\\n\\nThe way we slice our content up into tiddlers and relate those tiddlers to each other has a strong influence on both our patterns of thinking and the value of our notes. By slicing content into small, carefully defined tiddlers, we are able to reuse ideas and data in many more contexts than we could if they were organized like traditional notes, which makes not only our notes but also our thoughts more flexible. A substantial portion of the first two chapters will be spent on the question of how to slice up and relate tiddlers.\\n\\nThis section of the book, //Tiddlers//, is an example of a tiddler.\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\\n\"},\"Tips and Tricks\":{\"title\":\"Tips and Tricks\",\"caption\":\"8: Tips and Tricks\",\"created\":\"20210120034644865\",\"description\":\"In which we explore some bonus widgets, tips, tricks, and hacks that will serve you well on the rest of your TiddlyWiki journey.\",\"list\":\"[[Getting the Current Tiddler Right on Drafts]] [[Hiding and Showing Things]] [[Miscellaneous Widgets]] [[Working with Dates]] Qualification\",\"modified\":\"20241013010733962\",\"parent\":\"Outline\",\"tags\":\"Chapter\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"In this chapter, we'll explore a handful of additional widgets and techniques that may be useful on your TiddlyWiki journey.\\n\\n!! In this chapter\\n\\n{{||ChapterOutlineTemplate}}\"},\"Transclusion\":{\"title\":\"Transclusion\",\"caption\":\"4: Transclusion\",\"created\":\"20200603200642700\",\"description\":\"In which we study a variety of ways to write some content in one place and reuse it in many other places, a capability which sounds boring but is in fact incredibly powerful and versatile, setting TiddlyWiki apart from the competition.\",\"list\":\"Variables [[Using Variables as Attributes]] Procedures [[The Finer Points of Procedures]] [[Field Transclusions]] [[Templates and the Current Tiddler]] [[Filters and Transclusions]] [[Parameterizing Field Transclusions]] [[Conditional Expressions]] [[Summary of Transclusion Syntax]]\",\"modified\":\"20241002114116204\",\"parent\":\"Outline\",\"tags\":\"Chapter\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"TiddlyWiki is as powerful and flexible as it is because it allows you to [[slice up content|Slicing Up Content]] into small pieces -- often, but not always, [[Tiddlers]] -- and reuse them in many different contexts. But how do we actually go about reusing tiddlers or other pieces of wikitext in different contexts? So far we've seen that we can [[filter|Filters]] tiddlers into lists, but that's about as far as we've gotten.\\n\\nUltimately, what we need is a way to weave together wikitext from different sources into a single document. That process of including wikitext from other sources in a document is called ''transclusion'', and is the subject of this chapter.\\n\\nFirst, we'll talk about three ways we can transclude content: ''variables'', ''procedures'', and ''field transclusions''. Then we'll go over some more advanced ways to use field transclusions, as well as how transclusions of all kinds integrate with filters. Finally, we'll explore how you can include wikitext only if certain conditions are true, not every time.\\n\\nThis chapter is the core of the book and the core of TiddlyWiki. The features we discuss here, in one form or another, power most of the tools in TiddlyWiki that allow you to avoid repetitive work and customize your wiki to your liking. If you fully understand these three things and the way they integrate with the rest of TiddlyWiki, along with [[filters|Filtering and Formatting]], you'll be able to accomplish almost anything in TiddlyWiki.\\n\\nWhile the concepts in this chapter are, for the most part, not intrinsically complicated, there are a lot of details to internalize, and the way TiddlyWiki does things may be different enough from the way you're used to other apps doing things to be a bit confusing at first. So this chapter is packed with exercises, and it will likely take you somewhat longer than the previous chapters to work through.\\n\\n!! In this chapter\\n\\n{{||ChapterOutlineTemplate}}\"},\"Tweaking Your Settings\":{\"title\":\"Tweaking Your Settings\",\"created\":\"20200530195556288\",\"description\":\"A quick look at some of the TiddlyWiki options you're most likely to want to change.\",\"modified\":\"20241015000158183\",\"parent\":\"The Shape of TiddlyWiki\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"If you've been following along so far, you should be looking at a `GettingStarted` tiddler in your new wiki. Let's take a few minutes to personalize it so you have somewhere comfortable to work while you do the exercises in this book.\\n\\nStart by setting the title and subtitle to something interesting in the `GettingStarted` tiddler. You'll see them change immediately at the top of the sidebar as you do.\\n\\nYou may also wish to click the “retain story ordering” button, if only because this means you don't have to decide what tiddlers to open when you start the wiki. With this option on, anytime you start up the wiki, any tiddlers you had open when you closed it down will be reopened.\\n\\nClose out of `GettingStarted` and click the gear icon <<textual-button \\\"options-button\\\">> on the page toolbar to open the control panel. There are a //lot// of settings available here, and many of them are interesting, but once you get familiar with TiddlyWiki, they are mostly self-explanatory. Thus, we'll look at a handful that will improve our initial experience, and once you've gotten the hang of TiddlyWiki, you can come back and explore the other options.\\n\\n!! Info tab\\n\\n; Animation duration\\n: Maybe I'm just an impatient person, but I find that dragging animations out over 400&nbsp;ms (almost half a second) makes my wiki feel really laggy. If you decrease it too far, though, you'll get vertigo; I find 200--250 is a nice compromise. To test values, create a new tiddler using the add button <<textual-button \\\"new-button\\\">> on the page toolbar, then close the new tiddler with the cancel button <<textual-button \\\"cancel-button\\\">> in its upper-right, and observe the speed and subjective experience of watching it open and close. Rinse and repeat until you find something comfortable.\\n\\n!! Appearance tab\\n\\n; Palette tab\\n: Pick a color scheme you like. I like to give each of my wikis a different one so I can quickly tell them apart if I have several open at once.\\n\\n; Toolbars tab/View Toolbar\\n: Tick the box next to //info//. The info button is really useful, and if it's hidden in the “more” menu when you're starting out, you may not remember it's even there!\\n\\n; Theme Tweaks tab\\n: If you have a large screen, you'll likely want to increase the amount of space allocated to the story river compared to the sidebar, or most of the space on your screen will be wasted. The easiest way is to change //Sidebar layout// to //Fluid story, fixed sidebar//. Unfortunately, this often makes the story river too wide (extremely long lines [[are much harder to read|https://practicaltypography.com/line-length.html]]), so you may want to increase the //Sidebar width// as well to compensate.\\n\\n!! Settings tab\\n\\n; Camel Case Wiki Links\\n: This setting is very divisive! For many years it was on by default; recently it changed to being off by default. With the setting on, text RunTogetherLikeThis will automatically become a link. There are advantages to both choices, and I have the setting on in some wikis and off in others. See the [[CamelCase]] appendix for details. Because I generally like camel-case for personal notes, and because there are a few gotchas with CamelCase that are worth learning about if you want to build a complete understanding of TiddlyWiki, we'll turn it on for our sample wiki.\\n\\nChanging the CamelCase option requires you to ''reload the page'' in your web browser to see the effect, so go ahead and save your wiki and reload the page now.\\n\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Updated Summary of Transclusion Syntax\":{\"title\":\"Updated Summary of Transclusion Syntax\",\"created\":\"20240928013458182\",\"description\":\"Review all the syntax used for reusing and relating content in TiddlyWiki.\",\"modified\":\"20241010130015429\",\"parent\":\"Macros, Wikification, and Widgets\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"At the end of chapter 4, we threw together a [[Summary of Transclusion Syntax]]. Since then, we've added functions, macros, and data tiddlers, so there's a little more syntax to add. Here's an updated version.\\n\\nYou can find a condensed version of this section in the [[Wikitext Reference]], which also has some live examples you can play with.\\t\\n\\n{{CommonTransclusionSyntax|second}}\"},\"Upgrade\":{\"title\":\"Upgrade\",\"created\":\"20210407135618740\",\"modified\":\"20241019231514534\",\"tags\":\"Fragment\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"To update an old copy of //Grok TiddlyWiki// to this version without losing your takeaway progress and other customizations, drag the following links into your wiki: <$link to=\\\"$:/plugins/sobjornstad/GrokTiddlyWiki\\\"><$text text={{{ [[Grok TiddlyWiki version ]addsuffix{Metadata##version}] }}}/></$link>; <$link to=\\\"$:/plugins/sobjornstad/TakeAway\\\"><$set name=\\\"ta-version\\\" value={{{ [[$:/plugins/sobjornstad/TakeAway]get[version]] }}}><$text text={{{ [[TakeAway version ]addsuffix<ta-version>] }}}/></$set></$link>; <$link to=\\\"$:/plugins/sobjornstad/TiddlyRemember\\\"><$set name=\\\"tr-version\\\" value={{{ [[$:/plugins/sobjornstad/TiddlyRemember]get[version]] }}}><$text text={{{ [[TiddlyRemember version ]addsuffix<tr-version>] }}}/></$set></$link>. Sections, takeaways, exercises, and any other tiddlers that you have changed will be untouched during an upgrade.\\n\\n''Please note'': If your old wiki is from a //Grok TiddlyWiki// version less than 2.0, you should first ''upgrade its TiddlyWiki version'' at https://tiddlywiki.com/upgrade. The current version of GTW requires a newer version of TiddlyWiki to work than was bundled with those older GTW versions, so your wiki will look broken if you aren't on the latest TiddlyWiki.\"},\"UsHolidays\":{\"title\":\"UsHolidays\",\"text\":\"01/01: New Year's Day\\n07/04: Independence Day\\n10/31: Halloween\\n12/25: Christmas Day\",\"type\":\"application/x-tiddler-dictionary\",\"created\":\"20240924001540519\",\"modified\":\"20240924002517771\",\"tags\":\"\"},\"Useful Plugins\":{\"title\":\"Useful Plugins\",\"created\":\"20201121233242024\",\"description\":\"A collection of particularly essential or interesting community plugins.\",\"modified\":\"20240929215641304\",\"parent\":\"Appendices\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"This section collects some plugins I find particularly useful that you may want to check out as well. There are //many// more out there, and, as we've seen, [[you can write your own|Creating Plugins]].\\n\\n* [[Auto Complete|https://evidentlycube.github.io/TW5-PluginShowcase/#Auto%20Complete]] -- allows custom autocomplete menus while typing in a tiddler's wikitext, populated by filters on things in your wiki\\n* CodeMirror (find in the official plugins repository in //Control Panel > Plugins//) -- improves the text editor embedded in the edit view of TiddlyWiki with things like find-and-replace and keybinding sets to match popular editors like Emacs and Vim.\\n* Highlight (find in the official plugins repository) -- syntax highlighting on code blocks.\\n* KaTeX (find in the official plugins repository) -- insert mathematical notation and formulas between `$$double dollar signs$$` in your wiki.\\n* [[kin filter|https://bimlas.github.io/tw5-kin-filter/]] -- allow finding tagged or linked items anywhere in a multi-level hierarchy. Like `tags[]`, `links[]`, etc., but more powerful.\\n* [[TiddlyTables|http://tiddlytables.tiddlyspot.com]] -- create pretty dynamic, interactive tables with less fussing with HTML\\n* [[Shiraz|https://kookma.github.io/TW-Shiraz/]] -- adds Bootstrap CSS classes to TiddlyWiki for pretty formatting.\\n* [[Relink|https://flibbles.github.io/tw5-relink/]] -- allows updating all references to a tiddler when renaming it; almost essential in large wikis where things change frequently.\\n* [[TiddlyRemember|https://sobjornstad.github.io/TiddlyRemember/]] -- transfer the most important parts of your notes into your brain by writing flashcards in your wiki and syncing them to [[Anki|https://apps.ankiweb.net/]]. The TakeAway tools in this book are built on TiddlyRemember.\\n* [[Date Picker|http://kixam.github.io/TW5-datePicker/]] -- to create fields that allow easily selecting dates and times, rather than manually typing in dates in TiddlyWiki's weird format.\\n\\nThe [[TiddlyWiki Central Plugin Library|https://tiddly-gittly.github.io/TiddlyWiki-CPL/#Index:Index]] is a community attempt to gather unofficial plugins into a convenient location.\\n\\nDavid Gifford's [[TiddlyWiki Toolmap|https://dynalist.io/d/zUP-nIWu2FFoXH-oM7L7d9DM]] and the community [[TiddlyWiki Links Aggregator|https://links.tiddlywiki.org/]] are other brilliant resources for finding plugins and other TiddlyWiki-related tools.\"},\"Using Filter Expressions\":{\"title\":\"Using Filter Expressions\",\"created\":\"20200603023508416\",\"description\":\"Filter expressions, runs, and steps work together to select tiddlers.\",\"modified\":\"20210818203650408\",\"parent\":\"Filtering and Formatting\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"So that's what [[filters|Filters]] //are//…now what do they look like, and how do we use them?\\n\\nFilters, or, more formally, ''filter expressions'', consist of one or more ''filter runs'', which each contain one or more ''filter steps''. For now, we'll only worry about filter expressions containing a single run -- you'll be able to accomplish most basic tasks without needing multiple runs. However, know that individual runs [[can be combined in various ways|Multi-Run Filters]] to form a more complex filter expression, and we'll discuss this further in chapter 5.\\n\\nIf you've ever used any shell language (Bash, MS-DOS, PowerShell, etc.) -- or even if you haven't -- you can think of a filter run as a ''pipeline''. You put a list of tiddlers into the left end of the pipeline; unless you say otherwise, {{Ltc:AllTiddlersInTheLeft||LieToChildrenTemplate}} go in the left end. The tiddlers then pass from left to right through a series of steps in the pipeline. Each step can remove tiddlers from the list that don't match some criteria, generate and output a new list of tiddlers based on the existing list, or ignore the existing list and spit out an entirely new list. The next step then gets to make its own changes to the list output by this step, and so on until we come to the right side of the pipeline and the output of the last step is the result of the filter run.\\n\\nHere are some very simple filter expressions. Each of them has just one run containing one step:\\n\\n* `[title[JaneDoe]]` -- this returns the tiddler `JaneDoe`\\n** This is such a common usage that you can leave out the word `title`, resulting in just `[[JaneDoe]]`.\\n* `[tag[Contact]]` -- this returns all tiddlers tagged `Contact`\\n* `[links[]]` -- this returns all the tiddlers that have been linked to by any tiddler in your wiki\\n\\n\\n!! Trying some filters\\n\\nLet's try using some of these filters. To do so, open Advanced Search <<textual-button \\\"advanced-search-button\\\">>. You can find this option in the ''Tools'' tab in the sidebar or next to the search box, or you can press Ctrl+Shift+A. Then pick the ''Filter'' tab and type in one of the expressions above. You'll see a list of the tiddlers that match.\\n\\nIf you try the last filter listed above, `[links[]]`, you might notice a whole bunch of funny-looking tiddlers show up, with names starting with `$:/`. What's up with those? Those are [[system tiddlers|System Tiddlers]]; they contain configuration settings or bits and pieces of TiddlyWiki itself. If you don't want to see the system tiddlers, add `!is[system]` to the beginning of the filter run to eliminate them (read `!` as //not//). So that will look like `[!is[system]links[]]`.\\n\\nLet's look at that one again: `[!is[system]links[]]`. This run has two steps: first we eliminate all tiddlers that are system tiddlers (alternatively, you could choose to think of it as “keep all tiddlers that are not system tiddlers”), then we look at each of the tiddlers in that reduced list and spit out all of the tiddlers it links to.\\n\\n!! Common mistakes\\n\\nFilter expressions are quite sensitive to minor mistakes in punctuation. Once you've become familiar with the most common mistakes, spotting and fixing them will be trivial, but at first they may be extremely frustrating. These three errors are particularly common:\\n\\n* ''Forgetting the outer set of square brackets'', which define a filter run. Just `tag[Contact]`, for instance, is not a valid filter expression, as it consists of a single filter step, not a complete filter run. If you see the text //Filter error: Missing [ in filter expression// instead of the list of tiddlers you expected, this is likely your problem.\\n* ''Including the opening square bracket but not the closing one''. For some runs, the filter expression may //look// symmetric even if all the brackets haven't been closed yet (for example, `[tag[Contact]`). A useful habit to develop is inserting both the left and the right square bracket whenever you come to a left square bracket, then pressing the left arrow key to put the cursor back between them -- this way, you won't have to remember how many brackets need to be closed.\\n* ''Putting a space between filter steps'', like <code>[!is[system]&nbsp;links[]]</code>. What this actually does is filter on the values of the [[field|Fields]] called ` links` (a space followed by the word //links//). Unless that is actually what you want, leave out the space.\\n\\n!! Exercises\\n\\n{{Ex:CreatingBasicFilters||ExerciseTemplate}}\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\\n\"},\"Using Variables as Attributes\":{\"title\":\"Using Variables as Attributes\",\"created\":\"20240616152105208\",\"description\":\"You can use the value of a variable as the value of an HTML or widget attribute, although there are additional complications.\",\"modified\":\"20241008024108297\",\"parent\":\"Transclusion\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"In the [[previous section|Variables]], we saw how we can transclude the values of variables within running text. We can also use variables within other formatting instructions -- as the ''values of attributes'' on widgets or HTML tags.\\n\\nWe already did this once already in the [[link pattern|Ex:LinkPattern]] exercise in [[Your First Dynamic List]], before we had explained that `<<currentTiddler>>` was a variable:\\n\\n```html\\n<$link to=<<currentTiddler>>/>\\n```\\n\\nIn a basic sense, using variables as attribute values is no different than using them elsewhere. However, there are some pitfalls for the unwary when it comes to mixing variables and other wikitext elements. Fully elucidating all of these requires much more understanding of TiddlyWiki, so we'll start by covering the most basic issues in this section and postpone the rest until later.\\n\\n\\n!! Multiple links to the same place\\n\\nSuppose we want to link to the Wikipedia homepage multiple times. If we want the same text on the link each time, we can simply put the wikitext needed to create the link in a variable and transclude it several times, like this:\\n\\n{{Sn:WikipediaWikitext||MagicSnippet}}\\n\\nBut what if we want to use different text for the link each time? You might try this:\\n\\n{{Sn:WikipediaBadWikitext||MagicSnippet}}\\n\\nUnfortunately, transclusions ''can't be nested inside other complex wikitext elements like links'', so this doesn't work. If you try clicking on one of the links in the example above, you'll see that TiddlyWiki produces a link to the tiddler literally called `<<wp>>`, which isn't very helpful!\\n\\nHowever, you //can// transclude a variable ''into the value of an attribute''. So an easy solution is to use an `a` HTML element instead of wikitext syntax (recall that all items of wikitext syntax have corresponding [[widgets|Widgets]] or [[HTML]] tags). This element takes the URL to link to in its `href` attribute and the text to display in its body. (`href` stands for //hypertext reference//, and `a` for //anchor//.)\\n\\n{{Sn:WikipediaAElement||MagicSnippet}}\\n\\nThe space between the `>>` closing the variable transclusion and the `>` closing the tag is not required, but many people find it makes the wikitext more readable.\\n\\nDepending on the [[palette|Tweaking Your Settings]] you have selected, you may notice that links to external sites that use the `a` tag are a different color than is usual in your wiki. If this bothers you, add the attribute `class=\\\"tc-tiddlylink-external\\\"` to the `<a>` tag, which will tell TiddlyWiki to use the same styling that it would if you created an external link with `[[double square brackets]]`.\\n\\n\\n!! Multiple links to different Wikipedia articles\\n\\nThe previous example may be functional, but it's a bit academic -- how often do you want to link to the same web page multiple times?\\n\\nHere's a more useful idea. Wikipedia article URLs have a very predictable format: for an article named `Article Name` in the English encyclopedia, the URL looks like `https://en.wikipedia.org/wiki/Article Name`. The only part that ever changes is the name of the article. Can we use a variable to hold the part of the URL that doesn't change? Then we could produce a working link to any article given only its title.\\n\\nThe most obvious thing to try would be:\\n\\n{{Sn:WikipediaCombinedVarSubst||MagicSnippet}}\\n\\nThat looks OK, but if you click on the link you'll find that it goes to a page called `<<wpBase>>/Aardvark`, which obviously isn't what we wanted.\\n\\nMaybe the transclusion needs to go outside the quotation marks?\\n\\n{{Sn:WikipediaCombinedVarSubst2||MagicSnippet}}\\n\\nUh-oh!\\n\\nIt turns out that we need an entirely new syntax to achieve this. We can use //just// a transclusion as the value of an attribute by writing it directly after the `=`, as we did earlier in this section. Or we can use //just// a constant value (one with no variables) by placing it in `\\\"double quotation marks\\\"` after the `=`. But if we need to //combine// a constant value and one or more variables, as we do here, we need to use a ''substituted attribute value'', which looks like this:\\n\\n{{Sn:WikipediaSubAttrValue||MagicSnippet}}\\n\\nThose funny <code>&#96;</code>'s are called ''backticks''. On a standard US keyboard, you can find the backtick (also called the //grave accent//) to the left of the 1 key. Other keyboards have it in weirder places or even on the AltGr layer; you may have to do a quick web search to learn how to type it on your keyboard.\\n\\nWithin a substituted attribute value, the syntax `$(wpBase)$` refers to the value of the variable `wpBase`. The way in which this differs from `<<wpBase>>` is somewhat arcane, so we'll hold off on discussing it until we learn about [[macros|Macros]] in <<gtw.link-chapter-number \\\"Macros, Wikification, and Widgets\\\">>. For now, suffice it to say that you should refer to the values of variables with this `$()$` syntax within substituted attribute values.\\n\\n\\n!! Exercises\\n\\n{{Ex:ContactLinks||ExerciseTemplate}}\\n{{Ex:ProcedureAdjacency||ExerciseTemplate}}\\n\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Variables\":{\"title\":\"Variables\",\"created\":\"20200530170346174\",\"description\":\"Variables let you assign a name to an arbitrary value, then use the name in place of the value in multiple places within your wikitext.\",\"modified\":\"20240928203320411\",\"parent\":\"Transclusion\",\"tags\":\"Section Concept\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"''Variables'' are the simplest way to define some wikitext in one place and refer to it in many places.\\n\\n!! How variables work\\n\\nA variable has a ''name'', which is how you refer to the variable, and a ''value'', which is the other piece of wikitext that it stands in for.\\n\\nAs a silly example, let's suppose corporate requires us to include a disclaimer at the end of every paragraph we write:\\n\\n> (This paragraph does not represent the formal opinion of my company.)\\n\\nWe can make this text into a variable using a ''`$set` widget'', like this:\\n\\n{{Sn:SetDisclaimer||MagicSnippet}}\\n\\nAs you can see in the example above, the `$set` widget doesn't itself display anything in the rendered version of your tiddler. However, in between the `<$set>` tags, TiddlyWiki will keep track of the fact that the variable with name `disclaimer` is set to the stated value. (Once we pass the closing `</$set>` tag, TiddlyWiki will forget about the variable. When this happens, we say that the variable has ''gone out of scope''.)\\n\\nIn order to actually use the variable, we put its name between double angle brackets `<<>>` in the spot where we want its value to show up; this is called ''transcluding the variable's value''. Let's edit our `EmployeeInformationSystem` tiddler to use this disclaimer:\\n\\n{{Sn:EmployeeInformationSystemDisclaimer||MagicSnippet}}\\n\\nCopy this into your version of the tiddler, and you should see the disclaimer appear in the rendered output at each spot where `<<disclaimer>>` appears in the wikitext.\\n\\n\\n!! The `$let` widget\\n\\nThe `$set` widget is the most powerful way to set variables, offering [[a number of different options|https://tiddlywiki.com/#SetWidget]] which you can read about in the documentation. However, the syntax is rather verbose for many purposes -- the words `name` and `value` are clutter, and if you want to set multiple variables, you'll need multiple `$set` widgets.\\n\\nFor cases where you don't need any fancy options, the `$let` widget allows you to concisely set as many `name=value` pairs as you want:\\n\\n{{Sn:EmployeeInformationSystemDisclaimerLet||MagicSnippet}}\\n\\nWe'll primarily use the `$let` widget to set variables throughout the rest of the book.\\n\\n\\n!! Why use variables?\\n\\nEliminating repetition can save typing, which is nice but hardly anything to write home about. Much more importantly, if you want to change a snippet after you create it, ''you only have to change it in one place''. If you only use the snippet a couple of times, changing it in multiple places is no big deal, but there might be some things you end up using dozens or hundreds of times throughout your wiki. And sometimes a full wikitext snippet will be many lines long and easy to mistype, while a variable transclusion is short, concise, and easy to understand.\\n\\nAdditionally, some variables are ''set automatically by TiddlyWiki'', which can allow you to access information you otherwise wouldn't have. For instance, when we created a list widget to show all our meetings in the previous chapter, TiddlyWiki automatically set the `<<currentTiddler>>` variable to refer to the item which was currently being processed by the list widget.\\n\\nIn the real world, you will use [[procedures|Procedures]] or [[field transclusions|Field Transclusions]] more often than simple variables when you want to use some wikitext in many places throughout your wiki. But all three of these mechanisms serve the same basic purpose -- avoiding repetition -- and offer the same benefits discussed here.\\n\\n!! Exercises\\n\\n{{Ex:UpdatingDisclaimer||ExerciseTemplate}}\\n{{Ex:EisVariable||ExerciseTemplate}}\\n{{Ex:EisLet||ExerciseTemplate}}\\n{{Ex:SpacedVariable||ExerciseTemplate}}\\n{{Ex:VariableAfterSet||ExerciseTemplate}}\\n{{Ex:NestedSets||ExerciseTemplate}}\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Welcome to Grok TiddlyWiki\":{\"title\":\"Welcome to Grok TiddlyWiki\",\"created\":\"20210110055215195\",\"description\":\"An overview of the book and where you should get started.\",\"modified\":\"20241019230512540\",\"parent\":\"Front Matter\",\"tags\":\"Index Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Welcome to ''Grok TiddlyWiki'', the definitive TiddlyWiki learning resource! //Grok TiddlyWiki// is a textbook that helps you build a deep, lasting understanding of and proficiency with TiddlyWiki through a combination of detailed explanations, practical exercises, and [[spaced-repetition reviews|TakeAway Help]] of prompts called //takeaways//.\\n\\n[[TiddlyWiki|https://tiddlywiki.com]] is a human-shaped tool for organizing information and taking notes. It stores and relates information in a non-linear but structured way, just like your brain, and it doesn't forget things. Maintaining a well-organized TiddlyWiki requires a modest amount of effort, and TiddlyWiki has a bit of a learning curve, but it's extremely powerful and customizable, and once you grok it, it will change the way you take notes, think about your work and your ideas, and relate to information in general.\\n\\nTiddlyWiki shines at almost any task that involves organizing information and enabling creativity. People use TiddlyWiki for keeping notes at their jobs, collecting their ideas, keeping track of what they read, drafting books, building static websites, storing recipes, managing genealogical databases, planning tabletop role-playing campaigns, and much more.\\n\\nTo [[grok|https://en.wikipedia.org/wiki/Grok]] something is to understand it on a deep level, so thoroughly that it changes you and becomes part of your identity. This word is particularly appropriate when discussing TiddlyWiki, since its method of organizing information may well change the way you understand and relate to information in general.\\n\\n\\n!! Where do I start?\\n\\n* If you aren't sure if TiddlyWiki is for you yet, check out [[Why TiddlyWiki?]]\\n* If you know you want to learn TiddlyWiki but don't know if you want to learn from this book, read about the [[Philosophy of Grok TiddlyWiki]] to see if it seems like a good fit for you.\\n* If you're already partway through the book, or you want to see what topics are covered, visit the [[Outline]] or click the //Contents// tab in the sidebar.\\n* If you're ready to get started, start at [[How to Use This Book]], or, if you're feeling impatient, at [[The Shape of TiddlyWiki|The Shape of TiddlyWiki]].\\n\\n\\n!! How much does it cost?\\n\\n//Grok TiddlyWiki// is free to read. You are also free to copy and share the book under certain conditions, pursuant to the CC BY-NC-ND 4.0 license; please see the [[copyright notice|Copyright]] for details on the terms and conditions.\\n\\nThat said, I have spent hundreds if not thousands of hours writing and updating this book over the years, and it's an ongoing project, since TiddlyWiki is an evolving application. Creating a quality learning resource is not an easy undertaking. So if you read the book and find it helpful, and you have the means to do so, ''please consider donating'' to support my work and ensure I can continue doing this. You can give whatever you think the book is worth to you, from $5 to $100.\\n\\n<a href={{$:/sib/DonationLink}} class=\\\"tc-tiddlylink-external\\\">Donate here</a>, or use the //donate// link in the sidebar.\\n\\nYou can find other suggestions for helping out both //Grok TiddlyWiki// and the TiddlyWiki project in the [[Support Us]] appendix.\\n\\n\\n!! Who made this? How do I get in touch?\\n\\n//Grok TiddlyWiki// is written and maintained by Soren Bjornstad ([[about|https://sorenbjornstad.com]]; [[blog|https://controlaltbackspace.org]]; [[public notes|https://mosmu.se]]; [[contact|https://sorenbjornstad.com/contact]]). The TiddlyWiki project [[considers GTW|https://tiddlywiki.com/#%22Grok%20TiddlyWiki%22%20by%20Soren%20Bjornstad]] “highly recommended” for learners, and I am an active participant in the TiddlyWiki community.\\n\\nYou can send me feedback on any section by clicking the //send feedback// link at the bottom of that section. Also feel free to email me with general questions, problems, or suggestions (see //contact// link above). Thanks [[to everyone|Acknowledgments]] who has offered feedback and other forms of assistance at every stage of //Grok TiddlyWiki//'s development.\\n\\nIf you're looking for one-on-one help learning TiddlyWiki or getting a wiki set up, I am occasionally available for online tutoring for an hourly fee; [[contact me|https://sorenbjornstad.com/contact]] if that sounds like something you might be interested in.\\n\\n\\n!! What version is this?\\n\\n|!Book version |{{Metadata##version}}|\\n|!TiddlyWiki version |{{Metadata##tw-version}}|\\n\\nEvery time I publish a new version of //Grok TiddlyWiki//, I increase the book's version number. To see what's changed in recent versions, visit [[Changes]]. You can always find the latest version at {{Metadata##project-url}}.\\n\\nThe TiddlyWiki version indicates which version of TiddlyWiki this version of //Grok TiddlyWiki// expects you to have; I try to keep it up to date with the newest version, but if I'm behind, it should be fine to use a newer version of TiddlyWiki than listed here. In contrast, using an older version than listed might mean some things the book tells you to do mysteriously don't work, so that's not a good idea! If you have an older version in a wiki you're already using, you can visit the [[TiddlyWiki Upgrader|https://tiddlywiki.com/upgrade.html]] to update that wiki to the latest version.\\n\\nThis is the second major version of //Grok TiddlyWiki//, aligned with TiddlyWiki 5.3.5+. Recent versions of TiddlyWiki have added major new features such as [[Procedures]], [[Functions]], and [[Custom Widgets]], to replace older features which were more difficult to learn and had more gotchas, such as [[Macros]]. This means that significant portions of GTW have been rewritten or reorganized because the recommended approach to reusing wikitext has changed. If you've used older versions of TiddlyWiki, you may wish to work through <<gtw.link-chapter-number \\\"Transclusion\\\">> and <<gtw.link-chapter-number \\\"Macros, Wikification, and Widgets\\\">>, as well as the [[Functions]] section in <<gtw.link-chapter-number \\\"More Organizational Tools\\\">>, to get up to speed on these newer tools.\\n\\n{{Upgrade}}\\n\\nYou can find the book's source [[on GitHub|https://github.com/sobjornstad/grok-tiddlywiki]]. But basically everything is in the file you're looking at already, because it's TiddlyWiki!\"},\"When Things Go Wrong\":{\"title\":\"When Things Go Wrong\",\"created\":\"20210120014333991\",\"description\":\"As your wikitext gets more complicated, it occasionally might not do what you were expecting; here's how you can figure out what you did wrong.\",\"modified\":\"20241015032547270\",\"parent\":\"Filtering and Formatting\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"<<<\\nError messages can be terrifying when you aren't prepared for them; but they can be fun when you have the right attitude. Just remember that you really haven't hurt the computer's feelings, and that nobody will hold the errors against you.\\n\\n---Donald Knuth, //The TeXbook//\\n<<<\\n\\nIn this chapter, we started looking at some more complicated features of [[wikitext|Wikitext]]. The more complicated wikitext gets, the more likely you use it incorrectly by mistake. So before we finish out the chapter, let's talk briefly about what to do when some wikitext you're writing doesn't do what you think it should. (Programmers would say you need to ''debug'' your wikitext.)  TiddlyWiki, like all software, is pretty fussy: if you leave out a period in the wrong spot, you might get a totally different effect than the one you intended. As you continue to work on the exercises and with your own wikis, you will no doubt run into problems on occasion.\\n\\nFinding the errors will get easier as you learn more about TiddlyWiki. You'll get much faster at spotting minor syntax mistakes, and you'll have a deeper understanding of how TiddlyWiki works, so you'll be able to think through why something might not work. I also try to call out some of the most common errors in exercises and takeaways throughout the book, with the hopes that you'll be able to learn about at least a few of the errors ahead of time instead of through the school of hard knocks. In the meantime, let's look at some cognitive tools for working through problems when your prior experience fails you.\\n\\n\\n!! Use the scientific method\\n\\nIf you ever find yourself unsure how something works, try it! Devise and carry out a simple ''experiment'' that will answer the question. And take a page from science and isolate the single variable that you're wondering about. If you're not sure how a `$list` widget behaves, don't test it in the middle of a three-page-long tiddler with a complicated filter; copy and paste the widget you're having trouble with into a new tiddler by itself, simplify the filter to `[tag[MyTestTag]]` (adding that tag to a couple tiddlers if necessary), and explore from there. Once you've answered the question, you can bring your new understanding back to your original problem.\\n\\nSimilarly, consider ''splitting complex tasks into pieces'' and making sure that each piece is correct before proceeding to the next. That way, if everything doesn't work perfectly, it will be much more obvious where to look for the problem. If you're trying to use a `$list` widget, get your filter working in $:/AdvancedSearch before trying to use it in the widget. Then make sure the content of your widget looks right by itself, and only then wrap it in the `$list` widget and change the content to pick up the `<<currentTiddler>>` from the `$list` widget.\\n\\n\\n!! Talk to the duck\\n\\nGrab a rubber duck or some similar object and put it in front of your monitor. Your task is to ''explain what you're trying to do, from the beginning, to the duck''. The duck has a basic understanding of what TiddlyWiki is, so you don't have to try to explain, e.g., what a web browser or a tiddler is, but the duck still knows much less than you do, being a duck, so you should explain thoroughly and without leaving out any steps.\\n\\nThis works because, after looking at some wikitext for a while, we start to see each part of the wikitext as doing what we think it //should// do, or what we //meant// it to do, rather than what it's actually doing. Having to start the explanation over and go through it in detail means we're more likely to see where the reality doesn't align with our perception.\\n\\nYou can always talk to a real person instead, whether they know anything about TiddlyWiki or not – but a rubber duck is surprisingly functional and doesn't require you to find someone to bother, so there's less friction involved in trying this technique with an inanimate object.\\n\\n\\n!! Use your web browser's inspector\\n\\nIf something isn't displaying on the screen the way you expect, you might be able to spot what's going wrong by ''taking a closer look at the HTML source'' of the page. However, the standard “view source” option that we used in the [[Ex:ViewSource]] exercise in the [[HTML]] section won't work well here. For one, “view source” doesn't convert wikitext to HTML, so you can only get part of the picture. For another, the source for an average TiddlyWiki could be dozens or hundreds of pages long, and we hardly want to scan through it to find the spot on the page that's not working.\\n\\nThere's a better way: if you right-click anywhere on the page in TiddlyWiki, there will be an //Inspect// option (in some browsers, this may be within a submenu called //Developer Tools//). Choosing this option will open another window to the side of your wiki, which will let you explore the HTML of the page.\\n\\nNow, simply click the pointer icon in the far top-left corner of the inspector and hover the mouse over the area on the page exhibiting the problem. You'll see each area on the page highlighted as your cursor moves over it; each highlighted area represents an HTML element. When you find an element related to your problem, click and the relevant HTML will be highlighted in the inspector window. Taking a close look at the HTML generated by your wikitext may make the problem obvious.\\n\\n\\n!! Display the values of variables\\n\\nIn the next chapter, we'll start discussing [[variables, procedures, and field transclusions|Transclusion]]. Oftentimes you will use variables, procedures, and field transclusions as part of widgets or filters (for instance, you might use the value of a variable in a filter). If your widget or filter isn't working right and you are at all uncertain about what's in the variable, try ''using the variable by itself in your wikitext'' and see what shows up in the preview. If the variable's value is wrong, investigating how it got set to the wrong value will likely point you to the problem.\\n\\nSometimes putting a variable directly in your wikitext might mess up the formatting in a way that makes the issue harder to understand. In this case, you can use the ''`$log` widget'' instead. This widget doesn't put anything into the rendered output of the tiddler -- instead it puts output into your ''browser console'', a hidden log that you only see when you open the developer tools. For instance, paste this into a tiddler in your test wiki:\\n\\n```html\\n<$log X=\\\"Y\\\"/>\\n```\\n\\nIf you now open the page inspector, as discussed in “Use your web browser's inspector,” above, and click the //Console// tab, you should see a table showing that the value of X is Y. Every time the tiddler re-renders, the value is logged again.\\n\\n[img[xy.png]]\\n\\nIn real life, you'll typically put a variable in place of `\\\"Y\\\"` (once you learn what that is in the next section!), which will look something like this:\\n\\n```html\\n<$log X=<<myvariable>>/>\\n```\\n\\nSee [[more details|https://tiddlywiki.com/#LogWidget]].\\n\\n!! Take a break\\n\\nIf you start getting frustrated, ''step away from the computer'' for ten to twenty minutes. Ideally, go outside and take a walk, and don't think about the problem at all for at least five minutes; let your mind wander. You'll often have solved the problem by the time you get back, and even if you haven't, you'll be less frustrated and more likely to spot mistakes.\\n\\n\\n!! Ask for help\\n\\nIf you really run out of ideas, you can ask the TiddlyWiki community for assistance; see [[Getting Help]] to learn how.\\n\\n\\n!! Exercises\\n\\n{{Ex:InspectSquare||ExerciseTemplate}}\\n{{Ex:RubberDucking||ExerciseTemplate}}\\n{{Ex:LogWidget||ExerciseTemplate}}\\n\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\\n\"},\"Why TiddlyWiki?\":{\"title\":\"Why TiddlyWiki?\",\"created\":\"20200531034640143\",\"description\":\"What makes TiddlyWiki worth learning and using?\",\"modified\":\"20241013011655463\",\"parent\":\"Front Matter\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"There are a lot of tools for taking notes and storing information out in the world, and most of them are easier to learn than TiddlyWiki. So you might ask, why should you care? What makes TiddlyWiki good enough that it's worth working through a textbook to learn?\\n\\nBecause TiddlyWiki offers an entirely new way of thinking -- there's a reason this book is called //Grok TiddlyWiki//, and it's not just because [[grok|https://en.wikipedia.org/wiki/Grok]] is a fun word -- the benefits often appear underwhelming to those who haven't experienced it (see [[tools for thinking don't wow|https://mosmu.se/#ToolsForThinkingDontWow]]). Shortly after I published the first edition of this book, someone asked me what TiddlyWiki was, and I [[was embarrassed to realize|https://ap.sorenbjornstad.com/#post-70]] I couldn't even explain that! \\n\\nHowever, while it may be difficult to explain in a couple of sentences, a few short sections can give a nice idea of the flavor.\\n\\n!! Talking points\\n\\n{{$:/plugins/sobjornstad/TakeAway/ContextualHelp/DetailsWidget}}\\n\\n<$details summary=\\\"Works like you think\\\">\\n\\nTraditional information-management systems, both paper and digital, encourage or require you to put notes into “boxes” of one kind or another: notebooks, pages, categories, hierarchies. Notes, once added, stay static, stuck in the same place and time forever, so they quickly get out of date and you forget about them.\\n\\nCategories and hierarchies are sometimes unfairly maligned. In reality, they are powerful supplemental tools for thinking; sometimes, in order to think about a topic, we need to add additional order to a set of ideas to [[reduce them to a level of complexity we're capable of thinking about|https://mosmu.se/#InformationalJig]], and these tools give us that ability. But as a general-purpose organization method, these tools are terrible: they prevent ideas from being effectively used outside their original context and force us to collapse distinctions that we might prefer to maintain. For notes to reach their full potential, we need to allow them to relate in a greater variety of ways. Further, we don't naturally think in hierarchies except when we are tackling a specific problem; we think in links and webs of ideas.\\n\\nIf you doubt that we don't think in hierarchies, try this. Think of the color white. You can take this idea in an almost infinite number of directions with no effort at all: What are some white things? What other colors are there? What categories does white fit into? What metaphors involve whiteness? And from each of the ideas you generate as answers to those questions, you can quickly generate another set of associations. Three or four jumps, and the relationship between the two ideas is unrecoverable except by the path you traced. This is not the mark of hierarchical organization.\\n\\nTiddlyWiki mirrors the way you think. While you can create traditional categories and hierarchies where they're helpful, these aren't the primary way of organizing content. Instead, you break ideas out into small, reusable pieces called [[tiddlers|Tiddlers]], and relate them and further describe their properties using [[links|Links]], [[tags|Tags]], and [[fields|Fields]]. You can query based on all these properties and more using [[filters|Filters]], and weave tiddlers together into other tiddlers to create aggregations and summaries using [[transclusion|Field Transclusions]].\\n\\nThese mechanisms, properly used, allow relationships between ideas to magically jump out at you, and you can easily find the related bits that you //just know// are there somewhere but can't ever seem to find in traditional notes systems. Sometimes you may even find notes you didn't remember you took but turn out to be exactly what you need. Almost every TiddlyWiki user has had the experience of having some brilliant new idea and going to the appropriate spot to add it, only to find that it's already there.\\n\\nMost notes systems fail at the seemingly elementary requirement of matching the way you think. (Why would you use a tool for thinking that doesn't match the way you think?) A few succeed, but those that do usually don't also have the advantages below.\\n\\n</$details><$details summary=\\\"Easy and flexible formatting\\\">\\n\\nIn TiddlyWiki, notes are written and formatted using a markup language called [[wikitext|Wikitext]] (rather like [[Markdown|https://en.wikipedia.org/wiki/Markdown]]). This language is relatively easy to learn and offers a more flexible way of formatting notes than WYSIWYG editors like those used by word processors or email programs.\\n\\nAdvanced users or anyone needing detailed control over how their notes look can fall back to [[HTML]] and [[CSS|Stylesheets]], the same languages used for styling web pages. You can write [[procedures|Procedures]] or use [[templates|Templates and the Current Tiddler]], along with CSS, for full [[separation of content and presentation|https://en.wikipedia.org/wiki/Separation_of_content_and_presentation]]. You can even write parts of your notes directly in HTML or in Markdown (via a plugin) if you like.\\n\\n[img [side-by-side-wikitext.png]]\\n\\n</$details><$details summary=\\\"Radically customizable\\\">\\n\\nWikitext is mostly a formatting language, but it's also a declarative language for finding and making changes to notes. For instance, you can create an automatically-updating list of all the kinds of tea you've discussed in your wiki, each with a companion button that takes you to the webpage where you can reorder it and records that you've done so in a list of purchases. //Grok TiddlyWiki// implements an integrated spaced-repetition flashcards program, [[TakeAway|TakeAway Help]], entirely in wikitext.\\n\\nAlmost every aspect of TiddlyWiki's user interface and behavior can be customized. The out-of-the-box behavior is plenty good for many use cases already, but as you settle into any workflow, you'll probably find some things that could be a little easier. TiddlyWiki will let you make those easier, perhaps with the help of [[scores of useful plugins|Useful Plugins]] on the web.\\n\\nTiddlyWiki is customized in a different way than most other applications, too. Rather than using plugins that are written outside the app in a different programming language, TiddlyWiki is written and customized //using TiddlyWiki//: both the content in your wiki and the wiki software itself [[are written in wikitext|Looking Under the Hood]]. This means that changes to your content seamlessly blend into changes to the software. You can change something for a single page, right within that page's text, and later expand it to a set of pages, or your whole wiki. You don't have to open another app to work on the software, and any changes you make take effect instantly, so there's no friction in tweaking something. This ability to evolve your content and your tools simultaneously, in the same place, using the same language, [[is efficient, empowering, and mind-expanding|https://mosmu.se/reflexive]] in a way that's difficult to explain until you try it.\\n\\n</$details><$details summary=\\\"Free, future-proof, and portable\\\">\\n\\n* TiddlyWiki is ''free as in beer''. Many notes apps are, but many of the better ones will cost you a monthly fee. A small monthly fee probably isn't a big deal, but who wouldn't prefer not having one if the software is just as good?\\n* TiddlyWiki is ''free as in freedom''. Unlike proprietary tools like Evernote, Roam Research, and OneNote, you have complete freedom to use TiddlyWiki for any purpose you want, share it with others, and modify it if you need or want to. You will never lose access to your notes because a company decided the service wasn't profitable anymore. If you're planning a long-term project, this should be non-negotiable.\\n* TiddlyWiki has a ''commitment to longevity''. TiddlyWiki [[has been around since 2004|https://tiddlywiki.com/static/History%2520of%2520TiddlyWiki.html]], and its backwards compatibility is excellent. When TiddlyWiki 5, which was an entirely new design without backwards compatibility, was introduced in 2011, the old version was not thrown out but continues to be actively maintained and considered a first-class citizen, with even the occasional new feature, for those users who still have large wikis on the old system that aren't worth migrating. This is vanishingly rare in the software world nowadays, and if you're looking at keeping a lot of important notes, it's an important quality. The only note tools I know of likely to achieve a better compatibility and longevity record than TiddlyWiki are plain-text files and paper, both of which are comparatively poor at organizing ideas.\\n* TiddlyWiki is ''portable''. It runs in an ordinary web browser, so it works on virtually any computer or operating system. Many people have reported opening unmodified TiddlyWikis from years prior and having them still work just fine in a modern browser. If you want to share your wiki with someone, you can just email them the file and be virtually assured they can open it.\\n* TiddlyWiki is ''decentralized''. You can choose to keep your wiki as a single HTML file that you can ship around or as a folder of content served by an included lightweight web server. If you go the file route but want your wiki accessible on more than one computer, you can keep it in cloud storage like Dropbox or GitHub, or use a web hosting service. Nobody gets to handle your data unless you choose to trust them, and if you become disenchanted with one provider or storage method, there are dozens of other options.\\n\\n</$details><$details summary=\\\"The bad\\\">\\n\\nWhile I love TiddlyWiki, no software is perfect, so it's worth pointing out some of TiddlyWiki's flaws as well.\\n\\n* Most importantly, TiddlyWiki ''requires some effort to master''. This is inevitable for a tool as powerful as TiddlyWiki, but it's a significant barrier nonetheless. TiddlyWiki works differently from other tools you've used, and you need to develop a few new skills to take full advantage of it. Almost anyone can learn, and this book will help you, but if you're looking for something that works great right away without any commitment on your part, TiddlyWiki may not be for you. (You can get up and running with TiddlyWiki quickly enough, but you likely won't find it much better than any other tool until you learn a bit more.)\\n* Handling ''images and attachments'' in TiddlyWiki can be somewhat troublesome. If you occasionally like to add images or attach files to your notes, this is unlikely to be a big deal. If the main thing you want to do with your note-taking app is organize images or other files, you may be better off looking for a different solution. See [[Images and Attachments]] for details.\\n* TiddlyWiki's ''keyboard shortcuts'' are somewhat deficient compared to a desktop notes application, at least in a default setup, although this has improved recently. It is possible, however, to give at least the text entry fields some standard keybindings (e.g., vi-compatible) using the [[CodeMirror plugin|Useful Plugins]].\\n* Using TiddlyWiki to collaborate on a wiki with ''multiple users'' is still in its infancy. While there is some effort at changing this, particularly with the [[Bob plugin|https://github.com/OokTech/TW5-Bob]], TiddlyWiki is by and large a single-user tool.\\n\\n</$details>\\n\\n!! Experience TW for yourself\\n\\nIf you have around an hour, check out the video [[Experience TiddlyWiki Fluency: Creating a Reading List|https://www.youtube.com/watch?v=vsdDs7oOLlg]], which will show you the experience of building a small tool in TiddlyWiki. You can also play around in some [[Public Wikis]], such as my [[Mosaic Muse|https://mosmu.se]].\\n\\n<iframe style=\\\"width: 100%; height: 3in;\\\" src=\\\"https://www.youtube.com/embed/vsdDs7oOLlg\\\" title=\\\"YouTube video player\\\" frameborder=\\\"0\\\" allow=\\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\\\" allowfullscreen></iframe>\\n\\n!! Sold?\\n\\nIf TiddlyWiki sounds like what you've been looking for, proceed to [[Philosophy of Grok TiddlyWiki]] to see if this book is a good way for you to learn TiddlyWiki, to [[How to Use This Book]] to learn more about how the book works, or to [[The Shape of TiddlyWiki|The Shape of TiddlyWiki]] to jump in.\\n\\nIf you end up using and liking this book, consider <a href={{$:/sib/DonationLink}} class=\\\"tc-tiddlylink-external\\\">chipping in a few dollars</a> to support my work on it.\"},\"Widgets\":{\"title\":\"Widgets\",\"created\":\"20201125033901397\",\"description\":\"Widgets are a TiddlyWiki extension to HTML exposing wiki-specific functionality.\",\"modified\":\"20241015032005027\",\"parent\":\"Filtering and Formatting\",\"tags\":\"Section Concept\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"''Widgets'' {{Ltc:WidgetsExtension||LieToChildrenTemplate}} to [[HTML]]. They look and work almost exactly like HTML elements, except they have a `$` before the tag name, and TiddlyWiki does further processing on them prior to sending them to your browser for display.\\n\\nAll the formatting instructions you use in wikitext, like `//italics//` or `[[links]]`, have either a corresponding HTML element or a corresponding widget. Just like we sometimes need or want to use raw HTML elements for more control over formatting, we sometimes need or want to use raw widgets.\\n\\nThere are also many widgets that have no equivalent at all in wikitext, because you can only make the symbols on the keyboard do so many things! We will be seeing some of these widgets throughout the rest of the book.\\n\\nYou can also write your own widgets in wikitext. We'll learn how to do this in <<gtw.link-chapter-number \\\"Macros, Wikification, and Widgets\\\">>, in [[Custom Widgets]].\\n\\n!! Widget example\\n\\nLet's suppose we want to link to another tiddler. You can create a link with the double-bracket syntax in wikitext:\\n\\n{{Sn:WikitextLink||MagicSnippet}}\\n\\nOr you can use the `$link` widget:\\n\\n{{Sn:WidgetLink||MagicSnippet}}\\n\\nAt the moment, this looks like it's just an overly verbose way to write a link, but in later chapters, we'll see that there are some things that we can do with this syntax that we can't do with the double-bracket syntax.\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Wikification\":{\"title\":\"Wikification\",\"created\":\"20201124152747833\",\"description\":\"TiddlyWiki converts wikitext into HTML for display by //wikifying// it. This process may sometimes need to be triggered manually.\",\"imageurl\":\"https://upload.wikimedia.org/wikipedia/commons/b/bb/Kittyply_edit1.jpg?download\",\"modified\":\"20241016131345928\",\"parent\":\"Macros, Wikification, and Widgets\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"\\\\define wikipediaUrl(article)\\n  {{$:/BaseWikipediaUrl}}/$article$\\n\\\\end\\n\\n''Wikification'', in TiddlyWiki, is the process of taking wikitext and turning it into pure HTML that a browser can read directly (or, occasionally, into plain text or some other format). This includes processing markup like `//italics//`, rendering widgets, calling procedures, transcluding other tiddlers, and so on.\\n\\nWikification can be understood as a sort of pre-processing or pre-rendering: first TiddlyWiki renders the wikitext into HTML, then your browser renders the HTML on your screen.\\n\\n!! When wikification happens\\n\\nObviously, processing and formatting wikitext is one of the most essential functions of TiddlyWiki. It happens any time a tiddler is displayed. However, just because you put some wikitext somewhere in TiddlyWiki does not guarantee it will be wikified.\\n\\nIn general, ''any time a chunk of wikitext ends up in the body of a tiddler that is being displayed'', TiddlyWiki tries to wikify it. The chunk might be the entire text of the tiddler or the result of a single transclusion (in the most general sense, including field transclusions, variable transclusions, procedure calls, macro calls, and transcluded filter expressions). If the result of wikifying one of these things still contains wikifiable wikitext -- for instance, the result of wikifying the `{{tiddler!!field}}` transclusion syntax is some wikitext contained in the `field` field -- TiddlyWiki will try to wikify that as well. It will repeat this step until there is no more unwikified wikitext, or until it detects that it has gotten stuck in an infinite loop (recall [[Ex:SelfTransclusion]]).\\n\\nHowever, there is one huge exception: when you use a variable or field transclusion as a parameter to an HTML or widget attribute, ''the result of this transclusion is //not// wikified''. In other words, TiddlyWiki doesn't attempt to repeatedly wikify the result of the initial transclusion like it does with body text; it does it exactly once and then stops.\\n\\nThis will become more clear with an example:\\n\\n{{Sn:TestVar12||MagicSnippet}}\\n\\nAs you can see, `XYZ` is rendered by this snippet. Let's follow along with TiddlyWiki to see why:\\n\\n# In the first `$let` widget, the variable `testVar1` gets set to the text `XYZ`.\\n# In the second `$let` widget, the variable `testVar2` gets set to the text `<<testVar1>>`.\\n# The variable `<<testVar2>>` is used directly within the body of the tiddler. When rendering the tiddler, TiddlyWiki comes to this variable transclusion and looks up the value of the variable `testVar2`; it finds the text `<<testVar1>>`.\\n# `<<testVar1>>` is a new chunk of wikitext that can be further processed, so TiddlyWiki wikifies that as well. This time that process finds another variable transclusion, and it substitutes the value of the variable `testVar1`, yielding `XYZ`.\\n# At this point, there is nothing left to do with the text `XYZ`, since it is already plain text with no wikitext syntax, so TiddlyWiki sends the text `XYZ` to your browser to display and moves on to the rest of the tiddler.\\n\\nHowever, if we make a minor change so that `testVar2` is the attribute of a widget…\\n\\n{{Sn:TestVar122||MagicSnippet}}\\n\\n…now the literal text `<<testVar1>>` prints out:\\n\\n# In the first `$let` widget, the variable `testVar1` gets set to the text `XYZ`.\\n# In the second `$let` widget, the variable `testVar2` gets set to the text `<<testVar1>>`.\\n# `<<testVar2>>` is used as an HTML attribute. When rendering the tiddler, TiddlyWiki comes to this variable transclusion and looks up the value of the variable `testVar2`; it finds `<<testVar1>>`.\\n# Because this is an HTML attribute, TiddlyWiki does not attempt to wikify the result, `<<testVar1>>`, again; instead, it passes it directly to the `$text` widget.\\n# The `$text` widget sees that it's been asked to display the text `<<testVar1>>`, so it does so.\\n\\nYou might initially think this has something to do with the `$text` widget in particular, since that widget's usual use is to inhibit wikification or formatting, but that isn't the case; it applies to any widget or HTML tag, as we'll see in a moment.\\n\\n(//Note//: Using a single `$let` widget instead of two in the above examples would have exactly the same effect as using two separate ones; we've simply left them separate in this example to make the order of operations as clear as possible.)\\n\\n\\n!! Manual wikification\\n\\nThat was a good example for demonstrating what TiddlyWiki does and does not wikify, but it didn't do anything useful, so at this point it may be hard to see why it matters that TiddlyWiki does not repeatedly wikify attributes. As a more practical example, let's suppose that we're creating a wiki about animals, and we want to include a picture of each animal in its corresponding tiddler. We might add an `imageurl` field to each tiddler to store the URL of an appropriate image. We then want to create a template, called `TiddlerImage`, that displays the image found in the `imageurl` field of the current tiddler.\\n\\nLet's try this in our sample wiki. We can start the `TiddlerImage` tiddler with the HTML syntax for an image:\\n\\n```html\\n<img src={{!!imageurl}}>\\n```\\n\\nNow, if we populate the `imageurl` field on some tiddler with a URL and include the template transclusion `{{||TiddlerImage}}`, the image will appear. If you don't have an image URL handy, you can use this picture of a cat: `https://upload.wikimedia.org/wikipedia/commons/b/bb/Kittyply_edit1.jpg?download`.\\n\\nHowever, what if you want to ''keep part of the URL in another tiddler''? In the above URL, perhaps we are using a lot of images from Wikimedia Commons in our wiki, and we want to store the base URL `https://upload.wikimedia.org/wikipedia/commons` in a tiddler called `WikimediaCommonsUrl`. Then in the `imageurl` we could just use: `{{WikimediaCommonsUrl}}/b/bb/Kittyply_edit1.jpg?download`. This way, if Wikimedia Commons ever changes its web address (unlikely, to be sure!), we can quickly update all our links.\\n\\nIf you try this, though, you'll find that the image doesn't appear; instead a “broken image” icon will appear. Since it might be hard to see exactly //why// it doesn't work, try selecting the image with your browser's element inspector (if you've forgotten how that works, review [[When Things Go Wrong]]). After a close look at the HTML, the problem should be obvious: the `src` attribute literally begins with `{{WikimediaCommonsUrl}}`, it hasn't been replaced with the contents of that tiddler. Since that isn't a valid URL of an image, no image is displayed.\\n\\nHow, then, can we get the transclusion to expand? What we need is a way to wikify the wikitext //while it's still in a variable//, rather than waiting until it's actually rendered as part of a tiddler (because it never will be rendered as part of a tiddler the way we're using it). The appropriately named `$wikify` widget provides this capability. We can modify our example to use this widget as follows:\\n\\n```html\\n<$wikify name=\\\"wikifiedImageUrl\\\" text={{!!imageurl}}>\\n    <img src=<<wikifiedImageUrl>>>\\n</$wikify>\\n```\\n\\nIf you try again using this snippet, you'll find that the image appears as expected.\\n\\nThe `$wikify` widget has several other options, such as the format to parse the text into (plain text, HTML, a JSON parse tree, and so on). You can read about them in the [[documentation|https://tiddlywiki.com/#WikifyWidget]] on https://tiddlywiki.com.\\n\\n\\n!! Parameter and variable references in macros and procedures require wikification\\n\\nIt is worth pointing out that both `<<variable references>>` and `<<__macro-parameter-as-variable references__>>` are not evaluated until they are wikified, which means that such references do not work at all when their containing procedure or macro is used directly as the value of an HTML or widget attribute:\\n\\n{{Sn:AttributeParameterSubstitution||MagicSnippet}}\\n\\nYou can fix this by manually wikifying:\\n\\n{{Sn:AttributeParameterSubstitutionWikified||MagicSnippet}}\\n\\nIf you use a [[macro|Macros]], you can also use text substitution to get the result you want, and this is one of the key scenarios in which macros may remain more convenient than procedures:\\n\\n{{Sn:AttributeParameterSubstitutionMacro||MagicSnippet}}\\n\\n\\n!! Exercises\\n\\n{{Ex:WikifyWikipediaLink||ExerciseTemplate}}\\n{{Ex:WikifiedQuotation||ExerciseTemplate}}\\n\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\\n\"},\"Wikitext Reference\":{\"title\":\"Wikitext Reference\",\"created\":\"20210131044310808\",\"description\":\"A concise listing of the most common wikitext syntax.\",\"list\":\"Wr:InlineFormatting Wr:Links Wr:Headings Wr:Lists Wr:Quotes Wr:CodeBlocks Wr:Images Wr:Transclusions Wr:Tables Wr:HorizontalRules Wr:LineBreaks Wr:Styles\",\"modified\":\"20240928200223472\",\"parent\":\"Appendices\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"[[Wikitext]] is extremely powerful, but can take some time to fully internalize. When clicking the buttons on the editor toolbar isn't enough to remind you what syntax to use, you can review this concise, example-heavy appendix for details on the most common wikitext markup.\\n\\nThis reference is not exhaustive. In particular, [[widgets|Widgets]] are not included, as that would make it unreasonably long. You can quickly find details on all the widgets by searching in the [[TiddlyWiki documentation|https://tiddlywiki.com]].\\n\\n<$list filter=\\\"[<renderingStatic>!match[yes]]\\\" variable=_ emptyMessage=<<list-links \\\"[all[tiddlers+shadows]tag[Wikitext Reference]]\\\">>>\\n  <<tabs \\\"[all[tiddlers+shadows]tag[Wikitext Reference]]\\\" default:\\\"Wr:InlineFormatting\\\">>\\n</$list>\"},\"Wikitext\":{\"title\":\"Wikitext\",\"created\":\"20210115203325002\",\"description\":\"Wikitext is a markup language used to format tiddlers.\",\"modified\":\"20240614043856659\",\"parent\":\"The Shape of TiddlyWiki\",\"tags\":\"Concept Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Many text-editing and note-taking tools are //WYSIWYG// (“What You See is What You Get”): that is, while editing the document, it looks exactly like it will look when viewed or printed. Common tools like Microsoft Word, Google Docs, Outlook, Gmail, and Evernote use this type of editor.\\n\\nTiddlyWiki takes a different approach: it uses a ''markup language'', or ''WYSIWYM'' paradigm (“What You See is What You Mean”). In this type of editor, you see only plain text while editing, and you include special characters or phrases (“markup”) along with the text to explain how it should be formatted when you view it. For instance, to see text in //italics// while viewing it, you put it between `//double slashes//` while editing.\\n\\nIf you've never used a markup language before, this may seem like a primitive and overly difficult way to write content, and it's true that markup languages take a little longer to learn than WYSIWYG editors, but once you've learned them, they are more powerful. (Check out the [[Advantages of WYSIWYM]] appendix for details.)\\n\\nTiddlyWiki calls its markup language ''wikitext''. The basic structure of TiddlyWiki wikitext is similar to that of other popular markup languages like Markdown, MediaWiki, reStructuredText, and AsciiDoc. However, wikitext is more powerful than most other markup languages, because it offers expressions that pull data from and make decisions based on other tiddlers in your wiki. If you have some content stored somewhere in your wiki in a consistent format (which we'll learn how to do in this chapter and the next), you can use wikitext to slice and process it and display it in a different format -- it's like a spreadsheet for your notes. In fact, this facility is so flexible that the majority of TiddlyWiki itself is implemented in wikitext, rather than in a traditional programming language.\\n\\n\\nWe'll look at some of the most important and popular wikitext syntax shortly. (//Syntax// comprises the rules for producing correctly formed sentences or expressions in a natural or computer language.) You can also visit the [[Wikitext Reference]] appendix at any time to look up the syntax.\\n\\nA useful tool as you're learning is TiddlyWiki's ''editor toolbar'', which includes a number of buttons that insert common markup. For instance, you can click the italics button to insert the text `////` and put the cursor in between the slashes, or click the button with some text already highlighted to surround it with slashes. TiddlyWiki also offers a side-by-side preview, so you can write wikitext on the left and see the displayed version on the right; we'll see how to do this when we start writing tiddlers in the [[Journal Tiddlers]] section. Here's an example of what writing in wikitext looks like with the side-by-side preview (from my [[Mosaic Muse|Public Wikis]] wiki):\\n\\n[img[side-by-side-wikitext.png]]\\n\\nSometimes text in the raw markup language (in TiddlyWiki, that's wikitext) is called ''source'', and the displayed version is called ''output''. In the screenshot above, the left half is source and the right half is output. The process of turning source into output and displaying it on the screen is called ''rendering''.\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\\n\\n\\n\"},\"Working with Dates\":{\"title\":\"Working with Dates\",\"created\":\"20210206180622120\",\"description\":\"TiddlyWiki offers tooling for displaying, retrieving, and computing differences between dates.\",\"modified\":\"20241017010444959\",\"parent\":\"Tips and Tricks\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Dates are messy. The calendar is weird, for one thing: days of the week don't fall on the same days every year, there are leap years, there used to be the [[Julian calendar|https://en.wikipedia.org/wiki/Julian_calendar]]. Then time zones get in the way. Then we have a zillion different ways of writing the same dates and times.\\n\\nAll this is to say, don't expect TiddlyWiki to work miracles here: dates are hard no matter what, and TiddlyWiki doesn't work that hard for us to make them easier. But if you understand a few things, you should be able to avoid getting entirely defeated by dates and times.\\n\\n!! Timestamp format\\n\\nAs we learned in [[Meeting Tiddlers]], {{Datetime Format}}\\n\\nThis format, sometimes called a ''timestamp'', is used for storing dates in the built-in `created` and `modified` dates. You should normally use this same format for any date fields that you create, so that you can take advantage of all the other date tools described below.\\n\\nIt's possible to leave some digits of precision off, for instance, the milliseconds. Any missing digits are assumed to be zero (if this produces an invalid date, the result is relatively meaningless but will be an earlier day than the remaining digits would suggest).\\n\\n''Beware of leaving the time off entirely.'' If you do that, it will be midnight UTC, and if you live in the Western Hemisphere, your timezone has a negative [[UTC offset|https://en.wikipedia.org/wiki/UTC_offset]]. This will cause dates at midnight UTC to roll over to the previous day when converted to your local time (so if you say `20200602`, it will display as June 1, 2020). It's safer to specify a time of 12:00 noon if you don't care about the time -- this will always work right //almost// everywhere in the world (there are a handful of locations around the Pacific that have a +12 or higher offset, so if you live there you might need to bring it back a couple of hours).\\n\\n\\n!! Displaying dates\\n\\nWay back in [[Meeting Tiddlers]], you were given the following mysterious magic snippet to check your work writing a date field:\\n\\n{{Sn:MagicDateSnippet||BasicSnippet}}\\n\\nThis ought to be easier to understand now. The `$view` widget, as mentioned in [[Hiding and Showing Things]], allows you to look at the contents of fields. It's much like [[transcluding a field|Field Transclusions]], but it doesn't wikify the contents; instead, it can display them verbatim or apply a variety of other formats. In this case, we've chosen the `date` option, one of the widget's most important applications. We additionally have to supply a `template`, which is a date format string, consisting of placeholders describing what components of a date should go where. In this case, it shows the day of the month, the month name, the four-digit year, and the hour, minute, and second in 12-hour format, with AM or PM listed at the end. A list of all the placeholders can be found in the [[Date Format|https://tiddlywiki.com/#DateFormat]] section of the TiddlyWiki documentation.\\n\\nAs another example, let's see on what day the `Metadata` tiddler describing the version of this book was last modified, in a long date format typical for the United States:\\n\\n{{Sn:MetadataDateUpdated||MagicSnippet}}\\n\\n\\n!! Getting the current date\\n\\nAs we discussed in [[Creating Tiddlers With Predefined Fields]], it's commonly helpful to ''retrieve the current date and time'' in order to prefill a field. This can be done with the `now` macro, which accepts any date format string, as described above, as a parameter. For some reason, it does not default to the format string needed to produce the standard internal format, which isn't exactly easy to remember, so I find it helpful to add a [[function|Functions]] like the following:\\n\\n{{Sn:NowTimestamp||MagicSnippet}}\\n\\n(Why use a function rather than a procedure or macro? That's such a good question that I'll leave it as an exercise.)\\n\\n\\n!! Calculations with dates\\n\\nYou can use the `days` filter operator to find tiddlers that have a date tiddler before or after a particular time relative to the current date. For instance, to find all meetings that have occurred in the last 7 days or have yet to occur, we could say:\\n\\n```html\\n<<list-links \\\"[tag[Meeting]days:at[-7]]\\\">>\\n```\\n\\nUnfortunately, the [[documentation|https://tiddlywiki.com/#days%20Operator]] of the `days` operator is, as of this writing, almost useless. I have read it dozens of times and am no closer to understanding what it means, and nobody I have talked to has professed to actually understand the operator. A more useful reference I often visit is this [[forum thread|https://groups.google.com/g/tiddlywiki/c/60yAONBAh04/]]; you might want to bookmark that now.\\n\\n\\n!! Plugins\\n\\nFor more complicated needs, a wide variety of [[plugins|Useful Plugins]] and tricks are available, including these:\\n\\n* [[Calculating “N days from now”|https://groups.google.com/g/tiddlywiki/c/y_GjM302u60]]\\n* [[Date picker|http://kixam.github.io/TW5-datePicker/]] -- provides an `$edit-date` widget so you don't have to manually figure out what the appropriate timestamp is for an arbitrary date\\n\\n\\n!! Exercises\\n\\n{{Ex:CreatedNowButton||ExerciseTemplate}}\\n{{Ex:NowTimestampFunction||ExerciseTemplate}}\\n{{Ex:DateFormatter||ExerciseTemplate}}\\n\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Wr:CodeBlocks\":{\"title\":\"Wr:CodeBlocks\",\"caption\":\"{{$:/core/images/mono-block}} Code blocks\",\"created\":\"20210131145918563\",\"modified\":\"20210320144937334\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Code blocks work much like block quotes, only they begin and end with <code>&#96;&#96;&#96;</code> instead of `<<<`, and they display their contents in a fixed-width font, respecting line breaks. If you install the official Highlight [[plugin|Plugins]], you can also specify a language for [[syntax highlighting|https://en.wikipedia.org/wiki/Syntax_highlighting]] after the opening backticks.\\n\\n{{Sn:WikitextCodeBlock||MagicSnippet}}\"},\"Wr:Headings\":{\"title\":\"Wr:Headings\",\"caption\":\"{{$:/core/images/heading-1}} Headings\",\"created\":\"20210131145939469\",\"modified\":\"20241017011831660\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"{{Sn:WikitextHeadings||MagicSnippet}}\\n\\nHeadings should be used sparingly in TiddlyWiki. If you find yourself creating complex multi-level headings within a tiddler, you [[should probably be creating multiple tiddlers|Slicing Up Content]] instead.\\n\\nHeading 1 is usually not used (in HTML documents, it is reserved for the page title).\\n\\nAnything below Heading 4 is smaller than the body text and not particularly useful. If you find yourself needing anything deeper than Heading 3, you should almost certainly be splitting into multiple tiddlers anyway. I usually try to avoid more than one level of headings within an individual tiddler.\\n\\nHeadings are [[block-level elements|Block Mode and Inline Mode]], so you need to put a blank line between text and a following heading, or the heading will get rolled into the preceding paragraph, which is almost certainly not what you want:\\n\\n{{Sn:WikitextHeadingsRolledIn||MagicSnippet}}\"},\"Wr:HorizontalRules\":{\"title\":\"Wr:HorizontalRules\",\"caption\":\"Horizontal rules\",\"created\":\"20210131152830004\",\"modified\":\"20210320145050316\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"You can put a horizontal rule in your tiddler to mark a new, unnamed section by putting at least three hyphens on a line by themselves after a blank line:\\n\\n{{Sn:WikitextHorizontalRule||MagicSnippet}}\"},\"Wr:Images\":{\"title\":\"Wr:Images\",\"caption\":\"{{$:/core/images/picture}} Images\",\"created\":\"20210131152534431\",\"modified\":\"20241017012010146\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"[[Image tiddlers|Images and Attachments]] can be simply displayed within other tiddlers by [[transcluding the image tiddler|Field Transclusions]]:\\n\\n{{Sn:WikitextImageTransclusion||MagicSnippet}}\\n\\nUsing the `img` link-like syntax, you can also specify a size:\\n\\n{{Sn:WikitextImageImgify||MagicSnippet}}\\n\\nThe `img` syntax can also directly include images available at a web URL:\\n\\n{{Sn:WikitextWebImage||MagicSnippet}}\\n\\nFor more on including images in your wiki, see [[Images and Attachments]].\"},\"Wr:InlineFormatting\":{\"title\":\"Wr:InlineFormatting\",\"caption\":\"{{$:/core/images/italic}} Inline formatting\",\"created\":\"20210131145932529\",\"modified\":\"20210322015851587\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"{{Sn:WikitextInlineTextFormatting||MagicSnippet}}\\n\\nUsing backticks to create monospaced text also inhibits further parsing of wikitext inside the backticks, so you can use this to talk about TiddlyWiki markup or prevent TiddlyWiki from treating computer code or other punctuation-heavy text as wiki markup.\\n\\nWhen creating bold italics (or any other combination of formatting), be sure to close the bold and italic in the opposite order you opened them, or you will [[get stuck in inline mode|Block Mode and Inline Mode]] and the remainder of the tiddler will be formatted incorrectly:\\n\\n{{Sn:WikitextBoldItalicBad||MagicSnippet}}\"},\"Wr:LineBreaks\":{\"title\":\"Wr:LineBreaks\",\"caption\":\"Maintaining line breaks\",\"created\":\"20210131151340756\",\"modified\":\"20210131153038726\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Normally, TiddlyWiki only starts a new paragraph when you leave a blank line (two presses of the Enter key). While usually helpful, this can be unwanted in a few circumstances, like when trying to display poetry. You can turn off this behavior for a block of text by wrapping it in triple quotes:\\n\\n{{Sn:WikitextTripleQuotes||MagicSnippet}}\\n\\nWhen displaying passages this way, you might also want to put the text in a block quote or indent some lines. You can combine this with the block-quote syntax, and use HTML //em spaces// (`&emsp;`) to add a small indent:\\n\\n{{Sn:WikitextPoetryMarkup||MagicSnippet}}\\n\"},\"Wr:Links\":{\"title\":\"Wr:Links\",\"caption\":\"{{$:/core/images/link}} Links\",\"created\":\"20210131145925457\",\"modified\":\"20240614032354443\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"You can create both internal and external [[links|Links]] using the `[[double bracket]]` syntax. Internal links go to another tiddler, while external links go to a URL; TiddlyWiki automatically selects the correct type based on the link target. To make the link text different than the target, you place the link text first, followed by a pipe (`|`) character and then the link target.\\n\\nHere are some examples:\\n\\n{{Sn:WikitextLinksExample||MagicSnippet}}\\n\\nURLs or paths to files are automatically linked if they appear in the text of your tiddler. However, there are a handful of cases where TiddlyWiki can't automatically detect something as a URL, for instance if it's a relative path to a file on your computer (see [[Images and Attachments]]) for why you might want that. Then placing the path by itself will make it normal text, and putting it in double square brackets will try to link to a tiddler with that name. In this case, you can use the `ext` syntax to force an external link.\\n\\n{{Sn:WikitextExtForce||MagicSnippet}}\\n\\nIf CamelCase links are on in the control panel, words in CamelCase are automatically turned into links. If you want to prevent a CamelCase word from turning into a link, prefix it with a tilde: `~CamelCase`. See the [[CamelCase appendix|CamelCase]] for details.\"},\"Wr:Lists\":{\"title\":\"Wr:Lists\",\"caption\":\"{{$:/core/images/list-bullet}} Lists\",\"created\":\"20210131145945917\",\"modified\":\"20210320145234700\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Bulleted (//unordered//) lists:\\n\\n{{Sn:WikitextBulletedList||MagicSnippet}}\\n\\nNumbered (//ordered//) lists:\\n\\n{{Sn:WikitextNumberedList||MagicSnippet}}\\n\\nBulleted and numbered lists can be combined:\\n\\n{{Sn:WikitextCombinedList||MagicSnippet}}\\n\\nTo nest multiple lines of [[HTML]] within a wikitext list, for instance to include multiple paragraphs or other complicated content within a single list item, you can open a `<div>` at the end of a list element:\\n\\n{{Sn:WikitextHtmlInList||MagicSnippet}}\\n\\nDefinition lists:\\n\\n{{Sn:WikitextDefinitionList||MagicSnippet}}\"},\"Wr:Quotes\":{\"title\":\"Wr:Quotes\",\"caption\":\"{{$:/core/images/quote}} Quotes\",\"created\":\"20210131145912549\",\"modified\":\"20210320145248231\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"There are two forms of block quotes. The line form uses a single `>`, like plain-text email. This form can be nested. The block form opens and closes with `<<<` on a separate line.\\n\\n{{Sn:WikitextQuotes||MagicSnippet}}\"},\"Wr:Styles\":{\"title\":\"Wr:Styles\",\"caption\":\"Styles\",\"created\":\"20210131152547938\",\"modified\":\"20210131154106270\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"You can apply arbitrary CSS styles or classes to blocks of text.\\n\\n{{Sn:WikitextStyles||MagicSnippet}}\\n\\nSee [[Stylesheets]] for more information on styles and this syntax.\"},\"Wr:Tables\":{\"title\":\"Wr:Tables\",\"caption\":\"Tables\",\"created\":\"20210131145854489\",\"modified\":\"20210213232523034\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Tables are created by putting pipe characters (`|`) between the columns, and putting each row on a separate line. A `!` can be placed at the beginning of a cell to turn it into a header.\\n\\n{{Sn:WikitextTableReference||MagicSnippet}}\\n\\nAlignment can be accomplished by adding spaces next to the vertical bars. To left-align, put a space at the right; to right-align, put a space at the left; and to center-align, put a space on both sides. By default, header cells are centered and other cells are left-aligned. You can see this in action below:\\n\\n{{Sn:WikitextTableAlignment||MagicSnippet}}\\n\\nIt's also possible to merge cells and apply further [[HTML]] markup. In most cases, you likely won't need these features, but if they sound useful, you can read about them in the [[TiddlyWiki documentation|https://tiddlywiki.com/#Tables%20in%20WikiText]].\"},\"Wr:Transclusions\":{\"title\":\"Wr:Transclusions\",\"caption\":\"{{$:/core/images/transcludify}} Transclusions\",\"created\":\"20210131145843458\",\"modified\":\"20241017012125083\",\"tags\":\"[[Wikitext Reference]]\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"[[Transclusions|Transclusion]] of [[fields|Fields]], [[variables|Variables]], [[procedures|Procedures]], [[functions|Functions]], and [[macros|Macros]] are an essential part of TiddlyWiki. Here's the standard syntax for including bits and pieces from other places in a tiddler.\\n\\nSee [[Updated Summary of Transclusion Syntax]] for a more detailed treatment.\\n\\n<table class=\\\"gtw-transclusions-table\\\" >\\n  <tr>\\n    <td>[[Transclude the text field of a tiddler|Field Transclusions]]</td>\\n    <td>{{Sn:WikitextTransclusionBasic||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>[[Transclude a specific field of a tiddler|Field Transclusions]], here `caption`</td>\\n    <td>{{Sn:WikitextTransclusionField||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Transclude an index from a [[data tiddler|Data Tiddlers]]</td>\\n    <td>(The [[Metadata]] tiddler contains details about //Grok TiddlyWiki// like its version number and project URL.)\\n\\n    {{Sn:WikitextTransclusionData||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>[[Transclude a tiddler through a template|Templates and the Current Tiddler]]</td>\\n    <td>{{Sn:WikitextTransclusionTemplate||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Transclude the [[current tiddler|Templates and the Current Tiddler]] through a template</td>\\n    <td>{{Sn:WikitextCurrentTransclusionTemplate||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Transclude a tiddler [[with parameters|Parameterizing Field Transclusions]]</td>\\n    <td>\\n\\n```html\\n{{Sn:WikitextParameterTransclusion|param1|param2}}\\n```\\n\\n      (This one can't be shown as a live example because the live example code loses the parameters before they can be passed on.)\\n    </td>\\n  </tr>\\n  <tr>\\n    <td>[[Transclude the result|Filters and Transclusions]] of a [[filter|Filters]]</td>\\n    <td>{{Sn:WikitextTransclusionFilter||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Transclude the result of a filter through a [[template|Templates and the Current Tiddler]]</td>\\n    <td>{{Sn:WikitextTransclusionFilterTemplate||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Transclude the value of a [[variable|Variables]]</td>\\n    <td>{{Sn:WikitextTransclusionVariable||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Call a [[procedure|Procedures]]</td>\\n    <td>{{Sn:WikitextTransclusionProcedure||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Transclude the result of the first item in a filter expression returned by a [[function|Functions]]</td>\\n    <td>{{Sn:WikitextTransclusionFunctionAngles||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Call a [[function|Functions]] within a filter expression using the `function` operator</td>\\n    <td>{{Sn:WikitextTransclusionFunctionFunction||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Call a [[function|Functions]] within a filter expression as an operator (requires the function to have a `.` in its name)</td>\\n    <td>{{Sn:WikitextTransclusionFunctionDotOperator||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Call a [[macro|Macros]] (transcluding its result), treating its parameter as a variable</td>\\n    <td>{{Sn:WikitextTransclusionMacro||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Call a [[macro|Macros]] (transcluding its result), using its parameter in text substitution</td>\\n    <td>{{Sn:WikitextTransclusionMacroSubst||MagicSnippet}}</td>\\n  </tr>\\n  <tr>\\n    <td>Include the value of a variable in a macro via text substitution</td>\\n    <td>{{Sn:MacroVariableTextSubstitution||MagicSnippet}}</td>\\n  </tr>\\n</table>\\n\\n<style>\\ntable.gtw-transclusions-table {\\n  width: 100%;\\n}\\ntable.gtw-transclusions-table tr td {\\n  padding: 5px;\\n}\\ntable.gtw-transclusions-table tr td:first {\\n  width: 20%;\\n}\\n</style>\"},\"Writing Shell Scripts Against a TiddlyWiki\":{\"title\":\"Writing Shell Scripts Against a TiddlyWiki\",\"created\":\"20200822201508518\",\"description\":\"External tools can access the data in your TiddlyWiki by reading files and calling a Node.js CLI.\",\"modified\":\"20241017011525566\",\"parent\":\"Getting Technical\",\"prerequisite\":\"A basic background in shell scripting or some other scripting language like Python\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"(''Prerequisite'' for this section: {{!!prerequisite}}.)\\n\\nIf you're a [[Unix philosophy|https://en.wikipedia.org/wiki/Unix_philosophy]] person and believe that programs should do one thing well and integrate well with other programs, you might be wondering whether your data is going to be trapped in TiddlyWiki. Good news: if you install the Node.js backend on your computer and host your wiki there, you can easily integrate with other programs in whatever way you please. (It's also possible to quickly convert a single-file wiki to a Node.js folder wiki, so if you prefer to use a single file but sometimes need to get at the contents programmatically, you can extract a new folder wiki from the file to a temporary directory and then operate on that. [[TiddlyRemember|https://sobjornstad.github.io/TiddlyRemember/]], for instance, works this way.)\\n\\n\\n!! File structure\\n\\nThe Node.js backend stores text tiddlers in individual files, which are easy for a script or other application to read. The format is much like email: first the fields of the tiddler are listed with the name separated from the value by a colon and a space, and then after one blank line comes the contents of the `text` field.\\n\\nTiddlers containing non-textual data, such as images, are instead included unmodified, and the fields associated with their tiddlers are stored in a separate text file with a `.meta` extension (the `text` field is set to the unmodified main file). So if you have an image tiddler called `image.png`, there will be an `image.png` PNG file which can be opened in a normal image viewer, and an `image.png.meta` file containing the fields of the tiddler.\\n\\nFor the most part, the names of tiddlers are used as their filenames, with a `.tid` extension added. However, a few characters are changed so as to avoid those that are invalid in filenames on some operating systems. It's also possible to add additional transformations as TiddlyWiki filters, for instance to put tiddlers with particular tags in a different folder. The details can be found in the [[Customizing Tiddler File Naming|https://tiddlywiki.com/#Customising Tiddler File Naming]] tiddler in the TW documentation.\\n\\n\\n!! The TiddlyWiki CLI\\n\\nWhen simply looking at the files is not enough, the ''`tiddlywiki` command'', installed with the npm package, lets you perform most any operation you need, such as rendering tiddlers to HTML or plain text, or selecting tiddlers that match a filter and writing them into a new wiki.\\n\\nThe TiddlyWiki CLI has a rather unconventional syntax that often confuses new users. Most CLIs would use positional parameters with the first parameter being the operation to perform:\\n\\n```bash\\ntiddlywiki render FILTER\\n```\\n\\nOr perhaps a positional parameter for the operations and double-dashed options for the details:\\n\\n```bash\\ntiddlywiki render --filter=FILTER\\n```\\n\\nInstead, TiddlyWiki uses double-dashed options for the actual //operations//, and positional arguments for the details on each operation:\\n\\n```bash\\ntiddlywiki --render FILTER\\n```\\n\\nYou can, and often must, chain these together. So to set the source wiki and then save the wiki folder, you would do:\\n\\n```bash\\ntiddlywiki --load SOURCE_WIKI --render FILTER\\n```\\n\\nThis is important because the CLI is stateless. From the help message, you might expect this to work:\\n\\n```bash\\ntiddlywiki --load SOURCE_WIKI\\ntiddlywiki --render FILTER\\n```\\n\\nBut it doesn't -- the first command sets the wiki to load but doesn't persist that setting, then exits, so it amounts to a no-op. The second command will continue to use the default source location (the current directory).\\n\\n\\n!! Editing wiki files\\n\\nIf you're going to edit wiki files on disk, rather than just reading them, be aware that you will need to ''restart the server to pick up the changes'', as it assumes it is the exclusive user of the folder while it's running and does not watch files on disk. The plugin [[Bob|https://github.com/OokTech/TW5-Bob]] adds listening functionality along with some other helpful features and is worth a look if you plan to do this more than occasionally.\\n\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\"},\"Your First Dynamic List\":{\"title\":\"Your First Dynamic List\",\"created\":\"20200603023508451\",\"description\":\"You can create lists of tiddlers that automatically update to show all the tiddlers that currently match a filter.\",\"modified\":\"20241015032325763\",\"parent\":\"Filtering and Formatting\",\"tags\":\"Section\",\"type\":\"text/vnd.tiddlywiki\",\"text\":\"Searching with filters is all very nice, but what if we want to look for the same thing all the time? For instance, we probably often need to go back and look at our notes from recent meetings. It would be nice to have a list of all our meetings from newest to oldest, rather than having to remember what we called each meeting or exactly when it was and search for it.\\n\\nFortunately, one of the things TiddlyWiki does best is create dynamic lists -- lists of tiddlers or other content that automatically update as the wiki changes. Dynamic lists take a filter and do something with all of the tiddlers that filter returns. In [[Slicing Up Content]], we said the role of a tiddler containing a dynamic list was much like that of a sentence: it describes the relationships between other things.\\n\\nLet's create a new tiddler to try this out in and call it `MeetingList`. If we want to give it a tag, we could tag it `Tool`.\\n\\n\\n!! Creating a `$list` widget\\n\\nThe ''`$list` widget'' is among the most important and frequently used TiddlyWiki widgets. This widget is named quite appropriately for our purpose, since we're trying to create a list, but you can also use a `$list` widget to accomplish some other things that don't necessarily look like they involve listing anything. We'll see more of those uses later.\\n\\nHere's how we create a list of meetings from the output of a filter:\\n\\n```html\\n<$list filter=\\\"[tag[Meeting]]\\\"></$list>\\n```\\n\\nThat was easy. But wait, there's something wrong…all of the meeting names are run together in a single line, without even a space between them!\\n\\nWhen the list widget is used without any contents, like we did above, it simply plops each tiddler title that the filter returns right after the previous one. In HTML, line breaks only happen when you explicitly ask for them, either with a rich formatting tag like `</p>` to indicate the end of a paragraph or `</li>` to indicate the end of a list item, or with the simple `<br>` for a line break. Let's fix this by adding a `<br>` between each item:\\n\\n```html\\n<$list filter=\\\"[tag[Meeting]]\\\">\\n  <<currentTiddler>><br>\\n</$list>\\n```\\n\\nThat's better! But you're probably wondering, what the heck is this `<<currentTiddler>>` thing? We'll be talking much more about the concept of the [[current tiddler|Templates and the Current Tiddler]], as well as the `<<double angle bracket>>` [[syntax|Variables]], in <<gtw.link-chapter-number \\\"Transclusion\\\">>. For now, just think of it as a placeholder for “the item in the list currently being processed.” (If you've done any programming, the `$list` widget is much like a loop or a functional-programming `map`: the contents of the widget are displayed once for each output tiddler in the filter.)\\n\\nThere's one more problem here, which is that we haven't actually listed our meetings from newest to oldest. Let's fix that by adding a `sort` filter step:\\n\\n```html\\nHere are all your meetings from newest to oldest:\\n\\n<$list filter=\\\"[tag[Meeting]!sort[at]]\\\">\\n  <<currentTiddler>><br>\\n</$list>\\n```\\n\\n!! The future\\n\\nIn this example, we only see a list of tiddler titles that match the search criteria, which is nifty but hardly revolutionary. However, it turns out we can actually display ''any information we want'' that can be derived from the contents of the tiddlers we're listing: any field on those tiddlers, the tiddlers they link to, the number of tags they have, and so on. We'll learn how to do this in the [[next chapter|Transclusion]].\\n\\n\\n!! Exercises\\n\\n{{Ex:JaneMeetingList||ExerciseTemplate}}\\n{{Ex:BulletedMeetingList||ExerciseTemplate}}\\n{{Ex:ContactList||ExerciseTemplate}}\\n{{Ex:ContactListNoPhoneExclusion||ExerciseTemplate}}\\n{{Ex:LinkPattern||ExerciseTemplate}}\\n\\n\\n!! Takeaways\\n\\n{{||TakeawaysTemplate}}\\n\"},\"anki-config-screenshot.png\":{\"title\":\"anki-config-screenshot.png\",\"text\":\"\",\"type\":\"image/png\",\"created\":\"20210130011052905\",\"modified\":\"20210130011003808\",\"tags\":\"Screenshot\"},\"chris-smith-empty.png\":{\"title\":\"chris-smith-empty.png\",\"text\":\"\",\"type\":\"image/png\",\"created\":\"20240829220925768\",\"modified\":\"20240829220928227\"},\"comic-sans.png\":{\"title\":\"comic-sans.png\",\"text\":\"\",\"type\":\"image/png\",\"created\":\"20240927010452237\",\"modified\":\"20240927010456814\"},\"create-th-site.png\":{\"title\":\"create-th-site.png\",\"text\":\"\",\"type\":\"image/png\",\"created\":\"20240829121822066\",\"modified\":\"20240829121824321\"},\"date-formatter-example.png\":{\"title\":\"date-formatter-example.png\",\"text\":\"\",\"type\":\"image/png\",\"created\":\"20210207181258370\",\"modified\":\"20210207181207524\",\"tags\":\"Screenshot\"},\"download-in-tiddlyhost.png\":{\"title\":\"download-in-tiddlyhost.png\",\"text\":\"\",\"type\":\"image/png\",\"created\":\"20240829121325957\",\"modified\":\"20240829121333815\"},\"edge-notched.jpg\":{\"title\":\"edge-notched.jpg\",\"text\":\"\",\"type\":\"image/jpeg\",\"created\":\"20210213211831550\",\"modified\":\"20210213211740069\",\"source\":\"Soren Bjornstad, 2021-02-06. Own work.\",\"tags\":\"Screenshot\"},\"interface.png\":{\"title\":\"interface.png\",\"text\":\"\",\"type\":\"image/png\",\"created\":\"20201125202846778\",\"modified\":\"20201125202818887\",\"tags\":\"Screenshot\"},\"open-button.png\":{\"title\":\"open-button.png\",\"text\":\"\",\"type\":\"image/png\",\"created\":\"20210408173444566\",\"modified\":\"20210408173449540\",\"tags\":\"Screenshot\"},\"savers-oh-no.png\":{\"title\":\"savers-oh-no.png\",\"text\":\"\",\"type\":\"image/png\",\"created\":\"20240829121411520\",\"modified\":\"20240829121420134\"},\"side-by-side-wikitext.png\":{\"title\":\"side-by-side-wikitext.png\",\"text\":\"\",\"type\":\"image/png\",\"created\":\"20240614035254620\",\"modified\":\"20240614035303226\"},\"xy.png\":{\"title\":\"xy.png\",\"text\":\"\",\"type\":\"image/png\",\"created\":\"20240927020741516\",\"modified\":\"20240927020741999\"}}}"
